	(10510, 421, 'tabs_1_title', 'Flavor'),
	(10511, 421, '_tabs_1_text', 'field_586bb4a1b118f'),
	(10512, 421, 'tabs_1_text', '<p><b>Aroma</b><br/><p>We were definitely "wowed" by the aroma that this Colorado-born cross possessed, as it was extremely pungent and reminded us of some of the best coffee-chocolate Bubbas we\'ve had. There were notes of smokey bourbon, anise, and a backing sharp chemmy quality that came out post-grind, making this one of the most complex aromas we\'ve encountered</p><p><b>Flavor</b><br/><p>While it was nearly impossible to live up to the aroma, the taste did come close to matching it, though it lost some of the added post-grind complexity and was mostly Bubba in profile. One of the great things about Bubba Kush is the "greasy" flavor which seems to coat the mouth and sinuses — this sample was no exception there, and we could taste it lingering for at least a half hour into the</p>'),
