	(10632, 423, 'tabs_0_text', 'This A.S.H. is an example of some classic genetic lines in perhaps the trinity of genetic lines, Afghani, Skunk, and Haze. The blend of these influences could be seen in all areas of the sample, from its structure, to its smell, to the effects. We all enjoyed this strain but saw potential for better medicinal-level duration and better flavor lurking within, namely due to what we see as a slightly'),
