	(10653, 423, '_tabs_1_text', 'field_586bb4a1b118f'),
	(10654, 423, 'tabs_1_text', '<p><b>Aroma</b><br/><p>he staff\'s consensus favorite part of this sample, the aroma was a very classic-smelling mix of musky, skunky, garlicy, vegetal, and lightly fruity/sweet all at once. The lightly sweet and fruity Afghani musk it broadcasts in the jar is rather pungent, but it increases further when ground and takes on more of the garlic dimension as well,</p><p><b>Flavor</b><br/><p>Flavor-wise, this strain was again a mix between the almost putrid, lightly sweet, fruity Afghan and slightly sharper and spicy flavors. We didn\'t feel that the smell came through to the taste as cleanly as we would have liked, we think this is partly due to the Haze-style bud structure containing a decent amount of leaf cover, which brought added harshness and standard smoke flavor to the</p>'),
