	(11080, 429, 'tabs_1_text', '<p><b>Aroma</b><br/>Strong, sweet, and fruity — the odor can get out of control when the plants are growing, so carbon filters are highly recommended.<strong> </strong></p><p><b>Flavor</b><br/>Spice-heavy and a bit sweet, often tasting of sandalwood… the Cherry and Cherry-Lime phenotypes are known for matching the taste of their namesake fruits.<strong> </strong></p>'),
