	(11221, 431, '_tabs_1_text', 'field_586bb4a1b118f'),
	(11222, 431, 'tabs_1_text', '<p><b>Aroma</b><br/><p>This strain unleashed a very unexpected blast of sweetness combined with a cocktail of spices, similar to what one would find in egg nog or mulled wine.&nbsp; A variety of smooth and sweet smells from cinnamon to cardamom was the dominant aroma.&nbsp; When it was ground up, it trended a bit more towards the standard citrus side with a vegetal</p><p><b>Flavor</b><br/><p>With&nbsp; just a hint of the spices that permeated the aroma, this strain tasted mostly of a lightly sweet piney citrus with a bit of hashiness.&nbsp; The taste was a bit ethereal, as it seemed distinct and fairly strong but then disappeared as quickly as it came, leaving us struggling to describe it in detail.&nbsp; This strain gave us an incredibly smooth smoke that upgraded the overall</p>'),
