	(11484, 435, 'tabs_0_text', ' This smoke can induce mild coughing fits as the expansion stays with you for a minute or two after smoking. It carries a solid potency for a fruity named strain and can be enjoyed sitting or on the go. It has a talkable nature, but also gives a nice introspective experience to the patient. The taste and smell are absolutely captivating, and makes for a really tasty joint to share with a group. '),
