	(11647, 437, '_tabs_1_text', 'field_586bb4a1b118f'),
	(11648, 437, 'tabs_1_text', '<p><b>Aroma</b><br/><p>The Bruce Banner takes over this smell, which is fine with us as it brings forth so many great scents. You will find soft fruit and soil, as well as a common diesel scent with pleasant earth and pine tones.</p></p><p><b>Flavor</b><br/><p>This is perfect in our opinion - a split of taste between the fruit/diesel of the strain itself and the organic matter it derived life from.</p></p>'),
