	(12073, 443, '_tabs_1_text', 'field_586bb4a1b118f'),
	(12074, 443, 'tabs_1_text', '<p><b>Aroma</b><br/><p> The high point of this strain for sure, the aroma was a wonderfully pungent mix of sweet blueberry and sharp, musky, putrid elements… which, yes, can be described as smelling like cheese. It\'s a very strange and unique taste that you really only find in Cheese strains — alternately appealing and revolting, like many fine cheeses <br></p></p><p><b>Flavor</b><br/><p> The taste took on more of the cheese elements than the smell did, while the berry sweetness fell to the background. One reviewer commented that there was even an iron/mineral-like taste, similar to what is found in very "goaty" cheeses, while others mainly picked up on peppery, sharp notes. The sweetness was still present, but the sharp tastes were stronger for sure.&nbsp;</p></p>'),
