	(12499, 449, '_tabs_1_text', 'field_586bb4a1b118f'),
	(12500, 449, 'tabs_1_text', '<p><b>Aroma</b><br/><p>Yep, this is Blueberry… this sample had that perfect sugar-coated muffin smell and was rather pungent both pre and post-grind. After the grind, a slightly musky and putrid sweetness came out, taking over for some of the sugary berry. Simply put, if you like Blueberry, you\'ll love this smell.</p></p><p><b>Flavor</b><br/><p>A tad disappointing after the sugary bouquet, the taste was a little more subdued, with only one reviewer getting the beautiful candy berry/muffin type taste out of it. It seems to be in there, but coaxing it out wasn\'t easy for everyone… there was an earthy element to it as well that came out in later hits. Rather smooth and not particularly expansive, this one was an easy smoke. </p></p>'),
