	(13180, 533, 'tabs_0_title', 'Highlights'),
	(13181, 533, '_tabs_0_text', 'field_586bb2c9b118c'),
	(13182, 533, 'tabs_0_text', '<p>For lovers of Bubba Kush, this strain is a must-try, especially for the aroma and taste package, which is potent and reminds us of the best examples of that strain we\'ve ever had. The effect is a little more uplifting and active than Bubba traditionally is, but this 303 still had quality body relaxation properties that made the incredible mood it put us in even more enjoyable.</p>'),
