	(13202, 533, 'tabs_1_title', 'Flavor'),
	(13203, 533, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(13204, 533, 'tabs_1_aroma', '<p>We were definitely "wowed" by the aroma that this Colorado-born cross possessed, as it was extremely pungent and reminded us of some of the best coffee-chocolate Bubbas we\'ve had. There were notes of smokey bourbon, anise, and a backing sharp chemmy quality that came out post-grind, making this one of the most complex aromas we\'ve encountered'),
	(13205, 533, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(13206, 533, 'tabs_1_flavor', '<p>While it was nearly impossible to live up to the aroma, the taste did come close to matching it, though it lost some of the added post-grind complexity and was mostly Bubba in profile. One of the great things about Bubba Kush is the "greasy" flavor which seems to coat the mouth and sinuses ? this sample was no exception there, and we could'),
