	(13493, 537, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(13494, 537, 'tabs_1_aroma', '<p>he staff\'s consensus favorite part of this sample, the aroma was a very classic-smelling mix of musky, skunky, garlicy, vegetal, and lightly fruity/sweet all at once. The lightly sweet and fruity Afghani musk it broadcasts in the jar is rather pungent, but it increases further when ground and takes on more of the garlic dimension as well,'),
	(13495, 537, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(13496, 537, 'tabs_1_flavor', '<p>Flavor-wise, this strain was again a mix between the almost putrid, lightly sweet, fruity Afghan and slightly sharper and spicy flavors. We didn\'t feel that the smell came through to the taste as cleanly as we would have liked, we think this is partly due to the Haze-style bud structure containing a decent amount of leaf cover, which brought'),
