	(13617, 539, 'tabs_0_text', '<p>In the garden, AC/DC is a bushy sativa and grows akin to Golden Goat and Sweet Sweet. Its leaves are so thin they feel like feathers when you brush against them. Though many CBD strains are reserved for concentrates for their overwhelmingtendency to self-polinate, AC/DC is a proven 30:1 CBD strain that holds well as finished buds and is very stable. <br></p>'),
