	(14051, 545, '_tabs_0_text', 'field_586bb2c9b118c'),
	(14052, 545, 'tabs_0_text', '<p>AK-47 used to be one of those elite strains that made everyone "ooh" audibly, but it has been knocked down a tier in the last few years with all the high-grade Kush and Diesel strains especially - this was a good reminder that it\'s a strain to reckon with, as is the even older Northern Lights #5. It\'s very clear why these strains were chosen as a hybrid - it provided a superb blend of hybrid'),
