	(14072, 545, 'tabs_1_title', 'Flavor'),
	(14073, 545, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(14074, 545, 'tabs_1_aroma', '<p>This strain unleashed a very unexpected blast of sweetness combined with a cocktail of spices, similar to what one would find in egg nog or mulled wine. A variety of smooth and sweet smells from cinnamon to cardamom was the dominant aroma. When it was ground up, it trended a bit more towards the standard citrus side with a vegetal sweetness,'),
	(14075, 545, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(14076, 545, 'tabs_1_flavor', '<p>With just a hint of the spices that permeated the aroma, this strain tasted mostly of a lightly sweet piney citrus with a bit of hashiness. The taste was a bit ethereal, as it seemed distinct and fairly strong but then disappeared as quickly as it came, leaving us struggling to describe it in detail. This strain gave us an incredibly smooth'),
