	(14196, 547, '_tabs_0_text', 'field_586bb2c9b118c'),
	(14197, 547, 'tabs_0_text', '<p>This is a bud I will go back for again and again. Perfect summer afternoon chill or go out and hang with friends, very versatile with relaxing overtones. Many of today\'s multi-breed strains seem more like abominations and fail to provide me with a real identity of their own, but the AK-48 takes all its ancenstry in stride and presents itself like an original.</p>'),
