	(14631, 553, '_tabs_0_text', 'field_586bb2c9b118c'),
	(14632, 553, 'tabs_0_text', '<p>This strain takes an A+ strain and adds a terrific new kick. The Fort Collins Cough (Northern Lights #5 x Haze #17) was one of this editor\'s personal favorites while attending CSU in the mid-late 90\'s because of its potency mixed with clarity. It was always a highly functional sativa hybrid that was only missing an exquisite flavor and scent. The BB#3 brings that to the table with perfection.'),
