	(15233, 561, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(15234, 561, 'tabs_1_aroma', '<p> The high point of this strain for sure, the aroma was a wonderfully pungent mix of sweet blueberry and sharp, musky, putrid elements… which, yes, can be described as smelling like cheese. It\'s a very strange and unique taste that you really only find in Cheese strains - alternately appealing and revolting, like many fine cheeses <br></p>'),
	(15235, 561, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(15236, 561, 'tabs_1_flavor', '<p> The taste took on more of the cheese elements than the smell did, while the berry sweetness fell to the background. One reviewer commented that there was even an iron/mineral-like taste, similar to what is found in very "goaty" cheeses, while others mainly picked up on peppery, sharp notes. The sweetness was still present, but the sharp tastes'),
