	(15502, 565, 'tabs_0_text', '<p>The Blue Hawaiian is a great looking strain with plenty of red hairs to add on to its marvel. A bit leafy on the outside, but the inside is packed full of sparkly trichomes. The buzz has a great balance of both head and body high, and a beautiful look and smell to match. Personally, the only down side is the medication is not as strong as I usually like. But, there is always a place and time'),
