	(15667, 567, 'tabs_1_title', 'Flavor'),
	(15668, 567, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(15669, 567, 'tabs_1_aroma', '<p>Yep, this is Blueberry… this sample had that perfect sugar-coated muffin smell and was rather pungent both pre and post-grind. After the grind, a slightly musky and putrid sweetness came out, taking over for some of the sugary berry. Simply put, if you like Blueberry, you\'ll love this smell.</p>'),
	(15670, 567, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(15671, 567, 'tabs_1_flavor', '<p>A tad disappointing after the sugary bouquet, the taste was a little more subdued, with only one reviewer getting the beautiful candy berry/muffin type taste out of it. It seems to be in there, but coaxing it out wasn\'t easy for everyone… there was an earthy element to it as well that came out in later hits. Rather smooth and not particularly'),
