	(15790, 569, 'tabs_0_title', 'Highlights'),
	(15791, 569, '_tabs_0_text', 'field_586bb2c9b118c'),
	(15792, 569, 'tabs_0_text', '<p>One of the most unique-looking plants we\'ve had the pleasure of photographing here at KindReviews.com, "the Bob" (as it\'s also known) is a freak confluence of quality genetics which produced a plant which is perhaps greater than the sum of its parts. ?Combining the signature Hanis nail polish/acetone-meets-chocolate aroma and flavor with the Sativa growth pattern and yield of the S.A.G.E., Bob'),
	(15793, 569, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(15794, 569, 'tabs_0_graphs', '2'),
	(15795, 569, '_tabs_0_graphs_0_label', 'field_586cc9cb03eca'),
