	(15807, 569, '_tabs_0_video', 'field_586cc9de03ecc'),
	(15808, 569, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(15809, 569, '_tabs_1_icon', 'field_589daa24ef33d'),
	(15810, 569, 'tabs_1_icon', 'fa-leaf'),
	(15811, 569, '_tabs_1_title', 'field_589daa24ef33c'),
	(15812, 569, 'tabs_1_title', 'Flavor'),
	(15813, 569, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(15814, 569, 'tabs_1_aroma', '<p>Perhaps the Bob Saget\'s most signature trait, the aroma certainly takes most strongly after the Hanis "father" plant, blending a complex, sharp chemical scent which almost resembles acetone with a slight sweetness.  The initial inhale tends to bring more of the sweetness, but as the buds are broken apart, the acrid paint thinner side comes out'),
	(15815, 569, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(15816, 569, 'tabs_1_flavor', '<p>Much like the aroma, the flavor at first has hints of sweetness and a unique floral element, but the aftertaste which lingers on the palate and in the throat (similar to Bubba Kush or Flo) is all Hanis superglue-chocolate funk.</p>'),
