	(16370, 577, '_tabs_0_text', 'field_586bb2c9b118c'),
	(16371, 577, 'tabs_0_text', '<p>This rare Diesel-Chem hybrid lives up to its lineage with a hair-curling aroma and an effect which nearly matches the smell in potency. ?Though it is a Sativa-dominant variety, it has the tendency at higher dosages to live up to its strain name, giving the user an extremely relaxed, almost narcotic feeling to go along with all the cerebral effects the Diesel and Chem family are known for.</p>'),
