	(16392, 577, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(16393, 577, 'tabs_1_aroma', '<p>The complex and pungent bouquet the Dopium offers is certainly Diesel-dominant, with that sharp chemical-fuel-rubber element which so many connoisseurs seek out taking the forefront and practically assaulting the senses.  However, there are some interesting floral and spice notes present which differentiate this cut from other Chem-Diesel'),
	(16394, 577, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(16395, 577, 'tabs_1_flavor', '<p>Less outright acrid than the aroma, the flavor still has strong notes of chemical pine and hickory smoke.  The floral side of things lingers in the aftertaste makes it more palatable for those patients who love Diesel type effects but cannot handle the "Chem breath" flavor it often leaves behind… this is a lower key, more measured'),
