	(16505, 577, '_thumbnail_id', '578'),
	(16506, 579, 'product_id', '49'),
	(16507, 579, 'in_stock', 'true'),
	(16508, 579, 'prices', '[{"unit":"","price":0}]'),
	(16509, 579, 'brand', ''),
	(16510, 579, 'type', 'Hybrid'),
	(16511, 579, '_tabs_0_icon', 'field_586be0a8ad234'),
	(16512, 579, 'tabs_0_icon', 'fa-newspaper-o'),
	(16513, 579, '_tabs_0_title', 'field_586be0a1ad233'),
	(16514, 579, 'tabs_0_title', 'Highlights'),
	(16515, 579, '_tabs_0_text', 'field_586bb2c9b118c'),
	(16516, 579, 'tabs_0_text', '<p>Though we missed the acrid Sour Diesel part of the equation at times, this was a very enjoyable Diesel experience that was neither too heavy nor too light. It felt like a true hybrid, with a blend of Sativa and Indica effects that played well together rather than battling for attention. The appearance was top-notch, with its sound but distinct structure, copious trichome coverage, and lack of'),
	(16517, 579, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(16518, 579, 'tabs_0_graphs', '2'),
	(16519, 579, '_tabs_0_graphs_0_label', 'field_586cc9cb03eca'),
	(16520, 579, 'tabs_0_graphs_0_label', 'LOREM'),
	(16521, 579, '_tabs_0_graphs_0_value', 'field_586cc9d603ecb'),
	(16522, 579, 'tabs_0_graphs_0_value', '123456789'),
	(16523, 579, '_tabs_0_graphs_0_percent', 'field_586cc9a703ec9'),
	(16524, 579, 'tabs_0_graphs_0_percent', '0.5'),
	(16525, 579, '_tabs_0_graphs_1_label', 'field_586cc9cb03eca'),
	(16526, 579, 'tabs_0_graphs_1_label', 'LOREM'),
	(16527, 579, '_tabs_0_graphs_1_value', 'field_586cc9d603ecb'),
	(16528, 579, 'tabs_0_graphs_1_value', '123456789'),
	(16529, 579, '_tabs_0_graphs_1_percent', 'field_586cc9a703ec9'),
	(16530, 579, 'tabs_0_graphs_1_percent', '0.5'),
	(16531, 579, '_tabs_0_video', 'field_586cc9de03ecc'),
	(16532, 579, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(16533, 579, '_tabs_1_icon', 'field_589daa24ef33d'),
	(16534, 579, 'tabs_1_icon', 'fa-leaf'),
	(16535, 579, '_tabs_1_title', 'field_589daa24ef33c'),
	(16536, 579, 'tabs_1_title', 'Flavor'),
	(16537, 579, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(16538, 579, 'tabs_1_aroma', '<p>This one had some of the typical diesel notes in the jar/bag before it was ground up, but they seemed to disappear, turning into more of a sweet herby grapefruit… it seemed to be both sweet and musky at the same time, which is certainly unique. It seems that the NYCD dominated the smell department, not much of the acrid, pungent Sour Diesel'),
	(16539, 579, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(16540, 579, 'tabs_1_flavor', '<p>Similar to the smell but much less sweet-tinged, the taste was also a semi-musky citrus with some menthol qualities. It turned a bit more to the earthy/smoky side as it burned away, but overall was rather pleasant the whole way through. One reviewer reported some post-smoking throat burn, but the others felt it was a pretty smooth smoke despite'),
