	(16661, 581, 'tabs_0_text', '<p>A landrace Sativa variety from South Africa, Durban Poison is known for its spicy/sweet anise-like smell and taste and it\'s clear-headed cerebral effect.? Though it\'s a (normally) pure Sativa, most versions finish fairly quickly and don\'t stretch like crazy.? Many claim the real South African Durban Poison is very racy and finishes as long as 120 days, but that\'s not the case for the versions'),
