	(16682, 581, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(16683, 581, 'tabs_1_aroma', '<p>Durban is known for possessing a very distinct blend of sweet and spicy smells - fennel/anise, orange, lemon, and a creamy sweetness are the most common descriptors.</p>'),
	(16684, 581, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(16685, 581, 'tabs_1_flavor', '<p>Very sweet and intoxicatingly complex, Durban Poison presents the Sativa-lover with a palate of flavors ranging from sweet lemon candy to spicy anise, making it a favorite of many dispensary patients as well as connoisseurs.</p>'),
