	(16805, 583, '_tabs_0_text', 'field_586bb2c9b118c'),
	(16806, 583, 'tabs_0_text', '<p>One of Colorado\'s underground favorites before becoming a staple at Boulder MMC in Boulder, CO, Dutch Treat Haze is one of the most wonderful Haze hybrids around, bringing the absolute best parts of Green House Seeds\' famous Super Silver Haze but moderating the Sativa effect with the uplifting yet still Indica-dominant Amsterdam strain Dutch Treat. ?Both parent strains have a citrus element to'),
	(16807, 583, '_tabs_0_graphs', 'field_586cc97c03ec8'),
