	(16826, 583, 'tabs_1_title', 'Flavor'),
	(16827, 583, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(16828, 583, 'tabs_1_aroma', '<p>The complex but undeniably Sativa aroma the Dutch Treat Haze offers blends the punchy, reedy side of the Haze family with the sweet, crisp citrus side (which is given an added boost by the sweet and also-citrusy Dutch Treat).  The perfect melding of Haze aromas in the flowers themselves also results in a wonderful floral-fresh-sweet-smelling'),
	(16829, 583, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(16830, 583, 'tabs_1_flavor', '<p>Much like the smell, the flavor combines the sweet-citrusy Haze and Dutch Treat with the eucalyptus-funky Haze elements that often come out of good old-stock Super Silver Haze.  The flavor is especially noticeable and enjoyable in a joint, where the crisp flavor hangs on the lips all the way through to the crutch and lingers in the mouth and'),
