	(17095, 587, '_tabs_0_text', 'field_586bb2c9b118c'),
	(17096, 587, 'tabs_0_text', '<p>This was a superb Indica-dominant cross, bottom line. The overall grow quality and bag appeal was impressive, while the perfect harvest timing seemed like the veritable cherry on top. The two parent strains really aren\'t known for their taste and smell (both are generally chosen for their potency), but this cross was still very pleasant to smoke, possessing a nice lemony bite. We recommend'),
	(17097, 587, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(17098, 587, 'tabs_0_graphs', '2'),
	(17099, 587, '_tabs_0_graphs_0_label', 'field_586cc9cb03eca'),
