	(17111, 587, '_tabs_0_video', 'field_586cc9de03ecc'),
	(17112, 587, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(17113, 587, '_tabs_1_icon', 'field_589daa24ef33d'),
	(17114, 587, 'tabs_1_icon', 'fa-leaf'),
	(17115, 587, '_tabs_1_title', 'field_589daa24ef33c'),
	(17116, 587, 'tabs_1_title', 'Flavor'),
	(17117, 587, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(17118, 587, 'tabs_1_aroma', '<p>Though it\'s not an aroma that really marks itself as distinct or uniquely enjoyable, this G-13 Widow produced a lovely sharp lemon-pine scent with a bit of muskiness and also sweetness in the mix. Lemon is at the forefront though for sure, and it was nicely pungent once broken apart.</p>'),
	(17119, 587, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(17120, 587, 'tabs_1_flavor', '<p>It was mostly a fresh and clean-tasting vegetation with a pine element to it - not really something we\'d seek out, but certainly not a bad flavor. The smoke was smooth despite being rather thick, and the final ash was a very light gray, indicating that it had a proper flush.</p>'),
