	(17265, 589, 'tabs_1_flavor', '<p>This particular phenotype selection from seed stock leans heavily towards the Ghost\'s OG side of the spectrum. Blue Moonshine adds an interesting musky sweetness to the zesty ginger-lemon OG flavor of the Ghost, and serves to thicken up the smoke as well as increase the heaviness of the effects. <br></p>'),
