	(17675, 595, '_tabs_0_text', 'field_586bb2c9b118c'),
	(17676, 595, 'tabs_0_text', 'Glass?Slipper?is an example of the Dutch breeding scene getting their hands on one of the United States\' most wanted clone-only strains and fusing it with some of the best they have to offer. ?"The White" is a supremely potent variety thought to be evolved out of the OG Kush family line, while Cinderella 99 is a much-loved Brothers Grimm classic that was once seen as the pinnacle of Dutch'),
