	(17697, 595, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(17698, 595, 'tabs_1_aroma', 'The Kush elements present in The White are the most noticeable aroma in most phenotypes, but there is a pungent fruity, floral sweetness lurking in the background that comes out in the Cinderella-dominant plants especially.  Spicy, dank, with a hint of sweetness - Glass Slipper is often more complex and engaging than either parent strain, a'),
	(17699, 595, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(17700, 595, 'tabs_1_flavor', 'A soft sweetness with a spicy background on the inhale, then a dank Kush-influenced finish on the exhale matches the aroma, but almost in reverse.  Some phenos will have a sweeter flavor, but The White tends to dominate in this area.'),
