	(18400, 605, '_tabs_0_text', 'field_586bb2c9b118c'),
	(18401, 605, 'tabs_0_text', 'Possibly a sister phenotype of Granddaddy Purple and several of the other popular Purple strains that have floated around California for the better part of 15 years, Grape Ape is one of the most famous and beloved. ?Its smooth and relatively clear-headed though narcotic effect distinguishes it from the often heavy-feeling Purple family and make it a more versatile choice for daytime use. ?Its'),
