	(18422, 605, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(18423, 605, 'tabs_1_aroma', 'Grape Ape has a sweet but still musky scent which has strong notes of grape Kool-Aid with background hints of nag champa incense.  From a distance or through a bag, it often has a skunky element to it, but the sweetness and grape qualities really come out once its broken apart.'),
	(18424, 605, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(18425, 605, 'tabs_1_flavor', 'A fairly direct translation of the aroma, the flavor is the same mix of grape sweetness and musky incense notes, offering both a fairly strong initial flavor and a lingering aftertaste.  The smoke is normally thick and can often hit the throat somewhat hard like many Purple strains.'),
