	(18836, 611, 'tabs_0_text', 'A fusion of some serious Indica genetics in the Bubba and the Kunduz Afghani, the Haze element adds some hybrid vigor and variation in structure.? Overall though, the plants are very Bubba-dominant in structure, finishing at times with nearly black foliage and purple buds with large calyxes that form the signature "crowns" seen in the Bubba. ?The dark green leaves look heavily Indica but the Haze'),
