	(18857, 611, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(18858, 611, 'tabs_1_aroma', 'Interesting sharp smell that brings to mind superglue or acetone, it has a background of Bubba-like coffee/chocolate sweetness.  Its vaguely skunky and sharp scent pre-grind really explodes into a complex and acrid aroma once it\'s broken apart, lingering on the hands and in the air.<strong></strong>'),
	(18859, 611, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(18860, 611, 'tabs_1_flavor', 'Very much like the scent, it has the same almost chemical glue attack, with a musky, hashy Bubba-like finish with notes of hash and earthy qualities from the Afghan.<strong></strong>'),
