	(18998, 613, '_tabs_1_icon', 'field_589daa24ef33d'),
	(18999, 613, 'tabs_1_icon', 'fa-leaf'),
	(19000, 613, '_tabs_1_title', 'field_589daa24ef33c'),
	(19001, 613, 'tabs_1_title', 'Flavor'),
	(19002, 613, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(19003, 613, 'tabs_1_aroma', '<p>This is definitely a Diesel-tinged bouquet, especially before being ground up - it was very pungent in the jar, almost more than it was when handled. The mix of fuel, skunk, spice, bitter citrus, and rubber retains its pungency until it settles a bit, when the aroma changes to more of a soft, slightly sweet presence.</p>'),
	(19004, 613, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(19005, 613, 'tabs_1_flavor', '<p>Much like the smell, but with more of a skunky, rubbery, fuel empahsis to it, and notes of citrus-pine sharpness, with a thick, expansive smoke.<br></p>'),
