	(19125, 615, '_tabs_0_text', 'field_586bb2c9b118c'),
	(19126, 615, 'tabs_0_text', '<p>The HDF gave me a pretty heavy, quick intoxication that had me laying in bed watching whatever channel happened to be on. I seriously forgot about the option of changing channels, it simlply didn\'t exist. This wasn\'t an activity based strain, but the combination of power and sleepiness, mixed with an excellent taste leads me to a favorable review. This was on the fence between an A- and a B+'),
