	(19270, 617, '_tabs_0_text', 'field_586bb2c9b118c'),
	(19271, 617, 'tabs_0_text', 'A worldly fusion of inter-continental proportions, this cross from Bodhi Seeds fuses a very rare clone-only creation from Chemdog (of the ChemDawg strain family fame) in Giesel with Ace Seeds\' exotic but relatively quick-finishing Bangi Haze. The various phenotypes range from the expected stank of the Giesel to the complex spicy incense-heavy aroma of the Haze, but the most choice phenos will'),
