	(19292, 617, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(19293, 617, 'tabs_1_aroma', 'Again, it depends quite a bit upon phenotype what sort of aromas come out of this complex cross - however, most plants tend to have a unique citrus incense profile which tickles the nostrils, especially when freshly-ground.  Notes of sandalwood, tea, fuel, and softer floral notes all intermingle into what is a dream combination for many'),
	(19294, 617, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(19295, 617, 'tabs_1_flavor', 'The taste mostly matches the aroma of the various phenotypes, with the Giesel-dominant examples normally having a more pungent aftertaste than a frontal taste and the opposite existing with the more lemony-incense Haze varieties.  A bit of hashiness creeps into the flavor at times simply due to the thick trichome coverage which is present, but'),
