	(19414, 619, 'tabs_0_title', 'Highlights'),
	(19415, 619, '_tabs_0_text', 'field_586bb2c9b118c'),
	(19416, 619, 'tabs_0_text', '<p>Great stuff! High quality in every category. Its powerful cerebral buzz, mixed with a milder body high, has made this strain an up-and-coming contender for top medical strains. Jack Flash is a great looking strain with many desirable traits. When this strain is around, do not hesitate to try some for yourself.</p>'),
