	(19437, 619, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(19438, 619, 'tabs_1_aroma', '<p>Lovers of this strain will definitely recognize the smell immediately, with its combination of crisp, almost "cool" aromas including lemon, eucalyptus, and cleaner. Though not a super-pungent strain in general, this one was definitely noticed in the bag and increased in pungency when broken apart. Spicy citrus Haze smell gave way to a more'),
	(19439, 619, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(19440, 619, 'tabs_1_flavor', '<p>While sharing qualities with both the pre and post-grind aroma, the flavor just fell short of those heights, giving more of a lightly sweet and floral, creamy orange flavor on the inhale, and a sharper more haze-like and spicy exhale. The flush seemed well-done, as the final ash was a fluffy light gray and white, and the smoke was very smooth'),
