	(20141, 629, 'tabs_0_text', 'Available in feminized seed form only, this plant was made by crossing Barney\'s favorite in-house Skunk strain with a potent Mazar, resulting in a fairly heavy Indica plant that manages to retain some of the Sativa head effects from the Skunk.? A hearty plant that resists disease and mold, it definitely gets its structure and height from the Afghani side of its lineage rather than the Skunk,'),
