	(20452, 633, 'tabs_1_aroma', '<p>A bit piney, a bit earthy, but with a unique spicy smell that reminded us of fennel or even holiday spices. It wasn\'t very pungent until it was ground up…</p>'),
	(20453, 633, '_tabs_1_flavor', 'field_589daa52ef33f'),
