	(20574, 635, '_tabs_0_text', 'field_586bb2c9b118c'),
	(20575, 635, 'tabs_0_text', 'Since the 1960\'s, "Maui Wowie" (or "Waui") was known as an especially exotic and desirable strain to cannabis?connoisseurs?the world over.? While it\'s unclear if the original genetic line is still alive and kicking, there are certainly many strains from Maui that are similar and capture the same smooth, citrus-pine taste and the enjoyable mid-level Sativa effects that it became famous for. ?As'),
