	(20596, 635, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(20597, 635, 'tabs_1_aroma', 'Some Maui is very tropical-smelling, with hints of sweet fruits and a floral quality - others (the ones with a greater Indica influence) have a more pine-dominant profile and are less sweet.'),
	(20598, 635, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(20599, 635, 'tabs_1_flavor', 'Again, there is some variation between the purer Sativa-dominant Maui and the pine-scented one - the pure Maui has a softly sweet flavor while the other one has a more earthy pine flavor with a hint of lemon.'),
