	(20865, 639, 'tabs_0_text', 'This hybrid stunned the world when it won the 2011 High Times Cannabis Cup in Amsterdam for the Best Seed Company Sativa after being entered by first-time competitor Rare Dankness Seeds. ?It\'s a classic fusion of some of the best Hazes the Dutch scene has to offer with just a little bit of Cali genetics (the Trainwreck) to spice up the package. ?Its spear-shaped and pointed colas take after the'),
