	(20886, 639, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(20887, 639, 'tabs_1_aroma', 'The scent definitely seems to be Amnesia Haze-dominant, with a lightly citrusy, sweet, fresh aroma that is easily-noticed as soon as the jar is opened, though it\'s more of a "what\'s that lovely smell?" as opposed to "whew, what stinks?" situation.  When ground apart, its already strong pungency increases further, bringing out a slight'),
	(20888, 639, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(20889, 639, 'tabs_1_flavor', 'Sweet and floral elements are most prevalent on the inhale, but the hint of citrus comes out on the exhale, leaving a lingering Haze note on the palate.  The smoke perfumes the smoke perfumes the room like most good Haze tends to do and is very smooth on the throat and not particularly expansive.'),
