	(21730, 651, '_tabs_0_icon', 'field_586be0a8ad234'),
	(21731, 651, 'tabs_0_icon', 'fa-newspaper-o'),
	(21732, 651, '_tabs_0_title', 'field_586be0a1ad233'),
	(21733, 651, 'tabs_0_title', 'Highlights'),
	(21734, 651, '_tabs_0_text', 'field_586bb2c9b118c'),
	(21735, 651, 'tabs_0_text', '<p>The appearance was fairly spectacular thanks to the eminently visible trichomes that lay all over the bud surface. The smell/taste package was average but enjoyable enough not to hamper anything. The real star here though are the effects, which were blindingly potent at first, but dropped off to a very useful state of focused functionality. Some body attributes were present later on in the'),
	(21736, 651, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(21737, 651, 'tabs_0_graphs', '2'),
	(21738, 651, '_tabs_0_graphs_0_label', 'field_586cc9cb03eca'),
	(21739, 651, 'tabs_0_graphs_0_label', 'LOREM'),
	(21740, 651, '_tabs_0_graphs_0_value', 'field_586cc9d603ecb'),
	(21741, 651, 'tabs_0_graphs_0_value', '123456789'),
