	(21743, 651, 'tabs_0_graphs_0_percent', '0.5'),
	(21744, 651, '_tabs_0_graphs_1_label', 'field_586cc9cb03eca'),
	(21745, 651, 'tabs_0_graphs_1_label', 'LOREM'),
	(21746, 651, '_tabs_0_graphs_1_value', 'field_586cc9d603ecb'),
	(21747, 651, 'tabs_0_graphs_1_value', '123456789'),
	(21748, 651, '_tabs_0_graphs_1_percent', 'field_586cc9a703ec9'),
	(21749, 651, 'tabs_0_graphs_1_percent', '0.5'),
	(21750, 651, '_tabs_0_video', 'field_586cc9de03ecc'),
	(21751, 651, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(21752, 651, '_tabs_1_icon', 'field_589daa24ef33d'),
	(21753, 651, 'tabs_1_icon', 'fa-leaf'),
	(21754, 651, '_tabs_1_title', 'field_589daa24ef33c'),
	(21755, 651, 'tabs_1_title', 'Flavor'),
	(21756, 651, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(21757, 651, 'tabs_1_aroma', '<p>Not exactly appealing in the sense that you want to smell it regularly, this strain was a combination of a slightly creamy vegetal sweetness along with a more putrid, fecal, "cheese" type of smell that made us wrinkle our collective nose. It hints at potency, but isn\'t terribly appealing to most people. The smell also weirdly seemed to'),
	(21758, 651, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(21759, 651, 'tabs_1_flavor', '<p>Much like the smell, the taste wasn\'t terribly appealing but wasn\'t bad either - it gave off a light, spicy citrus with some smooth, almost creamy notes present along with a floral (one reviewer said "soapy") quality. Contrary to many strains, this one seemed to taste better when you really go at it with the lighter rather than \'sipping\' it,'),
