	(21879, 653, '_tabs_0_text', 'field_586bb2c9b118c'),
	(21880, 653, 'tabs_0_text', '<p>We wish we knew the origins of this strain so that we could better see where its potential lies medically - this one just seemed like it wasn\'t quite what it could be, and making judgments on the strain as a whole would be difficult. We saw huge potential in the smell/flavor package, which reminded us of some of our favorite fruity Hazes - but the iffy trim, overall "blah" visual appearance,'),
	(21881, 653, '_tabs_0_graphs', 'field_586cc97c03ec8'),
