	(21899, 653, '_tabs_1_title', 'field_589daa24ef33c'),
	(21900, 653, 'tabs_1_title', 'Flavor'),
	(21901, 653, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(21902, 653, 'tabs_1_aroma', '<p>This strain really reminded our crew of something from the Jack Herer line, as it had that familiar (yet sweeter, more in the Jack Flash vein) citrus Haze aroma that we all love - another reviewer mentioned Dutch Durban as another similar aroma profile. It was certainly noticeable in the jar, but it really developed when it was handled or'),
	(21903, 653, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(21904, 653, 'tabs_1_flavor', '<p>Giving off a rather thick smoke, this strain mostly matched its aroma in the flavor, bringing a slightly more floral, eucalyptus-influenced flavor with many of the same citrus elements. It left a pleasantly hashy aftertaste in the mouth, and the actual flavor maintained well as it burned away. As mentioned, the smoke was rather thick,'),
