	(22020, 655, '_tabs_0_icon', 'field_586be0a8ad234'),
	(22021, 655, 'tabs_0_icon', 'fa-newspaper-o'),
	(22022, 655, '_tabs_0_title', 'field_586be0a1ad233'),
	(22023, 655, 'tabs_0_title', 'Highlights'),
	(22024, 655, '_tabs_0_text', 'field_586bb2c9b118c'),
	(22025, 655, 'tabs_0_text', '<p>The smell this strain possessed was pretty wonderful - basically the opposite end of most of the impressive-smelling samples we\'ve had lately (most seem to be Diesel or Kush-dominant), it provided a wonderfully sweet candy-like aroma that still had a nice sharp quality to it. The appearance was very good as well, with lots of colors and great structure. Though the cannabinoid numbers came back'),
	(22026, 655, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(22027, 655, 'tabs_0_graphs', '2'),
