	(22041, 655, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(22042, 655, '_tabs_1_icon', 'field_589daa24ef33d'),
	(22043, 655, 'tabs_1_icon', 'fa-leaf'),
	(22044, 655, '_tabs_1_title', 'field_589daa24ef33c'),
	(22045, 655, 'tabs_1_title', 'Flavor'),
	(22046, 655, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(22047, 655, 'tabs_1_aroma', '<p>This was the only area where the name really seemed to fit the strain - the smell it produced reminded us of a sweet pink grapefruit. There were notes of citrus, pine, cherry candy, and flowers, and it was nicely pungent once ground up.</p>'),
	(22048, 655, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(22049, 655, 'tabs_1_flavor', '<p>While it wasn\'t a bad taste, we really struggled to get much of a read on this one. We got some sweet notes, some slightly spicy/floral notes, and that was about it. The smoke was smooth and enjoyable though, very easy to consume with it non-expansive nature and soft attack.</p>'),
