	(22336, 659, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(22337, 659, 'tabs_1_aroma', 'The variations in phenotype will also result in variations in smell. However, Pootie Tang can generally be described as earthy, hashy, and tangy. The smell is predominantly earthy, which is consistent with the aroma of each of the parents. The underlying tangy-ness is a mild citrus smell – like a fresh grapefruit as opposed to a ripe orange.'),
	(22338, 659, '_tabs_1_flavor', 'field_589daa52ef33f'),
