	(22772, 665, 'tabs_1_aroma', 'Pura Vida has a nearly offensive-strength terpenes and produces heavy pine, skunk and lemon aromas. Fresh flowers have a more chemy sting to the nose and as the flower dries the skunk and lemon become more dominant.'),
