	(23040, 669, 'tabs_0_text', 'Garberville Purple Kush is most notably held by Swerve of Cali Connection Seeds fame and tends to grow with some foxtails and has more of a straight-up Kush taste/smell with hints of the "purple".? Kyle Kushman\'s Las Vegas Purple Kush was claimed in a New Yorker article to be a special Purple Indica x Northern Lights find, but many have since claimed it\'s an S1 Bubba Kush of some kind due to the'),
