	(23062, 669, 'tabs_1_aroma', 'Pungent, with notes of "purple" (incense, perfume, musky grapes), and the spicy Kush end of the spectrum as well.  The SR-71 and Garberville cuts are more "purple" in both flavor and smell compared to the Kyle Kushman/Las Vegas Purple Kush.<strong> </strong>'),
