	(23765, 679, 'tabs_0_text', '<p>S.A.G.E. stands for "Sativa-Afghani Genetic Equilibrium", indicating that the mission for this plant was to provide the best of both worlds. ?Many believe that\'s the case, as this plants has been extremely popular, with some elite selections being grown, cloned, and passed around for 10+ years now. ?While it is certainly a hybrid, S.A.G.E. is clearly Sativa-dominant, with some phenotypes going'),
