	(23787, 679, 'tabs_1_aroma', '<p>A spicy Haze scent with notes of sandalwood, bay leaves, garlic, and a light Dutch Haze type of sweetness at times, which comes through heavily in certain phenotypes.</p>'),
	(23788, 679, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(23789, 679, 'tabs_1_flavor', '<p>Though the quicker-finishing Afghan-heavy phenotypes are at times sweet, the flavor of the most prized cuts is similar to its namesake, with a bouquet of spice-like flavors with a fresh nature - this one tastes like a true Sativa, reedy and clean on the palate with an expansive but smooth smoke.</p>'),
