	(23909, 681, '_tabs_0_text', 'field_586bb2c9b118c'),
	(23910, 681, 'tabs_0_text', 'A wonderful example of hybrid vigor, this strain brings together two strains on nearly opposite ends of the spectrum in the 70+ day flowering Sativa-dominant Sour Diesel and the burly, hashy, trich-covered Indica Deep Chunk. ?The flavor and scent expression of the parents changes slightly depending upon medium, phenotype, and growing conditions. ?It normally finishes a deep purple color, with'),
