	(23931, 681, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(23932, 681, 'tabs_1_aroma', 'The ECSD comes through most clearly in the scent, which has strong notes of rubber, fuel, skunks.  However, there is a creamy, hashy Deep Chunk sweetness that manages to make its way to the forefront now and then.  The astringent aromas dominate post-grind and this is a strain that is easily-noticed from several feet away when disturbed.'),
	(23933, 681, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(23934, 681, 'tabs_1_flavor', 'When properly-grown, a deep flavor which nearly matches the pungency of the aroma lingers on the palate after smoking.  The flavor is slightly hashier than the aroma, but still has clear skunk, rubber, and fuel elements, especially on the attack.  The smoke tends to be fairly thick and can cause coughing, but if well-trimmed and cured, it can be'),
