	(24200, 685, 'tabs_0_text', 'One of Dutch Passion\'s early crosses primarily meant for outdoor growing in the northern latitudes of The Netherlands, Shaman is known for most of its specimens turning a deep purple. ?The plant isn\'t a big yielder, and it also isn\'t the most potent variety, but its pleasant uplifting Sativa effect and complex floral-pine-incense aroma make it a great daytime choice for beginner and intermediate'),
