	(24221, 685, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(24222, 685, 'tabs_1_aroma', 'Though it possesses a light "purple" scent, with notes of incense and a backing Skunky quality, Shaman has a tangy and fresh aroma once broken apart.  Hints of citrus, pine, and the smooth floral purple aroma from the pre-grind smell blend into a surprisingly appealing whole.'),
	(24223, 685, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(24224, 685, 'tabs_1_flavor', 'Much like the smell, it\'s not the most pungent thing around, but it is complex enough to keep a veteran user\'s interest.  A light skunky and floral flavor brings to mind the Skunk more than the Purple side of the family, and the light citrus elements come through as well in the aftertaste.  Beyond the first hit or two, it\'s mostly an earthy'),
