	(24489, 689, '_tabs_0_text', 'field_586bb2c9b118c'),
	(24490, 689, 'tabs_0_text', 'The sweetest and quickest to harvest of all the original ChemDawg varieties, the SnowDawg (sometimes known as "Super SnowDawg") yields well and forms pointed light green colas which appear almost white with trichomes. ?The influence of the Bubbleberry is evident in the aroma and flavor, which sweetens up the often acrid Chem family.'),
