	(24511, 689, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(24512, 689, 'tabs_1_aroma', 'SnowDawg has a tantalizing and complex aroma which really develops as it is broken apart.  A softly sweet and earthy aroma in its undisturbed state gives way to a blend of fruity sweetness, chemical funk, and earthy citrus that recalls its Chem family origins but seems wholly different.'),
	(24513, 689, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(24514, 689, 'tabs_1_flavor', 'There are many elements of the aroma present in the flavor, but there is a more direct Chem element, while still displaying a very healthy almost floral sweetness.  The smoke is smooth and crisp, with a mentholated quality which leaves the mouth feeling clean.'),
