	(24634, 691, '_tabs_0_text', 'field_586bb2c9b118c'),
	(24635, 691, 'tabs_0_text', 'Thought to be an accidental cross when the DNL hermied, Sour Diesel (or East Coast Sour Diesel, as it\'s commonly called) is a special plant in the OG Kush/ChemDawg line of strains.? Its often "crushing" Sativa effect actually seems to hit most people as more of an Indica, increasing couchlock and being strong to the point of being overwhelming at times.? The plant itself is a fairly lanky one'),
