	(24656, 691, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(24657, 691, 'tabs_1_aroma', 'Sour Diesel displays an extremely pungent blend of fuel, skunk, citrus, and spice that will leak through many jars and bags when the strain is well-grown.  The sharpness gets stronger after breaking it up, adding a stronger kick of citrus as well as a cutting fuel aroma that tickles the nose.<strong></strong>'),
	(24658, 691, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(24659, 691, 'tabs_1_flavor', 'A frontal attack of skunky citrus funk gives way to a mentholated lime-kissed spice which lingers in the mouth.  The smoke is expansive and will definitely cause coughing on larger hits.'),
