	(24775, 693, '_tabs_0_icon', 'field_586be0a8ad234'),
	(24776, 693, 'tabs_0_icon', 'fa-newspaper-o'),
	(24777, 693, '_tabs_0_title', 'field_586be0a1ad233'),
	(24778, 693, 'tabs_0_title', 'Highlights'),
	(24779, 693, '_tabs_0_text', 'field_586bb2c9b118c'),
	(24780, 693, 'tabs_0_text', '<p>Different from the Gage Green Grape Stomper which was renamed "Sour Grapes" by Blue Sky Collective in Oakland, this cut is from Apothecary Genetics and is their Grape Ape crossed with a Sour Diesel. ?The hybrid produces larger nugs than the Ape and demonstrates the hybrid vigor one would expect from such a cross. ?The mottled purple coloration and tangy sour grape-meets flowers aroma is'),
	(24781, 693, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(24782, 693, 'tabs_0_graphs', '2'),
	(24783, 693, '_tabs_0_graphs_0_label', 'field_586cc9cb03eca'),
