	(24789, 693, '_tabs_0_graphs_1_label', 'field_586cc9cb03eca'),
	(24790, 693, 'tabs_0_graphs_1_label', 'LOREM'),
	(24791, 693, '_tabs_0_graphs_1_value', 'field_586cc9d603ecb'),
