	(24795, 693, '_tabs_0_video', 'field_586cc9de03ecc'),
	(24796, 693, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(24797, 693, '_tabs_1_icon', 'field_589daa24ef33d'),
	(24798, 693, 'tabs_1_icon', 'fa-leaf'),
	(24799, 693, '_tabs_1_title', 'field_589daa24ef33c'),
	(24800, 693, 'tabs_1_title', 'Flavor'),
	(24801, 693, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(24802, 693, 'tabs_1_aroma', '<p>An engaging mix of the two parent strains, Sour Grapes has a fairly soft grape sweetness in the bag but blows up into a complex sour fruit aroma with hints of flowers and incense lingering in the background.  It doesn\'t tend to have outward Diesel elements, but the added sharpness can definitely be detected among the Grape-dominant package of'),
	(24803, 693, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(24804, 693, 'tabs_1_flavor', '<p>Sweet and sour grape dominates the flavor, and the Diesel takes a definite backseat, never really being picked up except in that the taste is unlike the standard Grape Ape.  It has an expansive, thick smoke which can often cause coughing.</p>'),
