	(24947, 695, 'tabs_1_aroma', '<p>Stardawg is alarmingly potent in chemical, acidic and pine fragrances. Like it\'s counterparts in the Chem Dog family, It truly smells like a dead skunk and has a very pevasive odor.</p>'),
