	(24949, 695, 'tabs_1_flavor', '<p>The musk lingering in the ambient aroma translates directly to flavor, where one may have a salivating or lip smacking reaction when consuming. Thus it is a favorite for processing into concentrates and the lineage of Chem Dog has spread to most modern day strains.</p>'),
