	(25650, 705, 'tabs_0_text', '<p>The sweet Swiss Sativa on the mother\'s side gives this strain its distinct sugary berry aroma and taste, while the workhorse NL #5 x Haze on the "father\'s side" (this is feminized stock, so it was also a female plant) adds robust growth and vigor while reducing overall size.? With tight internodal spacing, it is a solid choice for Haze lovers who don\'t want a gigantic plant that is impossible'),
