	(25938, 709, 'tabs_0_title', 'Highlights'),
	(25939, 709, '_tabs_0_text', 'field_586bb2c9b118c'),
	(25940, 709, 'tabs_0_text', '<p>The smell is something very unique that most of us hadn\'t encountered previously, a very refreshing and complex aroma that reminded us of other strains but always threw a wrench into the mix with an unexpected whiff of something. The effects were certainly Indica-dominant in the "stoned" vein where sitting on the couch relaxing and staring blankly at a movie seems like a great idea, making'),
	(25941, 709, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(25942, 709, 'tabs_0_graphs', '2'),
