	(25958, 709, 'tabs_1_icon', 'fa-leaf'),
	(25959, 709, '_tabs_1_title', 'field_589daa24ef33c'),
	(25960, 709, 'tabs_1_title', 'Flavor'),
	(25961, 709, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(25962, 709, 'tabs_1_aroma', '<p>This strain has a very unique aroma that brought to mind a variety of sharp yet sweet scents. A burst of lime-kissed cleaner meets a sugary cherry syrup quality - it\'s certainly very sweet but the freshness and sharpness adds a complex dimension that was not noticed before breaking/grinding it up. Top-notch aroma here, and very unique.</p>'),
	(25963, 709, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(25964, 709, 'tabs_1_flavor', '<p>The initial flavor was much like the smell - a more flowery and smooth version of the lime-pine-sweetness combination. As the taste progressed though, it took on more of a holiday spice + anise quality, with an interesting sharp muskiness. The flavor degraded quite a bit th0ugh as it progressed, making us cough quite a bit and leaving a'),
