	(26230, 713, 'tabs_0_text', '<p>With its strong and sweet lemon qualities in both the smell and taste, this strain certainly lives up to its reputation and name when well-grown. ?With the Indica lineage present in the Sativa-dominant hybrid, it results in a rather calm experience for a Haze-based strain - rather balanced between head and body effects overall. ?The plant grows with short internodes and responds well to'),
