	(26617, 718, '_tabs_0_text', 'field_586bb2c9b118c'),
	(26618, 718, 'tabs_0_text', '<p>Unexpectedly sweet and fruity, this strain will certainly please those patients who place smell on the top of their list of qualities to look for. But even if that\'s not your thing, the effects were genuinely enjoyed by all of the staff, especially as a late-day or night-time med when relaxation is the goal. A very interesting strain indeed, though we wish the duration was a little longer.</p>'),
