	(26639, 718, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(26640, 718, 'tabs_1_aroma', '<p>Totally unexpected except for that it was in the name, this strain was extremely sweet-smelling, reminding us of movie theater red rope licorice or a strawberry fruit roll-up - wonderful sweet, fruity scent with no trace of the normal musk seen in the parent strains. Truly a top-notch smell package for people who like sweet and fruity… the'),
	(26641, 718, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(26642, 718, 'tabs_1_flavor', '<p>Though one reviewer picked up some sweetness, this one was thought to be mainly earthy and much more reminiscent of the usual Afghani varietals. This one had a variety of woodsy and earthy tastes but also a twang that reminded one reviewer of fancy cheeses. It was a rather smooth smoking experience but left a medium gray ash and likely could\'ve'),
