	(27051, 724, 'tabs_0_title', 'Highlights'),
	(27052, 724, '_tabs_0_text', 'field_586bb2c9b118c'),
	(27053, 724, 'tabs_0_text', '<p>A very special phenotype of Soma\'s original NYCD x G-13/Haze, Tangerine Haze was discovered by the Devil\'s Harvest Krew in 2003-04 and has since become something of a legend, especially in Colorado. ?The plant is one of the most uncanny-smelling fruity strains on the planet, smelling and tasting exactly like a freshly-peeled tangerine, down to the sensation of the semi-bitter skin. ?It grows'),
	(27054, 724, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(27055, 724, 'tabs_0_graphs', '2'),
	(27056, 724, '_tabs_0_graphs_0_label', 'field_586cc9cb03eca'),
	(27057, 724, 'tabs_0_graphs_0_label', 'LOREM'),
	(27058, 724, '_tabs_0_graphs_0_value', 'field_586cc9d603ecb'),
	(27059, 724, 'tabs_0_graphs_0_value', '123456789'),
	(27060, 724, '_tabs_0_graphs_0_percent', 'field_586cc9a703ec9'),
	(27061, 724, 'tabs_0_graphs_0_percent', '0.5'),
	(27062, 724, '_tabs_0_graphs_1_label', 'field_586cc9cb03eca'),
	(27063, 724, 'tabs_0_graphs_1_label', 'LOREM'),
	(27064, 724, '_tabs_0_graphs_1_value', 'field_586cc9d603ecb'),
	(27065, 724, 'tabs_0_graphs_1_value', '123456789'),
	(27066, 724, '_tabs_0_graphs_1_percent', 'field_586cc9a703ec9'),
	(27067, 724, 'tabs_0_graphs_1_percent', '0.5'),
	(27068, 724, '_tabs_0_video', 'field_586cc9de03ecc'),
	(27069, 724, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(27070, 724, '_tabs_1_icon', 'field_589daa24ef33d'),
	(27071, 724, 'tabs_1_icon', 'fa-leaf'),
	(27072, 724, '_tabs_1_title', 'field_589daa24ef33c'),
	(27073, 724, 'tabs_1_title', 'Flavor'),
	(27074, 724, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(27075, 724, 'tabs_1_aroma', '<p>The smell of Tangerine Haze is legendary as being one of the few fruit-named strains that is a perfect replica of its namesake, filling the sinuses with a pungent and uncanny tangerine smell with a floral backdrop.  If it\'s let go beyond 65 days, it often takes on an astringent quality, so most growers like to take her down early if'),
	(27076, 724, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(27077, 724, 'tabs_1_flavor', '<p>The flavor is almost more tangerine-heavy than the scent, even going as far as to give the flavor of the semi-bitter skin or citrus zest along with the fresh citrus attack.  The flavor tends to linger in the mouth and sinuses for a long time after consumption, which increases the already amazing taste appeal of this strain.</p>'),
