	(27196, 726, '_tabs_0_text', 'field_586bb2c9b118c'),
	(27197, 726, 'tabs_0_text', '<p>Like many Sativas, this one hit our staff a bit differently depending on the time of day and incoming mood - your experience may vary according to the same. It\'s definitely a strong Sativa though, which we would probably peg at around 85%? the effects package was almost entirely mental and/or body energy. While the taste was a bit confusing, the rest of the appeal categories were definitely'),
