	(27218, 726, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(27219, 726, 'tabs_1_aroma', '<p>Not very pungent in the jar at all, this strain had a sweet-sour and slightly putrid tropical fruit bouquet when ground up, reminding one reviewer of papaya. This was a fairly unique smell, though not pungent enough to be all that impressive.</p>'),
	(27220, 726, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(27221, 726, 'tabs_1_flavor', '<p>The majority of reviewers picked up on darker sweet flavors, such as roasted marshmallows, coffee, and nuts… but one reviewer (using an Incredibowl) caught a faint distinct yet disitinct fruit skin taste that danced peach skin that and grapefruit peel as the bowl burned. <br></p>'),
