	(27487, 730, 'tabs_0_text', '<p>The Tang Tang is from Grindhouse Medical Seeds\' Sonja line (derived from Blockhead but Sativa-dominant) and adds some needed heft, vigor, and yield to the normally stingy Pre-\'98 Bubba Kush mom. ?The different phenotypes are almost like different strains, with the Bubba-dominant phenos taking on the rounded shape and large calyxes of the mother, and the Tang Tang growing pointed colas with'),
