	(27507, 730, 'tabs_1_title', 'Flavor'),
	(27508, 730, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(27509, 730, 'tabs_1_aroma', '<p>The Bubba-dominant plants definitely recall the mother, but have a less foreboding and musky aroma, seemingly being freshened up by the herbal and zesty Tang Tang.  Both phenos have notes of incense, hash, citrus, and the backing  deep chocolate/coffee notes of the Bubba, but the Tang Tang just has less aroma overall, smelling mostly of the'),
	(27510, 730, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(27511, 730, 'tabs_1_flavor', '<p>With a background of the Bubba dankness, the flavor is lightened up by the Tang Tang, adding elements of citrus and herbs.  The flavor isn\'t overwhelmingly strong like a proper Bubba is, but it hands in the mouth in much the same way, reminding the user of the flavor seemingly at random for a while after smoking.</p>'),
