	(27776, 734, '_tabs_0_text', 'field_586bb2c9b118c'),
	(27777, 734, 'tabs_0_text', '<p>Named "The White" for the color of the finished buds (which absolutely drip with resin glands), this strain seems to be somewhere in the Kush family but is thought to have come from Triangle, an elite Florida strain. ?Though it\'s not considered a true OG among most collectors, it\'s reached the stratified air shared with those elite OG cuts in terms of rarity and overall value. ?The potency'),
	(27778, 734, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(27779, 734, 'tabs_0_graphs', '2'),
