	(27793, 734, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(27794, 734, '_tabs_1_icon', 'field_589daa24ef33d'),
	(27795, 734, 'tabs_1_icon', 'fa-leaf'),
	(27796, 734, '_tabs_1_title', 'field_589daa24ef33c'),
	(27797, 734, 'tabs_1_title', 'Flavor'),
	(27798, 734, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(27799, 734, 'tabs_1_aroma', '<p>Lemon, pine, and hash, with some oddly sweet qualities creeping in at times - definitely "Kushy" in nature, though not as sharp as some OGs, trending instead towards the musky side of things.<strong></strong></p>'),
	(27800, 734, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(27801, 734, 'tabs_1_flavor', '<p>Not necessarily known for its taste (many breeders cross it for its trichome coverage with another, tastier strain), The White gives off a pine-heavy taste with hints of Kush spice.  The smoke is thick and expansive, filling the chest and often causing coughing, especially on larger hits.<strong></strong></p>'),
