	(27919, 736, 'tabs_0_title', 'Highlights'),
	(27920, 736, '_tabs_0_text', 'field_586bb2c9b118c'),
	(27921, 736, 'tabs_0_text', '<p>Without knowing much about what goes into this cross, it\'s hard to say which elements of the breeding were picked up in the experience. It was definitely Sativa-dominant during the initial effects part, but shifted gears heavily around the mid-way point, making this feel more like a 60/40% Sativa type of hybrid experience. The structure and texture were superb, while the rest of the "bag'),
	(27922, 736, '_tabs_0_graphs', 'field_586cc97c03ec8'),
	(27923, 736, 'tabs_0_graphs', '2'),
