	(27936, 736, '_tabs_0_video', 'field_586cc9de03ecc'),
	(27937, 736, 'tabs_0_video', 'https://www.youtube.com/watch?v=EigAuKCD_wY'),
	(27938, 736, '_tabs_1_icon', 'field_589daa24ef33d'),
	(27939, 736, 'tabs_1_icon', 'fa-leaf'),
	(27940, 736, '_tabs_1_title', 'field_589daa24ef33c'),
	(27941, 736, 'tabs_1_title', 'Flavor'),
	(27942, 736, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(27943, 736, 'tabs_1_aroma', '<p>Though it wasn\'t pungent really, the smell was a pleasingly fresh-smelling blend of pine (at times with a chemical bent to it), vegetation, and a light sweetness.</p>'),
	(27944, 736, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(27945, 736, 'tabs_1_flavor', '<p>There just wasn\'t much to this sample taste-wise - it seemed to mostly taste like smoke. It was never unpleasant though, only taking a turn for the worse towards the very end of the session. The smoke itself was light and easy to inhale, making this a good choice for those who don\'t wish to cough.</p>'),
