	(28066, 738, 'tabs_0_text', '<p>The "bag appeal" for this one was very high, and it boasts a complex taste and smell package led into a supremely energetic but unfocused state that may be good for creativity but made it a little difficult to deal with daily tasks. This was a very strongly Sativa experience, complete with slight "crash" at the end - people who cannot handle the racy varieties should steer clear of this one,'),
