	(28087, 738, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(28088, 738, 'tabs_1_aroma', '<p>Reminding us of expensive hand soaps, tropical fruit and dryer sheets, the aroma from the Third Dimension was a relatively sweet pine-citrus sharpness. with a little whiff of skunk The sweet elements came out more after a grind, but it was relatively pungent even in the jar.</p>'),
	(28089, 738, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(28090, 738, 'tabs_1_flavor', '<p>Much like the aroma but less pungent, the flavor was an odd, yet appealing mix of citrus chemical pine and an almost flowery/perfumed sweetness. We wish it was more pungent, but it was a bit of an ethereal taste. <br></p>'),
