	(28377, 742, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(28378, 742, 'tabs_1_aroma', '<p>It has perhaps the most pure and strongest OG Kush aroma we\'ve encountered, with a pungent blend of lemons, spice, and floor cleaner that will raise the eyebrow of anyone questioning the "mother of OG Kush" story.  To us, it tastes and smells like Ghost\'s OG Kush on steroids - just more of everything.</p>'),
