	(28500, 744, '_tabs_0_text', 'field_586bb2c9b118c'),
	(28501, 744, 'tabs_0_text', '<p>This is one of the real "crusher sativas" that almost mimics an indica couch lock with its oppressive head high. We\'ve found this in other diesels as well. The popularity of the standard Sour Diesel has pushed forward the palette for various Diesel varieties. <br></p>'),
