	(28522, 744, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(28523, 744, 'tabs_1_aroma', '<p>Soily and slightly sweet in the jar, it breaks up to produce a fresh menthol-tinged soil scent when handled. It reminded one reviewer of freshly torn mint leaves… The pungency was pretty average, but it was enough to be noticed without being right near the bud.</p>'),
	(28524, 744, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(28525, 744, 'tabs_1_flavor', '<p>Not as tasty as we expected, it was a pretty standard Diesel type taste, with a soil tinge similar to what was presented in the smell. There were no traces of the NYCD or Strawberry Diesel influence with their brand of sweetness, it was mostly just a fuel and soil taste, but not a particularly pungent one. It burned down to a medium-light gray'),
