	(29226, 754, 'tabs_0_text', 'Called" white" due to its resin gland content as well as its tendency to not fully color up when ready to harvest, White Widow is known for being extremely potent.? A solid producer of connoisseur-quality nugs, it has been popular in Amsterdam coffee shops for many years and has been used in many breeding projects to increase the potency and vigor of other strains.? While not an outstanding'),
