	(29247, 754, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(29248, 754, 'tabs_1_aroma', 'A blend of fruit and musky, putrid qualities - it hints at its potency with the smell, which has more of a bite to it than many fruity-smelling strains.  At times, it\'s all lemons and hashiness, depends a bit on the phenotype.<strong> </strong>'),
	(29249, 754, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(29250, 754, 'tabs_1_flavor', 'Often times neutral or even hashy due to the high trichome count, the strain sometimes has a citrusy, flowery bent, but is not known for being all that flavorful in general.<strong> </strong>'),
