	(32325, 905, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(32326, 905, 'tabs_1_aroma', '<p> This sample reminded us both of a purple strain and Blueberry with its slightly musky but sweet berry aroma — we did indeed pick up a Blackberry element to the smell as well. It was more piney and musky pre-grind, but sweetened up quite a bit and got more pungent once handled.</p>'),
	(32327, 905, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(32328, 905, 'tabs_1_flavor', '<p>Lightly sweet and spicy in the mouth, this strain didn\'t have a ton of taste to it. The smoke was incredibly smooth and non-expansive though, making this a superb choice for those who don\'t want to cough.&nbsp;</p>'),
