	(36704, 938, '_tabs_1_aroma', 'field_589daa24ef33e'),
	(36705, 938, 'tabs_1_aroma', '<p>Gorilla Glue flower is sweet with hints of sharp sourness that tends to vary from batch to batch. Burnt flowers produce a very strong skunk perfume that is thick in the air and sure to entice others nearby to ask what you are smoking on.</p>'),
	(36706, 938, '_tabs_1_flavor', 'field_589daa52ef33f'),
	(36707, 938, 'tabs_1_flavor', '<p>Bred specifically for maximum THC, the flavor of Gorilla Glue can be a bit muted and indistinguishable from other strains. This isn\'t to say that it tastes bad, but it certainly doesn\'t have the diversified pallet many other strains have.</p>'),
