	(421, 1, '2017-02-07 19:15:08', '2017-02-07 19:15:08', 'Array\n(\n    [strain_name] => 303 Kush\n    [description] => For lovers of Bubba Kush, this strain is a must-try, especially for the aroma and taste package, which is potent and reminds us of the best examples of that strain we\'ve ever had. The effect is a little more uplifting and active than Bubba traditionally is, but this 303 still had quality body relaxation properties that made the incredible mood it put us in even more enjoyable.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2345CCHG\n    [record_id] => 32\n    [last_updated] => 2017-01-10 00:00:00\n    [repo_description] => <p>For lovers of Bubba Kush, this strain is a must-try, especially for the aroma and taste package, which is potent and reminds us of the best examples of that strain we\'ve ever had. The effect is a little more uplifting and active than Bubba traditionally is, but this 303 still had quality body relaxation properties that made the incredible mood it put us in even more enjoyable.</p>\n    [aroma] => <p>We were definitely "wowed" by the aroma that this Colorado-born cross possessed, as it was extremely pungent and reminded us of some of the best coffee-chocolate Bubbas we\'ve had. There were notes of smokey bourbon, anise, and a backing sharp chemmy quality that came out post-grind, making this one of the most complex aromas we\'ve encountered in some time. If you\'re a fan of the dank, spicy smells of Bubba Kush, this strain will likely surpass most examples of pure Bubba in your mind\'s eye, as it has in ours.</p>\n    [flavor] => <p>While it was nearly impossible to live up to the aroma, the taste did come close to matching it, though it lost some of the added post-grind complexity and was mostly Bubba in profile. One of the great things about Bubba Kush is the "greasy" flavor which seems to coat the mouth and sinuses — this sample was no exception there, and we could taste it lingering for at least a half hour into the review. The smoke had an interesting thin, mentholated quality to it and really didn\'t give us the urge to cough at all, even on the later hits.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/303-kush-10_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => ounce:107.50,half:53.75,eighth:15.17\n    [reviews] => \n    [stars] => \n)\n', '303 Kush', '', 'trash', 'closed', 'closed', '', '303-kush__trashed', '', '', '2017-02-17 05:46:16', '2017-02-17 05:46:16', '', 0, 'http://tpb.waaark.dev/product/303-kush/', 0, 'product', '', 0),
