	(423, 1, '2017-02-07 19:15:13', '2017-02-07 19:15:13', 'Array\n(\n    [strain_name] => A.S.H.\n    [description] => This A.S.H. is an example of some classic genetic lines in perhaps the trinity of genetic lines, Afghani, Skunk, and Haze. The blend of these influences could be seen in all areas of the sample, from its structure, to its smell, to the effects. We all enjoyed this strain but saw potential for better medicinal-level duration and better flavor lurking within, namely due to what we see as a slightly early harvest and not-quite thorough enough flush. These flaws didn\'t do much to dampen the overall experience however, and the mix of uplifting and ground effects from the Afghani and Haze parts of this strain were an enjoyable tug-of-war that ultimately felt like a great hybrid. This is a good strain for those who appreciate the classic taste palate of Skunk and Afghani and desire a daytime mix of Sativa and Indica effects â€” we felt that the strongly cerebral and slightly rushy start would be a little much for inexperienced patients, especially those who suffer from anxiety or nausea issues.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029323\n    [record_id] => 33\n    [last_updated] => 2017-01-10 00:00:01\n    [repo_description] => <p>This A.S.H. is an example of some classic genetic lines in perhaps the "trinity" of genetic lines, Afghani, Skunk, and Haze. The blend of these influences could be seen in all areas of the sample, from its structure, to its smell, to the effects. We all enjoyed this strain but saw potential for better medicinal-level duration and better flavor lurking within, namely due to what we see as a slightly early harvest and not-quite thorough enough flush. These flaws didn\'t do much to dampen the overall experience however, and the mix of uplifting and ground effects from the Afghani and Haze parts of this strain were an enjoyable tug-of-war that ultimately felt like a great hybrid. This is a good strain for those who appreciate the classic taste palate of Skunk and Afghani and desire a daytime mix of Sativa and Indica effects — we felt that the strongly cerebral and slightly rushy start would be a little much for inexperienced patients, especially those who suffer from anxiety or nausea issues.</p>\n    [aroma] => <p>he staff\'s consensus favorite part of this sample, the aroma was a very classic-smelling mix of musky, skunky, garlicy, vegetal, and lightly fruity/sweet all at once. The lightly sweet and fruity Afghani musk it broadcasts in the jar is rather pungent, but it increases further when ground and takes on more of the garlic dimension as well, always with the Haze spice in the background.</p>\n    [flavor] => <p>Flavor-wise, this strain was again a mix between the almost putrid, lightly sweet, fruity Afghan and slightly sharper and spicy flavors. We didn\'t feel that the smell came through to the taste as cleanly as we would have liked, we think this is partly due to the Haze-style bud structure containing a decent amount of leaf cover, which brought added harshness and standard smoke flavor to the party. The thick smoke that results from this one was moderately expansive and did hit the lungs a bit hard, causing some coughing at times. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/ash-4_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => eighth:17.06,half:483.75,eighth:241.88,ounce:120.94,half:60.47\n    [reviews] => \n    [stars] => \n)\n', 'A.S.H.', '', 'publish', 'closed', 'closed', '', 'a-s-h', '', '', '2017-02-07 19:15:13', '2017-02-07 19:15:13', '', 0, 'http://tpb.waaark.dev/product/a-s-h/', 0, 'product', '', 0),
