	(425, 1, '2017-02-07 19:15:16', '2017-02-07 19:15:16', 'Array\n(\n    [strain_name] => ACDC\n    [description] => In the garden, AC/DC is a bushy sativa and grows akin to Golden Goat and Sweet Sweet. Its leaves are so thin they feel like feathers when you brush against them. Though many CBD strains are reserved for concentrates for their overwhelming&nbsp;tendency to self-polinate, AC/DC is a proven 30:1 CBD strain that holds well as finished buds and is very stable. \n    [category] => Flowers\n    [type] => Sativa\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2926\n    [record_id] => 34\n    [last_updated] => 2017-01-10 00:00:02\n    [repo_description] => <p>In the garden, AC/DC is a bushy sativa and grows akin to Golden Goat and Sweet Sweet. Its leaves are so thin they feel like feathers when you brush against them. Though many CBD strains are reserved for concentrates for their overwhelming&nbsp;tendency to self-polinate, AC/DC is a proven 30:1 CBD strain that holds well as finished buds and is very stable. <br></p>\n    [aroma] => <p>AC/DC smells like lemongrass and cherries.</p>\n    [flavor] => <p>Cherries and berries are evident in a thick, woody smoke. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/acdc-1_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant CBD\n    [prices] => eighth:107.50,ounce:53.75,eighth:10.75\n    [reviews] => ACDC is one of my favorite high-cbd strains. It makes excellent concentrates with an amazing terpene profile. Definitely a great strain for pain and reducing anxiety!:Terpene_Barnes,ACDC is one of my favorite high-cbd strains. It makes excellent concentrates with an amazing terpene profile. Definitely a great strain for pain and reducing anxiety!:Terpene_Barnes,ACDC is one of my favorite high-cbd strains. It makes excellent concentrates with an amazing terpene profile. Definitely a great strain for pain and reducing anxiety!:Terpene_Barnes\n    [stars] => 4.5\n)\n', 'ACDC', '', 'publish', 'closed', 'closed', '', 'acdc', '', '', '2017-02-07 19:15:16', '2017-02-07 19:15:16', '', 0, 'http://tpb.waaark.dev/product/acdc/', 0, 'product', '', 0),
