	(427, 1, '2017-02-07 19:15:19', '2017-02-07 19:15:19', 'Array\n(\n    [strain_name] => Afghani\n    [description] => A very stout and hearty variety that originated in the rugged mountains of Afghanistan, these dark green Indica plants can survive almost anything.Â  Pest and mold-resistant, easy to grow, and compact.Â  Traditionally used in hash-making, Afghani varieties areÂ  often extremely resinous and sticky.\n    [category] => Flowers\n    [type] => Indica\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 35\n    [last_updated] => 2017-01-10 00:00:03\n    [repo_description] => <p>A very stout and hearty variety that originated in the rugged mountains of Afghanistan, these dark green Indica plants can survive almost anything.  Pest and mold-resistant, easy to grow, and compact.  Traditionally used in hash-making, Afghani varieties are  often extremely resinous and sticky.</p>\n    [aroma] => <p>Normally hashy and earthy, sometimes very musky and spicy, at times overwhelming carbon filters.</p>\n    [flavor] => <p>Hashy and pretty unremarkable in most cases, sometimes the spicy notes or even light sweetness comes out.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/afghani-004_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica landrace variety\n    [prices] => half:215.00,eighth:15.17\n    [reviews] => \n    [stars] => \n)\n', 'Afghani', '', 'trash', 'closed', 'closed', '', 'afghani__trashed', '', '', '2017-02-21 01:15:37', '2017-02-21 01:15:37', '', 0, 'http://tpb.waaark.dev/product/afghani/', 0, 'product', '', 0),
