	(429, 1, '2017-02-07 19:15:21', '2017-02-07 19:15:21', 'Array\n(\n    [strain_name] => AK Cherry Lime\n    [description] => Slightly Sativa-dominant in terms of effect, Indica-dominant in terms of plant appearance, AK-47 is a true hybrid.Â  The plant tends to have a large central main cola with minimal side-branching â€” it is a medium height plant that produces buds with a high calyx-to-leaf ratio.Â  It also boasts a fairly short flowering time for a Sativa-dominant plant, making it suitable for commercial or connoisseur purposes.Â  The Cherry phenotype is the most prized one.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 36\n    [last_updated] => 2017-01-10 00:00:04\n    [repo_description] => Slightly Sativa-dominant in terms of effect, Indica-dominant in terms of plant appearance, AK-47 is a true hybrid.  The plant tends to have a large central main cola with minimal side-branching — it is a medium height plant that produces buds with a high calyx-to-leaf ratio.  It also boasts a fairly short flowering time for a Sativa-dominant plant, making it suitable for commercial or connoisseur purposes.  The "Cherry" phenotype is the most prized one.\n    [aroma] => Strong, sweet, and fruity — the odor can get out of control when the plants are growing, so carbon filters are highly recommended.<strong> </strong>\n    [flavor] => Spice-heavy and a bit sweet, often tasting of sandalwood… the Cherry and Cherry-Lime phenotypes are known for matching the taste of their namesake fruits.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/akcherrylime_greenbelly_3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => eighth:215.00,ounce:53.75,half:430.00\n    [reviews] => \n    [stars] => \n)\n', 'AK Cherry Lime', '', 'publish', 'closed', 'closed', '', 'ak-cherry-lime', '', '', '2017-02-07 19:15:21', '2017-02-07 19:15:21', '', 0, 'http://tpb.waaark.dev/product/ak-cherry-lime/', 0, 'product', '', 0),
