	(431, 1, '2017-02-07 19:15:23', '2017-02-07 19:15:23', 'Array\n(\n    [strain_name] => AK-47 x NL-5\n    [description] => AK-47 used to be one of those elite strains that made everyone ooh audibly, but it has been knocked down a tier in the last few years with all the high-grade Kush and Diesel strains especially - this was a good reminder that it\'s a strain to reckon with, as is the even older Northern Lights #5.&nbsp\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0949\n    [record_id] => 37\n    [last_updated] => 2017-01-10 00:00:05\n    [repo_description] => <p>AK-47 used to be one of those elite strains that made everyone "ooh" audibly, but it has been knocked down a tier in the last few years with all the high-grade Kush and Diesel strains especially - this was a good reminder that it\'s a strain to reckon with, as is the even older Northern Lights #5.&nbsp; It\'s very clear why these strains were chosen as a hybrid - it provided a superb blend of hybrid effects that seemed to satisfy a little bit of everything while maintaining its power throughout the duration.&nbsp; Its smell was extremely unique but unfortunately that didn\'t translate to the taste, which was only average.&nbsp; Still though, this old-school blend would make almost anyone happy (literally, it was an instant mood enhancement) and would help patients greatly with almost any disorder that they may have except for very serious pain. <br></p>\n    [aroma] => <p>This strain unleashed a very unexpected blast of sweetness combined with a cocktail of spices, similar to what one would find in egg nog or mulled wine.&nbsp; A variety of smooth and sweet smells from cinnamon to cardamom was the dominant aroma.&nbsp; When it was ground up, it trended a bit more towards the standard citrus side with a vegetal sweetness, which when combined with the initial smell reminded one reviewer of candied orange peels.&nbsp; Though it won\'t make you sneeze with its pungency, it was above-average in that regard and could be detected from a few feet away.</p>\n    [flavor] => <p>With&nbsp; just a hint of the spices that permeated the aroma, this strain tasted mostly of a lightly sweet piney citrus with a bit of hashiness.&nbsp; The taste was a bit ethereal, as it seemed distinct and fairly strong but then disappeared as quickly as it came, leaving us struggling to describe it in detail.&nbsp; This strain gave us an incredibly smooth smoke that upgraded the overall taste score simply because it was such an easy and enjoyable smoke despite expanding quite a bit. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/ak47nl5_happyharvest_3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => eighth:15.17,ounce:430.00,half:215.00\n    [reviews] => \n    [stars] => \n)\n', 'AK-47 x NL-5', '', 'publish', 'closed', 'closed', '', 'ak-47-x-nl-5', '', '', '2017-02-07 19:15:23', '2017-02-07 19:15:23', '', 0, 'http://tpb.waaark.dev/product/ak-47-x-nl-5/', 0, 'product', '', 0),
	(432, 1, '2017-02-07 19:15:26', '2017-02-07 19:15:26', '', 'thumbnail_431', '', 'inherit', 'closed', 'closed', '', 'thumbnail_431', '', '', '2017-02-07 19:15:26', '2017-02-07 19:15:26', '', 431, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_431.jpg', 0, 'attachment', 'image/jpeg', 0),
	(433, 1, '2017-02-07 19:15:26', '2017-02-07 19:15:26', 'Array\n(\n    [strain_name] => Alien Dog\n    [description] => The Alien Dog is a terrific indica based strain, stemming from one of the most popular strains making its way across the country (Alien Technology). We recommend using small samples of this for medicating, as the more you ingest the larger the head/mind effects become and it seems to detract from the brilliance of the body medication. On the other hand, seasoned patients may enjoy the diversity the strain offers and choose to go all in for both mind and body exhuberation. \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 44\n    [record_id] => 38\n    [last_updated] => 2017-01-10 00:00:06\n    [repo_description] => <p>The Alien Dog is a terrific indica based strain, stemming from one of the most popular strains making its way across the country (Alien Technology). We recommend using small samples of this for medicating, as the more you ingest the larger the head/mind effects become and it seems to detract from the brilliance of the body medication. On the other hand, seasoned patients may enjoy the diversity the strain offers and choose to go "all in" for both mind and body exhuberation. </p>\n    [aroma] => <p>Floral citrus pre-grind with some definite soil/kush smells after grind along with the same citrusy smell that was present originally.</p>\n    [flavor] => <p>A soft sweetness (berry/pine) with delayed, albeit big, expansion.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/alien-dog-28_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => ounce:66,eighth:15,pound:100,ounce:50\n    [reviews] => \n    [stars] => \n)\n', 'Alien Dog', '', 'publish', 'closed', 'closed', '', 'alien-dog', '', '', '2017-02-07 19:15:26', '2017-02-07 19:15:26', '', 0, 'http://tpb.waaark.dev/product/alien-dog/', 0, 'product', '', 0),
