	(439, 1, '2017-02-07 19:15:35', '2017-02-07 19:15:35', 'Array\n(\n    [strain_name] => Birthday Cake\n    [description] => Girl Scout Cookies (Forum Cut) x Romulan\n    [category] => Flowers\n    [type] => Indica\n    [brand] => \n    [in_stock] => true\n    [SKU] => WWMMJ\n    [record_id] => 41\n    [last_updated] => 2017-01-10 00:00:09\n    [repo_description] => <p>Girl Scout Cookies (Forum Cut) x Romulan</p>\n    [aroma] => <p>Like Girl Scout Cookies, a doughy, fresh baked smell is detectable off of well cured flowers. Many people pick up the sweet scent of grocery store icing.<br></p>\n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/birthday-cake-1_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica\n    [prices] => half:483.75,eighth:241.88,ounce:120.94\n    [reviews] => \n    [stars] => \n)\n', 'Birthday Cake', '', 'publish', 'closed', 'closed', '', 'birthday-cake', '', '', '2017-02-07 19:15:35', '2017-02-07 19:15:35', '', 0, 'http://tpb.waaark.dev/product/birthday-cake/', 0, 'product', '', 0),
