	(441, 1, '2017-02-07 19:15:40', '2017-02-07 19:15:40', 'Array\n(\n    [strain_name] => Bling\n    [description] => Regardless of the hype that came with the strain\'s creation, it is a very quality Indica-dominant hybrid that packs a heavy dose of sedative potency.Regardless of the hype that came with the strain\'s creation, it is a very quality Indica-dominant hybrid that packs a heavy dose of sedative potency.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2345CCHG\n    [record_id] => 42\n    [last_updated] => 2017-01-10 00:00:10\n    [repo_description] => <p>Regardless of the hype that came with the strain\'s creation, it is a very quality Indica-dominant hybrid that packs a heavy dose of sedative potency.Regardless of the hype that came with the strain\'s creation, it is a very quality Indica-dominant hybrid that packs a heavy dose of sedative potency.</p>\n    [aroma] => <p>Bling has an interesting sweet-meets-putrid fruity smell, which gains a musky sharpness when ground or broken up.  Bling has an interesting sweet-meets-putrid fruity smell, which gains a musky sharpness when ground or broken up.  </p>\n    [flavor] => <p>Hashy and lightly sweet, it has an expansive and thick smoke which can definitely cause some coughing. Hashy and lightly sweet, it has an expansive and thick smoke which can definitely cause some coughing. </p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/bling-big_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Bling', '', 'publish', 'closed', 'closed', '', 'bling', '', '', '2017-02-07 19:15:40', '2017-02-07 19:15:40', '', 0, 'http://tpb.waaark.dev/product/bling/', 0, 'product', '', 0),
