	(443, 1, '2017-02-07 19:15:44', '2017-02-07 19:15:44', 'Array\n(\n    [strain_name] => Blue Cheese\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029323\n    [record_id] => 43\n    [last_updated] => 2017-01-10 00:00:11\n    [repo_description] => \n    [aroma] => <p> The high point of this strain for sure, the aroma was a wonderfully pungent mix of sweet blueberry and sharp, musky, putrid elements… which, yes, can be described as smelling like cheese. It\'s a very strange and unique taste that you really only find in Cheese strains — alternately appealing and revolting, like many fine cheeses <br></p>\n    [flavor] => <p> The taste took on more of the cheese elements than the smell did, while the berry sweetness fell to the background. One reviewer commented that there was even an iron/mineral-like taste, similar to what is found in very "goaty" cheeses, while others mainly picked up on peppery, sharp notes. The sweetness was still present, but the sharp tastes were stronger for sure.&nbsp;</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/blue-cheese-3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => eighth:107.50,ounce:53.75,eighth:10.75\n    [reviews] => \n    [stars] => \n)\n', 'Blue Cheese', '', 'publish', 'closed', 'closed', '', 'blue-cheese', '', '', '2017-02-07 19:15:44', '2017-02-07 19:15:44', '', 0, 'http://tpb.waaark.dev/product/blue-cheese/', 0, 'product', '', 0),
