	(445, 1, '2017-02-07 19:15:47', '2017-02-07 19:15:47', 'Array\n(\n    [strain_name] => Blue Dream\n    [description] => A big-yielding and rangy Blueberry cross, Blue Dream has a wonderful Sativa-dominant effects package and retains much of the Blueberry taste from its mother.Â  Developed in the Northern California medical scene, it is becoming very popular in other medical states for its potency and high production.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2926\n    [record_id] => 44\n    [last_updated] => 2017-01-10 00:00:12\n    [repo_description] => A big-yielding and rangy Blueberry cross, Blue Dream has a wonderful Sativa-dominant effects package and retains much of the Blueberry taste from its mother.  Developed in the Northern California medical scene, it is becoming very popular in other medical states for its potency and high production.\n    [aroma] => Sweet and floral berry, often with a hint of citrus-sandalwood sharpness from the Haze.<strong></strong>\n    [flavor] => Much like the smell, it\'s floral berry with some almost \'purple\' notes at times (grape, flowers) — some expressions are heavy on the floral, almost hitting a lavender note at times.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/andys-blue-dream-pink-house-mile-high-3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => half:215.00,eighth:15.17,ounce:53.75\n    [reviews] => I consider Blue Dream to be one of the most well-know cannabis strains. While it doesn\'t have the strongest flavor profile, it definitely packs a punch with strong body highs and effective pain relieving properties. Blue Dream is a great strain to smoke if you\'re sore from exercise or physical activity.:Terpene_Barnes,I consider Blue Dream to be one of the most well-know cannabis strains. While it doesn\'t have the strongest flavor profile, it definitely packs a punch with strong body highs and effective pain relieving properties. Blue Dream is a great strain to smoke if you\'re sore from exercise or physical activity.:Terpene_Barnes,I consider Blue Dream to be one of the most well-know cannabis strains. While it doesn\'t have the strongest flavor profile, it definitely packs a punch with strong body highs and effective pain relieving properties. Blue Dream is a great strain to smoke if you\'re sore from exercise or physical activity.:Terpene_Barnes\n    [stars] => 4.0\n)\n', 'Blue Dream', '', 'publish', 'closed', 'closed', '', 'blue-dream', '', '', '2017-02-07 19:15:47', '2017-02-07 19:15:47', '', 0, 'http://tpb.waaark.dev/product/blue-dream/', 0, 'product', '', 0),
