	(447, 1, '2017-02-07 19:15:49', '2017-02-07 19:15:49', 'Array\n(\n    [strain_name] => Blue Hawaiian\n    [description] => The Blue Hawaiian is a great looking strain with plenty of red hairs to add on to its marvel. A bit leafy on the outside, but the inside is packed full of sparkly trichomes. The buzz has a great balance of both head and body high, and a beautiful look and smell to match. Personally, the only down side is the medication is not as strong as I usually like. But, there is always a place and time for this type of smoke.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 45\n    [last_updated] => 2017-01-10 00:00:13\n    [repo_description] => <p>The Blue Hawaiian is a great looking strain with plenty of red hairs to add on to its marvel. A bit leafy on the outside, but the inside is packed full of sparkly trichomes. The buzz has a great balance of both head and body high, and a beautiful look and smell to match. Personally, the only down side is the medication is not as strong as I usually like. But, there is always a place and time for this type of smoke.</p>\n    [aroma] => <p>Smells fantastic. Smells of blueberry with a slight bitterness.</p>\n    [flavor] => <p>Smells fantastic. Smells of blueberry with a slight bitterness.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/blue-hawaiian-5_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => eighth:15.17,half:430.00\n    [reviews] => \n    [stars] => \n)\n', 'Blue Hawaiian', '', 'publish', 'closed', 'closed', '', 'blue-hawaiian', '', '', '2017-02-07 19:15:49', '2017-02-07 19:15:49', '', 0, 'http://tpb.waaark.dev/product/blue-hawaiian/', 0, 'product', '', 0),
