	(449, 1, '2017-02-07 19:15:52', '2017-02-07 19:15:52', 'Array\n(\n    [strain_name] => Blueberry\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 46\n    [last_updated] => 2017-01-10 00:00:14\n    [repo_description] => \n    [aroma] => <p>Yep, this is Blueberry… this sample had that perfect sugar-coated muffin smell and was rather pungent both pre and post-grind. After the grind, a slightly musky and putrid sweetness came out, taking over for some of the sugary berry. Simply put, if you like Blueberry, you\'ll love this smell.</p>\n    [flavor] => <p>A tad disappointing after the sugary bouquet, the taste was a little more subdued, with only one reviewer getting the beautiful candy berry/muffin type taste out of it. It seems to be in there, but coaxing it out wasn\'t easy for everyone… there was an earthy element to it as well that came out in later hits. Rather smooth and not particularly expansive, this one was an easy smoke. </p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/blueberry-2_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Mostly Indica hybrid, Afghani x Thai varieties\n    [prices] => ounce:50,ounce:430.00,half:215.00\n    [reviews] => \n    [stars] => \n)\n', 'Blueberry', '', 'publish', 'closed', 'closed', '', 'blueberry', '', '', '2017-02-08 21:46:34', '2017-02-08 21:46:34', '', 0, 'http://tpb.waaark.dev/product/blueberry/', 0, 'product', '', 0),
