	(543, 3, '2017-02-14 18:37:58', '2017-02-14 18:37:58', 'Array\n(\n    [strain_name] => AK Cherry Lime\n    [description] => Slightly Sativa-dominant in terms of effect, Indica-dominant in terms of plant appearance, AK-47 is a true hybrid.? The plant tends to have a large central main cola with minimal side-branching - it is a medium height plant that produces buds with a high calyx-to-leaf ratio.? It also boasts a fairly short flowering time for a Sativa-dominant plant, making it suitable for commercial or connoisseur purposes.? The "Cherry" phenotype is the most prized one.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0949\n    [record_id] => 16\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Slightly Sativa-dominant in terms of effect, Indica-dominant in terms of plant appearance, AK-47 is a true hybrid.  The plant tends to have a large central main cola with minimal side-branching - it is a medium height plant that produces buds with a high calyx-to-leaf ratio.  It also boasts a fairly short flowering time for a Sativa-dominant plant, making it suitable for commercial or connoisseur purposes.  The "Cherry" phenotype is the most prized one.\n    [aroma] => Strong, sweet, and fruity - the odor can get out of control when the plants are growing, so carbon filters are highly recommended.<strong> </strong>\n    [flavor] => Spice-heavy and a bit sweet, often tasting of sandalwood… the Cherry and Cherry-Lime phenotypes are known for matching the taste of their namesake fruits.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/akcherrylime_greenbelly_3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => 1 unit:55.00\n    [reviews] => \n    [stars] => \n)\n', 'AK Cherry Lime', '', 'publish', 'closed', 'closed', '', 'ak-cherry-lime-2', '', '', '2017-02-14 18:37:58', '2017-02-14 18:37:58', '', 0, 'http://tpb.waaark.dev/product/ak-cherry-lime-2/', 0, 'product', '', 0),
	(544, 3, '2017-02-14 18:38:02', '2017-02-14 18:38:02', '', 'thumbnail_543', '', 'inherit', 'closed', 'closed', '', 'thumbnail_543', '', '', '2017-02-14 18:38:02', '2017-02-14 18:38:02', '', 543, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_543.jpg', 0, 'attachment', 'image/jpeg', 0),
	(545, 3, '2017-02-14 18:38:02', '2017-02-14 18:38:02', 'Array\n(\n    [strain_name] => AK-47 x NL-5\n    [description] => <p>AK-47 used to be one of those elite strains that made everyone "ooh" audibly, but it has been knocked down a tier in the last few years with all the high-grade Kush and Diesel strains especially - this was a good reminder that it\'s a strain to reckon with, as is the even older Northern Lights #5. It\'s very clear why these strains were chosen as a hybrid - it provided a superb blend of hybrid effects that seemed to satisfy a little bit of everything while maintaining its power throughout the duration. Its smell was extremely unique but unfortunately that didn\'t translate to the taste, which was only average. Still though, this old-school blend would make almost anyone happy (literally, it was an instant mood enhancement) and would help patients greatly with almost any disorder that they may have except for very serious pain. <br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 44\n    [record_id] => 17\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>AK-47 used to be one of those elite strains that made everyone "ooh" audibly, but it has been knocked down a tier in the last few years with all the high-grade Kush and Diesel strains especially - this was a good reminder that it\'s a strain to reckon with, as is the even older Northern Lights #5. It\'s very clear why these strains were chosen as a hybrid - it provided a superb blend of hybrid effects that seemed to satisfy a little bit of everything while maintaining its power throughout the duration. Its smell was extremely unique but unfortunately that didn\'t translate to the taste, which was only average. Still though, this old-school blend would make almost anyone happy (literally, it was an instant mood enhancement) and would help patients greatly with almost any disorder that they may have except for very serious pain. <br></p>\n    [aroma] => <p>This strain unleashed a very unexpected blast of sweetness combined with a cocktail of spices, similar to what one would find in egg nog or mulled wine. A variety of smooth and sweet smells from cinnamon to cardamom was the dominant aroma. When it was ground up, it trended a bit more towards the standard citrus side with a vegetal sweetness, which when combined with the initial smell reminded one reviewer of candied orange peels. Though it won\'t make you sneeze with its pungency, it was above-average in that regard and could be detected from a few feet away.</p>\n    [flavor] => <p>With just a hint of the spices that permeated the aroma, this strain tasted mostly of a lightly sweet piney citrus with a bit of hashiness. The taste was a bit ethereal, as it seemed distinct and fairly strong but then disappeared as quickly as it came, leaving us struggling to describe it in detail. This strain gave us an incredibly smooth smoke that upgraded the overall taste score simply because it was such an easy and enjoyable smoke despite expanding quite a bit. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/ak47nl5_happyharvest_3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => 1 unit:60.00\n    [reviews] => \n    [stars] => \n)\n', 'AK-47 x NL-5', '', 'publish', 'closed', 'closed', '', 'ak-47-x-nl-5-2', '', '', '2017-02-14 18:38:02', '2017-02-14 18:38:02', '', 0, 'http://tpb.waaark.dev/product/ak-47-x-nl-5-2/', 0, 'product', '', 0),
	(546, 3, '2017-02-14 18:38:05', '2017-02-14 18:38:05', '', 'thumbnail_545', '', 'inherit', 'closed', 'closed', '', 'thumbnail_545', '', '', '2017-02-14 18:38:05', '2017-02-14 18:38:05', '', 545, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_545.jpg', 0, 'attachment', 'image/jpeg', 0),
	(547, 3, '2017-02-14 18:38:05', '2017-02-14 18:38:05', 'Array\n(\n    [strain_name] => AK-48\n    [description] => <p>This is a bud I will go back for again and again. Perfect summer afternoon chill or go out and hang with friends, very versatile with relaxing overtones. Many of today\'s multi-breed strains seem more like abominations and fail to provide me with a real identity of their own, but the AK-48 takes all its ancenstry in stride and presents itself like an original.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928271\n    [record_id] => 18\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>This is a bud I will go back for again and again. Perfect summer afternoon chill or go out and hang with friends, very versatile with relaxing overtones. Many of today\'s multi-breed strains seem more like abominations and fail to provide me with a real identity of their own, but the AK-48 takes all its ancenstry in stride and presents itself like an original.</p>\n    [aroma] => <p>A faint clean piney smell</p>\n    [flavor] => <p> This one tasted like outside on a damp spring day, think fresh growth with wet pavement that was just pinesol\'d. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/AK-48/image3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => 1 unit:77.00\n    [reviews] => \n    [stars] => \n)\n', 'AK-48', '', 'publish', 'closed', 'closed', '', 'ak-48', '', '', '2017-02-14 18:38:05', '2017-02-14 18:38:05', '', 0, 'http://tpb.waaark.dev/product/ak-48/', 0, 'product', '', 0),
	(548, 3, '2017-02-14 18:38:08', '2017-02-14 18:38:08', '', 'thumbnail_547', '', 'inherit', 'closed', 'closed', '', 'thumbnail_547', '', '', '2017-02-14 18:38:08', '2017-02-14 18:38:08', '', 547, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_547.jpg', 0, 'attachment', 'image/jpeg', 0),
	(549, 3, '2017-02-14 18:38:08', '2017-02-14 18:38:08', 'Array\n(\n    [strain_name] => Alien Dog\n    [description] => <p>The Alien Dog is a terrific indica based strain, stemming from one of the most popular strains making its way across the country (Alien Technology). We recommend using small samples of this for medicating, as the more you ingest the larger the head/mind effects become and it seems to detract from the brilliance of the body medication. On the other hand, seasoned patients may enjoy the diversity the strain offers and choose to go "all in" for both mind and body exhuberation. </p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 19\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The Alien Dog is a terrific indica based strain, stemming from one of the most popular strains making its way across the country (Alien Technology). We recommend using small samples of this for medicating, as the more you ingest the larger the head/mind effects become and it seems to detract from the brilliance of the body medication. On the other hand, seasoned patients may enjoy the diversity the strain offers and choose to go "all in" for both mind and body exhuberation. </p>\n    [aroma] => <p>Floral citrus pre-grind with some definite soil/kush smells after grind along with the same citrusy smell that was present originally.</p>\n    [flavor] => <p>A soft sweetness (berry/pine) with delayed, albeit big, expansion.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/alien-dog-28_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Alien Dog', '', 'publish', 'closed', 'closed', '', 'alien-dog-2', '', '', '2017-02-14 18:38:08', '2017-02-14 18:38:08', '', 0, 'http://tpb.waaark.dev/product/alien-dog-2/', 0, 'product', '', 0),
