	(551, 3, '2017-02-14 18:38:13', '2017-02-14 18:38:13', 'Array\n(\n    [strain_name] => Banana Kush\n    [description] => <p> This smoke can induce mild coughing fits as the expansion stays with you for a minute or two after smoking. It carries a solid potency for a fruity named strain and can be enjoyed sitting or on the go. It has a talkable nature, but also gives a nice introspective experience to the patient. The taste and smell are absolutely captivating, and makes for a really tasty joint to share with a group. <br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WWMMJ\n    [record_id] => 20\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p> This smoke can induce mild coughing fits as the expansion stays with you for a minute or two after smoking. It carries a solid potency for a fruity named strain and can be enjoyed sitting or on the go. It has a talkable nature, but also gives a nice introspective experience to the patient. The taste and smell are absolutely captivating, and makes for a really tasty joint to share with a group. <br></p>\n    [aroma] => <p> Yes, it does really smell like bananas, though the strong kush scent will overpower once crushed or ground. <br></p>\n    [flavor] => <p> That banana taste lingers in your mouth. Very sweet and pleasant.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/banannakush_urbandispensary_2_kr_large_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Banana Kush', '', 'publish', 'closed', 'closed', '', 'banana-kush-2', '', '', '2017-02-14 18:38:13', '2017-02-14 18:38:13', '', 0, 'http://tpb.waaark.dev/product/banana-kush-2/', 0, 'product', '', 0),
	(552, 3, '2017-02-14 18:38:21', '2017-02-14 18:38:21', '', 'thumbnail_551', '', 'inherit', 'closed', 'closed', '', 'thumbnail_551', '', '', '2017-02-14 18:38:21', '2017-02-14 18:38:21', '', 551, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_551.jpg', 0, 'attachment', 'image/jpeg', 0),
	(553, 3, '2017-02-14 18:38:22', '2017-02-14 18:38:22', 'Array\n(\n    [strain_name] => Betty Banner\n    [description] => <p>This strain takes an A+ strain and adds a terrific new kick. The Fort Collins Cough (Northern Lights #5 x Haze #17) was one of this editor\'s personal favorites while attending CSU in the mid-late 90\'s because of its potency mixed with clarity. It was always a highly functional sativa hybrid that was only missing an exquisite flavor and scent. The BB#3 brings that to the table with perfection. The only suggestion KindReviews has for this strain is a new name? beauties like this deserve their own calling card!</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2345CCHG\n    [record_id] => 21\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>This strain takes an A+ strain and adds a terrific new kick. The Fort Collins Cough (Northern Lights #5 x Haze #17) was one of this editor\'s personal favorites while attending CSU in the mid-late 90\'s because of its potency mixed with clarity. It was always a highly functional sativa hybrid that was only missing an exquisite flavor and scent. The BB#3 brings that to the table with perfection. The only suggestion KindReviews has for this strain is a new name… beauties like this deserve their own calling card!</p>\n    [aroma] => <p>The Bruce Banner takes over this smell, which is fine with us as it brings forth so many great scents. You will find soft fruit and soil, as well as a common diesel scent with pleasant earth and pine tones.</p>\n    [flavor] => <p>This is perfect in our opinion - a split of taste between the fruit/diesel of the strain itself and the organic matter it derived life from.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/bettybanner_delta9_3_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [