	(565, 3, '2017-02-14 18:38:45', '2017-02-14 18:38:45', 'Array\n(\n    [strain_name] => Blue Hawaiian\n    [description] => <p>The Blue Hawaiian is a great looking strain with plenty of red hairs to add on to its marvel. A bit leafy on the outside, but the inside is packed full of sparkly trichomes. The buzz has a great balance of both head and body high, and a beautiful look and smell to match. Personally, the only down side is the medication is not as strong as I usually like. But, there is always a place and time for this type of smoke.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029324\n    [record_id] => 27\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The Blue Hawaiian is a great looking strain with plenty of red hairs to add on to its marvel. A bit leafy on the outside, but the inside is packed full of sparkly trichomes. The buzz has a great balance of both head and body high, and a beautiful look and smell to match. Personally, the only down side is the medication is not as strong as I usually like. But, there is always a place and time for this type of smoke.</p>\n    [aroma] => <p>Smells fantastic. Smells of blueberry with a slight bitterness.</p>\n    [flavor] => <p>Smells fantastic. Smells of blueberry with a slight bitterness.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/blue-hawaiian-5_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Blue Hawaiian', '', 'publish', 'closed', 'closed', '', 'blue-hawaiian-2', '', '', '2017-02-14 18:38:45', '2017-02-14 18:38:45', '', 0, 'http://tpb.waaark.dev/product/blue-hawaiian-2/', 0, 'product', '', 0),
	(566, 3, '2017-02-14 18:38:46', '2017-02-14 18:38:46', '', 'thumbnail_565', '', 'inherit', 'closed', 'closed', '', 'thumbnail_565', '', '', '2017-02-14 18:38:46', '2017-02-14 18:38:46', '', 565, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_565.jpg', 0, 'attachment', 'image/jpeg', 0),
	(567, 3, '2017-02-14 18:38:47', '2017-02-14 18:38:47', 'Array\n(\n    [strain_name] => Blueberry\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2927\n    [record_id] => 28\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => <p>Yep, this is Blueberry… this sample had that perfect sugar-coated muffin smell and was rather pungent both pre and post-grind. After the grind, a slightly musky and putrid sweetness came out, taking over for some of the sugary berry. Simply put, if you like Blueberry, you\'ll love this smell.</p>\n    [flavor] => <p>A tad disappointing after the sugary bouquet, the taste was a little more subdued, with only one reviewer getting the beautiful candy berry/muffin type taste out of it. It seems to be in there, but coaxing it out wasn\'t easy for everyone… there was an earthy element to it as well that came out in later hits. Rather smooth and not particularly expansive, this one was an easy smoke. </p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/blueberry-2_500x500.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Mostly Indica hybrid, Afghani x Thai varieties\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Blueberry', '', 'publish', 'closed', 'closed', '', 'blueberry-2', '', '', '2017-02-14 18:38:47', '2017-02-14 18:38:47', '', 0, 'http://tpb.waaark.dev/product/blueberry-2/', 0, 'product', '', 0),
	(568, 3, '2017-02-14 18:38:49', '2017-02-14 18:38:49', '', 'thumbnail_567', '', 'inherit', 'closed', 'closed', '', 'thumbnail_567', '', '', '2017-02-14 18:38:49', '2017-02-14 18:38:49', '', 567, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_567.jpg', 0, 'attachment', 'image/jpeg', 0),
	(569, 3, '2017-02-14 18:38:49', '2017-02-14 18:38:49', 'Array\n(\n    [strain_name] => Bob Saget\n    [description] => <p>One of the most unique-looking plants we\'ve had the pleasure of photographing here at KindReviews.com, "the Bob" (as it\'s also known) is a freak confluence of quality genetics which produced a plant which is perhaps greater than the sum of its parts. ?Combining the signature Hanis nail polish/acetone-meets-chocolate aroma and flavor with the Sativa growth pattern and yield of the S.A.G.E., Bob Saget is extremely resinous and has almost no leaf aside from the actual fan leaves. ?The effect is uplifting and borderline racy at first, but mellows out slightly into a lightly psychedelic, but still buzzy experience, before crashing out at the end as many strong Sativas do.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 29\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>One of the most unique-looking plants we\'ve had the pleasure of photographing here at KindReviews.com, "the Bob" (as it\'s also known) is a freak confluence of quality genetics which produced a plant which is perhaps greater than the sum of its parts.  Combining the signature Hanis nail polish/acetone-meets-chocolate aroma and flavor with the Sativa growth pattern and yield of the S.A.G.E., Bob Saget is extremely resinous and has almost no leaf aside from the actual fan leaves.  The effect is uplifting and borderline racy at first, but mellows out slightly into a lightly psychedelic, but still buzzy experience, before crashing out at the end as many strong Sativas do.</p>\n    [aroma] => <p>Perhaps the Bob Saget\'s most signature trait, the aroma certainly takes most strongly after the Hanis "father" plant, blending a complex, sharp chemical scent which almost resembles acetone with a slight sweetness.  The initial inhale tends to bring more of the sweetness, but as the buds are broken apart, the acrid paint thinner side comes out very strongly, tingling the nose like few strains can.  The Bob (like Hanis) is almost not recognizable as cannabis scent-wise because it is so strange and unique.</p>\n    [flavor] => <p>Much like the aroma, the flavor at first has hints of sweetness and a unique floral element, but the aftertaste which lingers on the palate and in the throat (similar to Bubba Kush or Flo) is all Hanis superglue-chocolate funk.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Bob+Saget/bob-saget(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Bob Saget', '', 'publish', 'closed', 'closed', '', 'bob-saget', '', '', '2017-02-14 18:38:49', '2017-02-14 18:38:49', '', 0, 'http://tpb.waaark.dev/product/bob-saget/', 0, 'product', '', 0),
