	(571, 3, '2017-02-14 18:38:52', '2017-02-14 18:38:52', 'Array\n(\n    [strain_name] => Bordello\n    [description] => An Indica-dominant hybrid that is comprised of some special and rare genetics, Bordello is known for turning wonderful colors (likely due to the Soma\'s Lavender part of the equation) and packing quite a punch, both in flavor and potency.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 30\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => An Indica-dominant hybrid that is comprised of some special and rare genetics, Bordello is known for turning wonderful colors (likely due to the Soma\'s Lavender part of the equation) and packing quite a punch, both in flavor and potency.\n    [aroma] => Sweet (on the berry side of things) and slightly skunky<strong> </strong>\n    [flavor] => Depends on pheno, but generally it\'s slightly sweet and herby<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Bordellobordello_greenbelly_2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Bordello', '', 'publish', 'closed', 'closed', '', 'bordello', '', '', '2017-02-14 18:38:52', '2017-02-14 18:38:52', '', 0, 'http://tpb.waaark.dev/product/bordello/', 0, 'product', '', 0),
