	(575, 3, '2017-02-14 18:38:56', '2017-02-14 18:38:56', 'Array\n(\n    [strain_name] => Diesel Dog\n    [description] => <p>After hitting the vaporizer I had an immediate couch lock that lasted about 4 minutes. Then I was alert and happy doing just about anything, watching a movie or editing photos. Overall a great bud for varied situations.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2927\n    [record_id] => 47\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>After hitting the vaporizer I had an immediate couch lock that lasted about 4 minutes. Then I was alert and happy doing just about anything, watching a movie or editing photos. Overall a great bud for varied situations.</p>\n    [aroma] => <p>Chemical pine &amp; menthol fuel</p>\n    [flavor] => <p>A clean lemon (no astringent flavor common with the "cleaner" tasting strains) with good expansion</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Diesel+Dog/diesel_dawg_ccf_3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Diesel Dog', '', 'publish', 'closed', 'closed', '', 'diesel-dog', '', '', '2017-02-14 18:38:56', '2017-02-14 18:38:56', '', 0, 'http://tpb.waaark.dev/product/diesel-dog/', 0, 'product', '', 0),
	(576, 3, '2017-02-14 18:38:58', '2017-02-14 18:38:58', '', 'thumbnail_575', '', 'inherit', 'closed', 'closed', '', 'thumbnail_575', '', '', '2017-02-14 18:38:58', '2017-02-14 18:38:58', '', 575, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_575.jpg', 0, 'attachment', 'image/jpeg', 0),
	(577, 3, '2017-02-14 18:38:59', '2017-02-14 18:38:59', 'Array\n(\n    [strain_name] => Dopium\n    [description] => <p>This rare Diesel-Chem hybrid lives up to its lineage with a hair-curling aroma and an effect which nearly matches the smell in potency. ?Though it is a Sativa-dominant variety, it has the tendency at higher dosages to live up to its strain name, giving the user an extremely relaxed, almost narcotic feeling to go along with all the cerebral effects the Diesel and Chem family are known for.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 48\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>This rare Diesel-Chem hybrid lives up to its lineage with a hair-curling aroma and an effect which nearly matches the smell in potency.  Though it is a Sativa-dominant variety, it has the tendency at higher dosages to live up to its strain name, giving the user an extremely relaxed, almost narcotic feeling to go along with all the cerebral effects the Diesel and Chem family are known for.</p>\n    [aroma] => <p>The complex and pungent bouquet the Dopium offers is certainly Diesel-dominant, with that sharp chemical-fuel-rubber element which so many connoisseurs seek out taking the forefront and practically assaulting the senses.  However, there are some interesting floral and spice notes present which differentiate this cut from other Chem-Diesel hybrids and seem to influence the flavor as well.</p>\n    [flavor] => <p>Less outright acrid than the aroma, the flavor still has strong notes of chemical pine and hickory smoke.  The floral side of things lingers in the aftertaste makes it more palatable for those patients who love Diesel type effects but cannot handle the "Chem breath" flavor it often leaves behind… this is a lower key, more measured Chem-Diesel experience.  The smoke is rather expansive without being harsh when well-grown.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Dopium/dopium-004(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Dopium', '', 'publish', 'closed', 'closed', '', 'dopium', '', '', '2017-02-14 18:38:59', '2017-02-14 18:38:59', '', 0, 'http://tpb.waaark.dev/product/dopium/', 0, 'product', '', 0),
	(578, 3, '2017-02-14 18:39:02', '2017-02-14 18:39:02', '', 'thumbnail_577', '', 'inherit', 'closed', 'closed', '', 'thumbnail_577', '', '', '2017-02-14 18:39:02', '2017-02-14 18:39:02', '', 577, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_577.jpg', 0, 'attachment', 'image/jpeg', 0),
	(579, 3, '2017-02-14 18:39:02', '2017-02-14 18:39:02', 'Array\n(\n    [strain_name] => Double Diesel\n    [description] => <p>Though we missed the acrid Sour Diesel part of the equation at times, this was a very enjoyable Diesel experience that was neither too heavy nor too light. It felt like a true hybrid, with a blend of Sativa and Indica effects that played well together rather than battling for attention. The appearance was top-notch, with its sound but distinct structure, copious trichome coverage, and lack of flaws. The smell was right up our alley and seemed NYCD-dominant with a grapefuit bent. Overall, we like this med as a daytime or early evening strain for those looking for some mood elevation, relaxation, and appetite stimulation - it\'s suitable for all levels of patient because it was never too strong but can be enjoyed even by the connoisseurs.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 49\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Though we missed the acrid Sour Diesel part of the equation at times, this was a very enjoyable Diesel experience that was neither too heavy nor too light. It felt like a true hybrid, with a blend of Sativa and Indica effects that played well together rather than battling for attention. The appearance was top-notch, with its sound but distinct structure, copious trichome coverage, and lack of flaws. The smell was right up our alley and seemed NYCD-dominant with a grapefuit bent. Overall, we like this med as a daytime or early evening strain for those looking for some mood elevation, relaxation, and appetite stimulation - it\'s suitable for all levels of patient because it was never too strong but can be enjoyed even by the connoisseurs.</p>\n    [aroma] => <p>This one had some of the typical diesel notes in the jar/bag before it was ground up, but they seemed to disappear, turning into more of a sweet herby grapefruit… it seemed to be both sweet and musky at the same time, which is certainly unique. It seems that the NYCD dominated the smell department, not much of the acrid, pungent Sour Diesel smell at all… in this case, that wasn\'t a bad thing.</p>\n    [flavor] => <p>Similar to the smell but much less sweet-tinged, the taste was also a semi-musky citrus with some menthol qualities. It turned a bit more to the earthy/smoky side as it burned away, but overall was rather pleasant the whole way through. One reviewer reported some post-smoking throat burn, but the others felt it was a pretty smooth smoke despite being fairly thick. Pretty average taste overall, which was slightly disappointing after the top-notch aroma.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Double+Diesel/image1_kr_large(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Double Diesel', '', 'publish', 'closed', 'closed', '', 'double-diesel', '', '', '2017-02-14 18:39:02', '2017-02-14 18:39:02', '', 0, 'http://tpb.waaark.dev/product/double-diesel/', 0, 'product', '', 0),
	(580, 3, '2017-02-14 18:39:08', '2017-02-14 18:39:08', '', 'thumbnail_579', '', 'inherit', 'closed', 'closed', '', 'thumbnail_579', '', '', '2017-02-14 18:39:08', '2017-02-14 18:39:08', '', 579, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_579.jpg', 0, 'attachment', 'image/jpeg', 0),
	(581, 3, '2017-02-14 18:39:09', '2017-02-14 18:39:09', 'Array\n(\n    [strain_name] => Durban Poison\n    [description] => <p>A landrace Sativa variety from South Africa, Durban Poison is known for its spicy/sweet anise-like smell and taste and it\'s clear-headed cerebral effect.? Though it\'s a (normally) pure Sativa, most versions finish fairly quickly and don\'t stretch like crazy.? Many claim the real South African Durban Poison is very racy and finishes as long as 120 days, but that\'s not the case for the versions available in seed form (Afropips and African Seeds seems to be the longest to finish).</p>\n    [category] => Flowers\n    [type] => Sativa\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2347CCHG\n    [record_id] => 50\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>A landrace Sativa variety from South Africa, Durban Poison is known for its spicy/sweet anise-like smell and taste and it\'s clear-headed cerebral effect.  Though it\'s a (normally) pure Sativa, most versions finish fairly quickly and don\'t stretch like crazy.  Many claim the real South African Durban Poison is very racy and finishes as long as 120 days, but that\'s not the case for the versions available in seed form (Afropips and African Seeds seems to be the longest to finish).</p>\n    [aroma] => <p>Durban is known for possessing a very distinct blend of sweet and spicy smells - fennel/anise, orange, lemon, and a creamy sweetness are the most common descriptors.</p>\n    [flavor] => <p>Very sweet and intoxicatingly complex, Durban Poison presents the Sativa-lover with a palate of flavors ranging from sweet lemon candy to spicy anise, making it a favorite of many dispensary patients as well as connoisseurs.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Durban+Poison/durban-poison-002(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa\n    [prices] => \n    [reviews] => Awesome sativa strain - with strong indica-like effects. While being cerebrally uplifting, stimulating, and clear, also very highly recommended for general body pain.:Rafiki,Awesome sativa strain - with strong indica-like effects. While being cerebrally uplifting, stimulating, and clear, also very highly recommended for general body pain.:Rafiki,Awesome sativa strain - with strong indica-like effects. While being cerebrally uplifting, stimulating, and clear, also very highly recommended for general body pain.:Rafiki\n    [stars] => 4.5\n)\n', 'Durban Poison', '', 'publish', 'closed', 'closed', '', 'durban-poison', '', '', '2017-02-14 18:39:09', '2017-02-14 18:39:09', '', 0, 'http://tpb.waaark.dev/product/durban-poison/', 0, 'product', '', 0),
	(582, 3, '2017-02-14 18:39:11', '2017-02-14 18:39:11', '', 'thumbnail_581', '', 'inherit', 'closed', 'closed', '', 'thumbnail_581', '', '', '2017-02-14 18:39:11', '2017-02-14 18:39:11', '', 581, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_581.jpg', 0, 'attachment', 'image/jpeg', 0),
	(583, 3, '2017-02-14 18:39:11', '2017-02-14 18:39:11', 'Array\n(\n    [strain_name] => Dutch Treat Haze\n    [description] => <p>One of Colorado\'s underground favorites before becoming a staple at Boulder MMC in Boulder, CO, Dutch Treat Haze is one of the most wonderful Haze hybrids around, bringing the absolute best parts of Green House Seeds\' famous Super Silver Haze but moderating the Sativa effect with the uplifting yet still Indica-dominant Amsterdam strain Dutch Treat. ?Both parent strains have a citrus element to them, and that comes out in this hybrid, but it also has interesting funky notes of eucalyptus, sandalwood, and floor cleaner.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029325\n    [record_id] => 51\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>One of Colorado\'s underground favorites before becoming a staple at Boulder MMC in Boulder, CO, Dutch Treat Haze is one of the most wonderful Haze hybrids around, bringing the absolute best parts of Green House Seeds\' famous Super Silver Haze but moderating the Sativa effect with the uplifting yet still Indica-dominant Amsterdam strain Dutch Treat.  Both parent strains have a citrus element to them, and that comes out in this hybrid, but it also has interesting funky notes of eucalyptus, sandalwood, and floor cleaner.</p>\n    [aroma] => <p>The complex but undeniably Sativa aroma the Dutch Treat Haze offers blends the punchy, reedy side of the Haze family with the sweet, crisp citrus side (which is given an added boost by the sweet and also-citrusy Dutch Treat).  The perfect melding of Haze aromas in the flowers themselves also results in a wonderful floral-fresh-sweet-smelling smoke when it\'s combusted - in all, a treat for the nose.</p>\n    [flavor] => <p>Much like the smell, the flavor combines the sweet-citrusy Haze and Dutch Treat with the eucalyptus-funky Haze elements that often come out of good old-stock Super Silver Haze.  The flavor is especially noticeable and enjoyable in a joint, where the crisp flavor hangs on the lips all the way through to the crutch and lingers in the mouth and sinuses after smoking.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Dutch+Treat+Haze/dutch-treat-haze-3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Dutch Treat Haze', '', 'publish', 'closed', 'closed', '', 'dutch-treat-haze', '', '', '2017-02-14 18:39:11', '2017-02-14 18:39:11', '', 0, 'http://tpb.waaark.dev/product/dutch-treat-haze/', 0, 'product', '', 0),
	(584, 3, '2017-02-14 18:39:13', '2017-02-14 18:39:13', '', 'thumbnail_583', '', 'inherit', 'closed', 'closed', '', 'thumbnail_583', '', '', '2017-02-14 18:39:13', '2017-02-14 18:39:13', '', 583, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_583.jpg', 0, 'attachment', 'image/jpeg', 0),
	(585, 3, '2017-02-14 18:39:14', '2017-02-14 18:39:14', 'Array\n(\n    [strain_name] => East Coast Alien\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2928\n    [record_id] => 52\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => <p>Fuel and earth tones, rather complex. <br></p>\n    [flavor] => <p>Sour on the inhale and a bitter kushy exhale <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/East+Coast+Alien/east-coast-alien-6(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'East Coast Alien', '', 'publish', 'closed', 'closed', '', 'east-coast-alien', '', '', '2017-02-14 18:39:14', '2017-02-14 18:39:14', '', 0, 'http://tpb.waaark.dev/product/east-coast-alien/', 0, 'product', '', 0),
	(586, 3, '2017-02-14 18:39:16', '2017-02-14 18:39:16', '', 'thumbnail_585', '', 'inherit', 'closed', 'closed', '', 'thumbnail_585', '', '', '2017-02-14 18:39:16', '2017-02-14 18:39:16', '', 585, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_585.jpg', 0, 'attachment', 'image/jpeg', 0),
	(587, 3, '2017-02-14 18:39:16', '2017-02-14 18:39:16', 'Array\n(\n    [strain_name] => G-13 Widow\n    [description] => <p>This was a superb Indica-dominant cross, bottom line. The overall grow quality and bag appeal was impressive, while the perfect harvest timing seemed like the veritable cherry on top. The two parent strains really aren\'t known for their taste and smell (both are generally chosen for their potency), but this cross was still very pleasant to smoke, possessing a nice lemony bite. We recommend this most highly as an after work or late-night med, as it puts the user in a very sedative and relaxed state where even basic communication can at times be too much to deal with. Sinking into the couch and enjoying the mood elevation and warm body presence is probably the most likely effect of this med a real Indica experience despite the slightly rushy start. Great job by the Biocare crew - it was a very well cared-for sample overall that lasted longer than most and retained medicinal potency well into hour #2.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 53\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => elaxed state where even basic communication can at times be too much to deal with. Sinking into the couch and enjoying the mood elevation and warm body presence is probably the most likely effect of this med a real Indica experience despite the slightly rushy start. Great job by the Biocare crew - it was a very well cared-for sample overall that lasted longer than most and retained medicinal potency well into hour #2.</p>~\n    [aroma] => <p>Though it\'s not an aroma that really marks itself as distinct or uniquely enjoyable, this G-13 Widow produced a lovely sharp lemon-pine scent with a bit of muskiness and also sweetness in the mix. Lemon is at the forefront though for sure, and it was nicely pungent once broken apart.</p>\n    [flavor] => <p>It was mostly a fresh and clean-tasting vegetation with a pine element to it - not really something we\'d seek out, but certainly not a bad flavor. The smoke was smooth despite being rather thick, and the final ash was a very light gray, indicating that it had a proper flush.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/G-13+Widow/g13-widow-38(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'G-13 Widow', '', 'publish', 'closed', 'closed', '', 'g-13-widow', '', '', '2017-02-14 18:39:16', '2017-02-14 18:39:16', '', 0, 'http://tpb.waaark.dev/product/g-13-widow/', 0, 'product', '', 0),
	(588, 3, '2017-02-14 18:39:19', '2017-02-14 18:39:19', '', 'thumbnail_587', '', 'inherit', 'closed', 'closed', '', 'thumbnail_587', '', '', '2017-02-14 18:39:19', '2017-02-14 18:39:19', '', 587, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_587.jpg', 0, 'attachment', 'image/jpeg', 0),
	(589, 3, '2017-02-14 18:39:19', '2017-02-14 18:39:19', 'Array\n(\n    [strain_name] => Ghost Moonshine\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 54\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => \n    [flavor] => <p>This particular phenotype selection from seed stock leans heavily towards the Ghost\'s OG side of the spectrum. Blue Moonshine adds an interesting musky sweetness to the zesty ginger-lemon OG flavor of the Ghost, and serves to thicken up the smoke as well as increase the heaviness of the effects. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Ghost+Moonshine/ghost-moonshine-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Ghost Moonshine', '', 'publish', 'closed', 'closed', '', 'ghost-moonshine', '', '', '2017-02-14 18:39:19', '2017-02-14 18:39:19', '', 0, 'http://tpb.waaark.dev/product/ghost-moonshine/', 0, 'product', '', 0),
