	(591, 3, '2017-02-14 18:39:22', '2017-02-14 18:39:22', 'Array\n(\n    [strain_name] => Ghost OG\n    [description] => <p>Clone only phenotype of OG Kush<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0947\n    [record_id] => 55\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Clone only phenotype of OG Kush<br></p>\n    [aroma] => <p>Terpentine, biological, musty. <br></p>\n    [flavor] => <p>Camphor, Pine and lemon tart<br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Ghost+OG/image5(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Ghost OG', '', 'publish', 'closed', 'closed', '', 'ghost-og', '', '', '2017-02-14 18:39:22', '2017-02-14 18:39:22', '', 0, 'http://tpb.waaark.dev/product/ghost-og/', 0, 'product', '', 0),
	(592, 3, '2017-02-14 18:39:24', '2017-02-14 18:39:24', '', 'thumbnail_591', '', 'inherit', 'closed', 'closed', '', 'thumbnail_591', '', '', '2017-02-14 18:39:24', '2017-02-14 18:39:24', '', 591, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_591.jpg', 0, 'attachment', 'image/jpeg', 0),
	(593, 3, '2017-02-14 18:39:25', '2017-02-14 18:39:25', 'Array\n(\n    [strain_name] => Girl Scout Cookies\n    [description] => <p>Rumored to be OG Kush x F1(undisclosed strain by original breeders) x Durban Poison<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 46\n    [record_id] => 56\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Rumored to be OG Kush x F1(undisclosed strain by original breeders) x Durban Poison<br></p>\n    [aroma] => <p>To its name, it has a sweet and spicy, oven-baked smell. <br></p>\n    [flavor] => <p>From the two disclosed parents, Durban Poison and OG Kush, there are taste elements of skunky peppermint and the slightest lemon zest. The "F1" unknown parent may be responsible for the yeasty bread-like taste that dominates the pallet. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Girl+Scout+Cookies/girl-scout-cookies-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => Girl Scout Cookies have always been a favorite munchie of mine, and when the strain first hit the cannabis scene I was really excited to try it. It definitely holds up to the hype if you get flower from a true cut of the strain. I love the purple hues and frosted bud structure. It rolls up really nicely into joints or blunts and is always a great treat after a long day at work! :Terpene_Barnes\n    [stars] => 4.5\n)\n', 'Girl Scout Cookies', '', 'publish', 'closed', 'closed', '', 'girl-scout-cookies', '', '', '2017-02-14 18:39:25', '2017-02-14 18:39:25', '', 0, 'http://tpb.waaark.dev/product/girl-scout-cookies/', 0, 'product', '', 0),
	(594, 3, '2017-02-14 18:39:27', '2017-02-14 18:39:27', '', 'thumbnail_593', '', 'inherit', 'closed', 'closed', '', 'thumbnail_593', '', '', '2017-02-14 18:39:27', '2017-02-14 18:39:27', '', 593, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_593.jpg', 0, 'attachment', 'image/jpeg', 0),
	(595, 3, '2017-02-14 18:39:28', '2017-02-14 18:39:28', 'Array\n(\n    [strain_name] => Glass Slipper\n    [description] => Glass?Slipper?is an example of the Dutch breeding scene getting their hands on one of the United States\' most wanted clone-only strains and fusing it with some of the best they have to offer. ?"The White" is a supremely potent variety thought to be evolved out of the OG Kush family line, while Cinderella 99 is a much-loved Brothers Grimm classic that was once seen as the pinnacle of Dutch breeding projects. ?A fusion of these two strong genetic lines has produced a wonderful hybrid in?Glass?Slipper, one which retains the Kushy elements of the mother but has an interesting floral-sweet-fruity twang and a more cerebral effect added by the Cinderella 99 males.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928273\n    [record_id] => 57\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Glass Slipper is an example of the Dutch breeding scene getting their hands on one of the United States\' most wanted clone-only strains and fusing it with some of the best they have to offer.  "The White" is a supremely potent variety thought to be evolved out of the OG Kush family line, while Cinderella 99 is a much-loved Brothers Grimm classic that was once seen as the pinnacle of Dutch breeding projects.  A fusion of these two strong genetic lines has produced a wonderful hybrid in Glass Slipper, one which retains the Kushy elements of the mother but has an interesting floral-sweet-fruity twang and a more cerebral effect added by the Cinderella 99 males.\n    [aroma] => The Kush elements present in The White are the most noticeable aroma in most phenotypes, but there is a pungent fruity, floral sweetness lurking in the background that comes out in the Cinderella-dominant plants especially.  Spicy, dank, with a hint of sweetness - Glass Slipper is often more complex and engaging than either parent strain, a complex interplay of pineapple-citrus musk and Kush.\n    [flavor] => A soft sweetness with a spicy background on the inhale, then a dank Kush-influenced finish on the exhale matches the aroma, but almost in reverse.  Some phenos will have a sweeter flavor, but The White tends to dominate in this area.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Glass+Slipper/glass-slipper-SWAC-dry-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Glass Slipper', '', 'publish', 'closed', 'closed', '', 'glass-slipper', '', '', '2017-02-14 18:39:28', '2017-02-14 18:39:28', '', 0, 'http://tpb.waaark.dev/product/glass-slipper/', 0, 'product', '', 0),
	(596, 3, '2017-02-14 18:39:30', '2017-02-14 18:39:30', '', 'thumbnail_595', '', 'inherit', 'closed', 'closed', '', 'thumbnail_595', '', '', '2017-02-14 18:39:30', '2017-02-14 18:39:30', '', 595, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_595.jpg', 0, 'attachment', 'image/jpeg', 0),
	(597, 3, '2017-02-14 18:39:31', '2017-02-14 18:39:31', 'Array\n(\n    [strain_name] => Golden Goat\n    [description] => <p>An incredibly sweet and potent strain, Golden Goat is a Sativa-dominant plant with a strongly cerebral and social effects package. Its large yield of tangy buds makes it an excellent fusion of production and connoisseur-grade final product.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 58\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>An incredibly sweet and potent strain, Golden Goat is a Sativa-dominant plant with a strongly cerebral and social effects package. Its large yield of tangy buds makes it an excellent fusion of production and connoisseur-grade final product.</p>\n    [aroma] => Incredibly sweet mentholated lemon zest and cherry grenadine smell that brings to mind both the ISS and Hawaiian sides of the lineage<strong> </strong>\n    [flavor] => Exactly like the smell, it has a complex mentholated sweet-sour-spicy tropical fruit flavor that lingers on the palate and perfumes the room with a spicy, incense-heavy Haze-like smoke<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Golden+Goat/golden-goat-7(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => To me, Golden Goat has always felt like a pure Sativa rather than a hybrid. I always get a very strong head high accompanied by slightly elevated mood and an intense urge for productivity. Golden Goat has also helped me pretty effectively with pain relief. I\'d recommend this strain to anyone looking to motivate and uplift their senses!:Terpene_Barnes\n    [stars] => 4.0\n)\n', 'Golden Goat', '', 'publish', 'closed', 'closed', '', 'golden-goat', '', '', '2017-02-14 18:39:31', '2017-02-14 18:39:31', '', 0, 'http://tpb.waaark.dev/product/golden-goat/', 0, 'product', '', 0),
