	(599, 3, '2017-02-14 18:39:34', '2017-02-14 18:39:34', 'Array\n(\n    [strain_name] => Good Medicine\n    [description] => <p>Good Medicine was bred by Bodhi Seeds in California and is a Harlequin female, Appalachian male cross. Bodhi developed such knockout high-THC strains like Prayer Tower, Buddha\'s Hand and Tigers Milk.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2347CCHG\n    [record_id] => 59\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Good Medicine was bred by Bodhi Seeds in California and is a Harlequin female, Appalachian male cross. Bodhi developed such knockout high-THC strains like Prayer Tower, Buddha\'s Hand and Tigers Milk.</p>\n    [aroma] => <p>The ripened flowers smell fruity with musky, earthy after tones.</p>\n    [flavor] => <p>While many CBD crosses end up tasting like hay or hemp, the Appalachian lends enough flavor to qualify this is an enjoyable smoke, especially in oil form where it can lean towards the sweet side of the scale.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Good+Medicine/good-medicine-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => CBD Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Good Medicine', '', 'publish', 'closed', 'closed', '', 'good-medicine', '', '', '2017-02-14 18:39:34', '2017-02-14 18:39:34', '', 0, 'http://tpb.waaark.dev/product/good-medicine/', 0, 'product', '', 0),
