	(601, 3, '2017-02-14 18:39:38', '2017-02-14 18:39:38', 'Array\n(\n    [strain_name] => Grand Blue Cheese\n    [description] => <p>(Grand Daddy Purple x UK Cheese) x Raskal\'s OG Fire<br data-mce-bogus="1"></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029325\n    [record_id] => 60\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>(Grand Daddy Purple x UK Cheese) x Raskal\'s OG Fire<br data-mce-bogus="1"></p>\n    [aroma] => <p>Fermented cheese, blueberry and pine tartness<br></p>\n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/Grand+Blue+Cheese/image4(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Grand Blue Cheese', '', 'publish', 'closed', 'closed', '', 'grand-blue-cheese', '', '', '2017-02-14 18:39:38', '2017-02-14 18:39:38', '', 0, 'http://tpb.waaark.dev/product/grand-blue-cheese/', 0, 'product', '', 0),
