	(603, 3, '2017-02-14 18:39:41', '2017-02-14 18:39:41', 'Array\n(\n    [strain_name] => Grand Daddy Purps\n    [description] => <p>It earns high marks for its strong indica effects and great medicinal attributes. It was a good purple strain regardless and should be picked up if you like indicas or grapey flavored strains.</p>\n    [category] => Flowers\n    [type] => Indica\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2928\n    [record_id] => 61\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>It earns high marks for its strong indica effects and great medicinal attributes. It was a good purple strain regardless and should be picked up if you like indicas or grapey flavored strains.</p>\n    [aroma] => <p>Fresh grape smell with a piney undertone and hints of Tobacco.</p>\n    [flavor] => <p>Roasted berries and potpourri.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Grand+Daddy+Purps/grand-daddy-purps-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica\n    [prices] => \n    [reviews] => Growing up in Wisconsin, Grand Daddy Purps was always a sought after strain. It was one of the first purple strains I have ever smoked, and I\'ll never forget the sweet blend of pine and grape that hit my palate after the first hit. This strain produces a great body high and is an excellent aid to ensure a good night\'s sleep.:Terpene_Barnes\n    [stars] => 4.3\n)\n', 'Grand Daddy Purps', '', 'publish', 'closed', 'closed', '', 'grand-daddy-purps', '', '', '2017-02-14 18:39:41', '2017-02-14 18:39:41', '', 0, 'http://tpb.waaark.dev/product/grand-daddy-purps/', 0, 'product', '', 0),
	(604, 3, '2017-02-14 18:39:43', '2017-02-14 18:39:43', '', 'thumbnail_603', '', 'inherit', 'closed', 'closed', '', 'thumbnail_603', '', '', '2017-02-14 18:39:43', '2017-02-14 18:39:43', '', 603, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_603.jpg', 0, 'attachment', 'image/jpeg', 0),
	(605, 3, '2017-02-14 18:39:43', '2017-02-14 18:39:43', 'Array\n(\n    [strain_name] => Grape Ape\n    [description] => Possibly a sister phenotype of Granddaddy Purple and several of the other popular Purple strains that have floated around California for the better part of 15 years, Grape Ape is one of the most famous and beloved. ?Its smooth and relatively clear-headed though narcotic effect distinguishes it from the often heavy-feeling Purple family and make it a more versatile choice for daytime use. ?Its rock hard buds smell of sweet grape incense and turn a mottled to deep royal purple by the time it finishes flowering.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 62\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Possibly a sister phenotype of Granddaddy Purple and several of the other popular Purple strains that have floated around California for the better part of 15 years, Grape Ape is one of the most famous and beloved.  Its smooth and relatively clear-headed though narcotic effect distinguishes it from the often heavy-feeling Purple family and make it a more versatile choice for daytime use.  Its rock hard buds smell of sweet grape incense and turn a mottled to deep royal purple by the time it finishes flowering.\n    [aroma] => Grape Ape has a sweet but still musky scent which has strong notes of grape Kool-Aid with background hints of nag champa incense.  From a distance or through a bag, it often has a skunky element to it, but the sweetness and grape qualities really come out once its broken apart.\n    [flavor] => A fairly direct translation of the aroma, the flavor is the same mix of grape sweetness and musky incense notes, offering both a fairly strong initial flavor and a lingering aftertaste.  The smoke is normally thick and can often hit the throat somewhat hard like many Purple strains.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Grape+Ape/grape-ape-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Grape Ape', '', 'publish', 'closed', 'closed', '', 'grape-ape', '', '', '2017-02-14 18:39:43', '2017-02-14 18:39:43', '', 0, 'http://tpb.waaark.dev/product/grape-ape/', 0, 'product', '', 0),
