	(607, 3, '2017-02-14 18:39:46', '2017-02-14 18:39:46', 'Array\n(\n    [strain_name] => Great White Shark\n    [description] => <p>This strain is one I will definitely go back for. I really enjoyed the good expansion, the body aspect and the huge head high. If I didn\'t find the mid to strong paranoia each time I would like it even more. Some folks really enjoy that aspect, but if you are a new patient, go slow, this is one you could easily over do.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 63\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>This strain is one I will definitely go back for. I really enjoyed the good expansion, the body aspect and the huge head high. If I didn\'t find the mid to strong paranoia each time I would like it even more. Some folks really enjoy that aspect, but if you are a new patient, go slow, this is one you could easily over do.</p>\n    [aroma] => <p>Sweet skunk with citrus undertones<br></p>\n    [flavor] => Classic sweet skunk with an astringent bite<br>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Great+White+Shark/image4(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Great White Shark', '', 'publish', 'closed', 'closed', '', 'great-white-shark', '', '', '2017-02-14 18:39:46', '2017-02-14 18:39:46', '', 0, 'http://tpb.waaark.dev/product/great-white-shark/', 0, 'product', '', 0),
