	(609, 3, '2017-02-14 18:39:48', '2017-02-14 18:39:48', 'Array\n(\n    [strain_name] => Green Crack\n    [description] => <p>A wonderful strain with an unimposing flavor and an upbeat effect that is energetic without being racy<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0947\n    [record_id] => 64\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>A wonderful strain with an unimposing flavor and an upbeat effect that is energetic without being racy<br></p>\n    [aroma] => <p>A nice fruity, sweet scent with a touch of soil.</p>\n    [flavor] => <p>Hashy and earthy tasting, just a hint of sweetness. Did not taste like it smelled.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Green+Crack/green-crack-6(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Green Crack', '', 'publish', 'closed', 'closed', '', 'green-crack', '', '', '2017-02-14 18:39:48', '2017-02-14 18:39:48', '', 0, 'http://tpb.waaark.dev/product/green-crack/', 0, 'product', '', 0),
