	(611, 3, '2017-02-14 18:39:51', '2017-02-14 18:39:51', 'Array\n(\n    [strain_name] => Hanis\n    [description] => A fusion of some serious Indica genetics in the Bubba and the Kunduz Afghani, the Haze element adds some hybrid vigor and variation in structure.? Overall though, the plants are very Bubba-dominant in structure, finishing at times with nearly black foliage and purple buds with large calyxes that form the signature "crowns" seen in the Bubba. ?The dark green leaves look heavily Indica but the Haze really kicks in during flowering, when the plants stretch to twice their height and begin taking on the signature superglue-like smell of the 1994 Positronics Haze.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 46\n    [record_id] => 65\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A fusion of some serious Indica genetics in the Bubba and the Kunduz Afghani, the Haze element adds some hybrid vigor and variation in structure.  Overall though, the plants are very Bubba-dominant in structure, finishing at times with nearly black foliage and purple buds with large calyxes that form the signature "crowns" seen in the Bubba.  The dark green leaves look heavily Indica but the Haze really kicks in during flowering, when the plants stretch to twice their height and begin taking on the signature superglue-like smell of the 1994 Positronics Haze.\n    [aroma] => Interesting sharp smell that brings to mind superglue or acetone, it has a background of Bubba-like coffee/chocolate sweetness.  Its vaguely skunky and sharp scent pre-grind really explodes into a complex and acrid aroma once it\'s broken apart, lingering on the hands and in the air.<strong></strong>\n    [flavor] => Very much like the scent, it has the same almost chemical glue attack, with a musky, hashy Bubba-like finish with notes of hash and earthy qualities from the Afghan.<strong></strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Hanis/hanis-finished-7(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Hanis', '', 'publish', 'closed', 'closed', '', 'hanis', '', '', '2017-02-14 18:39:51', '2017-02-14 18:39:51', '', 0, 'http://tpb.waaark.dev/product/hanis/', 0, 'product', '', 0),
	(612, 3, '2017-02-14 18:39:53', '2017-02-14 18:39:53', '', 'thumbnail_611', '', 'inherit', 'closed', 'closed', '', 'thumbnail_611', '', '', '2017-02-14 18:39:53', '2017-02-14 18:39:53', '', 611, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_611.jpg', 0, 'attachment', 'image/jpeg', 0),
	(613, 3, '2017-02-14 18:39:53', '2017-02-14 18:39:53', 'Array\n(\n    [strain_name] => Headband\n    [description] => <p>One of the most visually-striking samples we\'ve received, with quite the potency punch, as it knocked our review staff for a bit of a loop with its trippy effects full of hallucinations and a head-spinning initial attack. Once it calmed down a bit though it provided great mood elevation, relaxation, and mild pain relief. We\'d warn beginners against this strain, as even a small 0.1g dosage was more than enough to put an experienced patient in another mental dimension for a solid 2.5 hours. If you want a bit of a rollercoaster ride and enjoy the taste of a Sour Diesel or Kush, you owe yourself to try this superb example of Headband, as it was by consensus the best example of it that we\'ve ever tried.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928273\n    [record_id] => 66\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>One of the most visually-striking samples we\'ve received, with quite the potency punch, as it knocked our review staff for a bit of a loop with its trippy effects full of hallucinations and a head-spinning initial attack. Once it calmed down a bit though it provided great mood elevation, relaxation, and mild pain relief. We\'d warn beginners against this strain, as even a small 0.1g dosage was more than enough to put an experienced patient in another mental dimension for a solid 2.5 hours. If you want a bit of a rollercoaster ride and enjoy the taste of a Sour Diesel or Kush, you owe yourself to try this superb example of Headband, as it was by consensus the best example of it that we\'ve ever tried.</p>\n    [aroma] => <p>This is definitely a Diesel-tinged bouquet, especially before being ground up - it was very pungent in the jar, almost more than it was when handled. The mix of fuel, skunk, spice, bitter citrus, and rubber retains its pungency until it settles a bit, when the aroma changes to more of a soft, slightly sweet presence.</p>\n    [flavor] => <p>Much like the smell, but with more of a skunky, rubbery, fuel empahsis to it, and notes of citrus-pine sharpness, with a thick, expansive smoke.<br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Headband/headband-11(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => Headband lives up to its name and always gives me the slight feeling of wearing an actual headband. This strain produces an intense head high and brings pressure in a slight halo around your head. Headband is an excellent strain to enhance your focus and uplift your mind. Headband has always helped me stay productive when I\'m feeling bored or have writer\'s block.:Terpene_Barnes\n    [stars] => 4.3\n)\n', 'Headband', '', 'publish', 'closed', 'closed', '', 'headband', '', '', '2017-02-14 18:39:53', '2017-02-14 18:39:53', '', 0, 'http://tpb.waaark.dev/product/headband/', 0, 'product', '', 0),
	(614, 3, '2017-02-14 18:39:55', '2017-02-14 18:39:55', '', 'thumbnail_613', '', 'inherit', 'closed', 'closed', '', 'thumbnail_613', '', '', '2017-02-14 18:39:55', '2017-02-14 18:39:55', '', 613, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_613.jpg', 0, 'attachment', 'image/jpeg', 0),
	(615, 3, '2017-02-14 18:39:56', '2017-02-14 18:39:56', 'Array\n(\n    [strain_name] => Heavy Duty Fruity\n    [description] => <p>The HDF gave me a pretty heavy, quick intoxication that had me laying in bed watching whatever channel happened to be on. I seriously forgot about the option of changing channels, it simlply didn\'t exist. This wasn\'t an activity based strain, but the combination of power and sleepiness, mixed with an excellent taste leads me to a favorable review. This was on the fence between an A- and a B+ with the nod coming for the duration and the terrific sleep it provided in a mid-day setting.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 67\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The HDF gave me a pretty heavy, quick intoxication that had me laying in bed watching whatever channel happened to be on. I seriously forgot about the option of changing channels, it simlply didn\'t exist. This wasn\'t an activity based strain, but the combination of power and sleepiness, mixed with an excellent taste leads me to a favorable review. This was on the fence between an A- and a B+ with the nod coming for the duration and the terrific sleep it provided in a mid-day setting.</p>\n    [aroma] => <p>Sweet and non-descript fruity, almost reminiscent of tutti-fruity candy<br></p>\n    [flavor] => <p>Spicy slight sweetness</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Heavy+Duty+Fruity/image5(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Heavy Duty Fruity', '', 'publish', 'closed', 'closed', '', 'heavy-duty-fruity', '', '', '2017-02-14 18:39:56', '2017-02-14 18:39:56', '', 0, 'http://tpb.waaark.dev/product/heavy-duty-fruity/', 0, 'product', '', 0),
	(616, 3, '2017-02-14 18:39:58', '2017-02-14 18:39:58', '', 'thumbnail_615', '', 'inherit', 'closed', 'closed', '', 'thumbnail_615', '', '', '2017-02-14 18:39:58', '2017-02-14 18:39:58', '', 615, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_615.jpg', 0, 'attachment', 'image/jpeg', 0),
	(617, 3, '2017-02-14 18:39:59', '2017-02-14 18:39:59', 'Array\n(\n    [strain_name] => Isaac Haze\n    [description] => A worldly fusion of inter-continental proportions, this cross from Bodhi Seeds fuses a very rare clone-only creation from Chemdog (of the ChemDawg strain family fame) in Giesel with Ace Seeds\' exotic but relatively quick-finishing Bangi Haze. The various phenotypes range from the expected stank of the Giesel to the complex spicy incense-heavy aroma of the Haze, but the most choice phenos will exhibit an almost sweet lemony-fuel spice bouquet that is truly something extraordinary. ?It produces fairly large nugs which often have a uniquely greasy resin profile and normally have moderate leaf coverage.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WWMMJ\n    [record_id] => 68\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A worldly fusion of inter-continental proportions, this cross from Bodhi Seeds fuses a very rare clone-only creation from Chemdog (of the ChemDawg strain family fame) in Giesel with Ace Seeds\' exotic but relatively quick-finishing Bangi Haze. The various phenotypes range from the expected stank of the Giesel to the complex spicy incense-heavy aroma of the Haze, but the most choice phenos will exhibit an almost sweet lemony-fuel spice bouquet that is truly something extraordinary.  It produces fairly large nugs which often have a uniquely greasy resin profile and normally have moderate leaf coverage.\n    [aroma] => Again, it depends quite a bit upon phenotype what sort of aromas come out of this complex cross - however, most plants tend to have a unique citrus incense profile which tickles the nostrils, especially when freshly-ground.  Notes of sandalwood, tea, fuel, and softer floral notes all intermingle into what is a dream combination for many Sativa-lovers.  Pungent without being overwhelmingly stinky like the Giesel mom, this strain\'s smell is both exotic and familiar while remaining very pleasant.  Some phenotypes do exhibit the pungent Chem end of the spectrum, with skunky chem-fuel elements which come in at varying amounts.\n    [flavor] => The taste mostly matches the aroma of the various phenotypes, with the Giesel-dominant examples normally having a more pungent aftertaste than a frontal taste and the opposite existing with the more lemony-incense Haze varieties.  A bit of hashiness creeps into the flavor at times simply due to the thick trichome coverage which is present, but the smoke is very smooth and not particularly expansive.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Isaac+Haze/giesel-bangi-haze-isaac-haze-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Isaac Haze', '', 'publish', 'closed', 'closed', '', 'isaac-haze', '', '', '2017-02-14 18:39:59', '2017-02-14 18:39:59', '', 0, 'http://tpb.waaark.dev/product/isaac-haze/', 0, 'product', '', 0),
