	(619, 3, '2017-02-14 18:40:01', '2017-02-14 18:40:01', 'Array\n(\n    [strain_name] => Jack Flash\n    [description] => <p>Great stuff! High quality in every category. Its powerful cerebral buzz, mixed with a milder body high, has made this strain an up-and-coming contender for top medical strains. Jack Flash is a great looking strain with many desirable traits. When this strain is around, do not hesitate to try some for yourself.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2347CCHG\n    [record_id] => 69\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Great stuff! High quality in every category. Its powerful cerebral buzz, mixed with a milder body high, has made this strain an up-and-coming contender for top medical strains. Jack Flash is a great looking strain with many desirable traits. When this strain is around, do not hesitate to try some for yourself.</p>\n    [aroma] => <p>Lovers of this strain will definitely recognize the smell immediately, with its combination of crisp, almost "cool" aromas including lemon, eucalyptus, and cleaner. Though not a super-pungent strain in general, this one was definitely noticed in the bag and increased in pungency when broken apart. Spicy citrus Haze smell gave way to a more smooth and outright sweet orange cream type of aroma after the grind, both of which we loved.</p>\n    [flavor] => <p>While sharing qualities with both the pre and post-grind aroma, the flavor just fell short of those heights, giving more of a lightly sweet and floral, creamy orange flavor on the inhale, and a sharper more haze-like and spicy exhale. The flush seemed well-done, as the final ash was a fluffy light gray and white, and the smoke was very smooth throughout the experience.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Jack+Flash/jack-flash-19(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => Love this strain so much! Try to buy this whenever I can, which is pretty often :) I smoke this stuff before my weekend hikes & it doesn\'t disappoint.:samantha,Love this strain so much! Try to buy this whenever I can, which is pretty often :) I smoke this stuff before my weekend hikes & it doesn\'t disappoint.:samantha,Love this strain so much! Try to buy this whenever I can, which is pretty often :) I smoke this stuff before my weekend hikes & it doesn\'t disappoint.:samantha\n    [stars] => 4.3\n)\n', 'Jack Flash', '', 'publish', 'closed', 'closed', '', 'jack-flash', '', '', '2017-02-14 18:40:01', '2017-02-14 18:40:01', '', 0, 'http://tpb.waaark.dev/product/jack-flash/', 0, 'product', '', 0),
