	(621, 3, '2017-02-14 18:40:05', '2017-02-14 18:40:05', 'Array\n(\n    [strain_name] => Killer Queen\n    [description] => A hybrid in the truest sense, this combination of Airborne G-13 and selected Cinderella 99 males serves to increase the yield and flavor of the G-13 mother while retaining her legendary potency.? The flowering time of the two parent strains was already low, making this an especially attractive hybrid for growers with limited space, limited time, and the desire for top-flight potency.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 72\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A hybrid in the truest sense, this combination of Airborne G-13 and selected Cinderella 99 males serves to increase the yield and flavor of the G-13 mother while retaining her legendary potency.  The flowering time of the two parent strains was already low, making this an especially attractive hybrid for growers with limited space, limited time, and the desire for top-flight potency.\n    [aroma] => Most of the smell comes from the Cinderella 99 side of the family, with its slightly putrid tropical fruit stank<strong> </strong>\n    [flavor] => The flavor is also mostly C-99, with a sour, sharp, and slightly sweet blend of fruity notes with hints of pine and skunk<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Killer+Queen/killer-queen-a-cut-above-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Killer Queen', '', 'publish', 'closed', 'closed', '', 'killer-queen', '', '', '2017-02-14 18:40:05', '2017-02-14 18:40:05', '', 0, 'http://tpb.waaark.dev/product/killer-queen/', 0, 'product', '', 0),
