	(625, 3, '2017-02-14 18:40:12', '2017-02-14 18:40:12', 'Array\n(\n    [strain_name] => L.A. Confidential\n    [description] => By combining a legendary Los Angeles-area Afghani with another choice Afghani specimen, DNA Genetics created a very potent Indica hybrid in L.A. Confidential.? The plant has massive dark green fan leaves, is disease and mold-resistant, and yields well with proper care.? The old school sweet and spicy Afghani taste brings to mind the mother OG Affie.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029326\n    [record_id] => 75\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => By combining a legendary Los Angeles-area Afghani with another choice Afghani specimen, DNA Genetics created a very potent Indica hybrid in L.A. Confidential.  The plant has massive dark green fan leaves, is disease and mold-resistant, and yields well with proper care.  The old school sweet and spicy Afghani taste brings to mind the mother OG Affie.\n    [aroma] => Musky and spicy, it recalls its Afghani roots with the aroma<strong> </strong>\n    [flavor] => Spicy and hashy, there is a light sweetness at times that brings to mind pressed hash<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/L.A.+Confidential/la-confidential-15(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => L.A. Confidential was one of the first strains I ever grew. I love the look of the flowering plant, and it produces some beautiful nugs as well. The flavor is definitely unique and very hashy but it is a good change up from skunkier flower. It rolls up nicely into a joint and because of its high resin content, it burns fairly slowly.:Terpene_Barnes\n    [stars] => 4.3\n)\n', 'L.A. Confidential', '', 'publish', 'closed', 'closed', '', 'l-a-confidential', '', '', '2017-02-14 18:40:12', '2017-02-14 18:40:12', '', 0, 'http://tpb.waaark.dev/product/l-a-confidential/', 0, 'product', '', 0),
