	(627, 3, '2017-02-14 18:40:14', '2017-02-14 18:40:14', 'Array\n(\n    [strain_name] => L.A. Kush\n    [description] => A special and aggressive clone-only OG Kush, the LA Kush certainly came out of that area, tough not a ton else is known about its lineage. It seems to possibly have Diesel or ChemDawg crossed into it, because the smell is very sharp and fuely, unlike most of the more traditional OG Kush cuts such as San Fernando Valley, Ghost\'s OG, and Tahoe OG which have more of a spicy and citrus-pine quality to them. If anyone has more concrete information on the genetic background and history of this particular OG Kush cut (this cut is NOT Abusive\'s OG Kush, which took on the nickname "LA Kush" in the early-middle 2000\'s, but a different one), please <a href="http://www.kindreviews.com/contact">contact us</a>.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2929\n    [record_id] => 76\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A special and aggressive clone-only OG Kush, the LA Kush certainly came out of that area, tough not a ton else is known about its lineage. It seems to possibly have Diesel or ChemDawg crossed into it, because the smell is very sharp and fuely, unlike most of the more traditional OG Kush cuts such as San Fernando Valley, Ghost\'s OG, and Tahoe OG which have more of a spicy and citrus-pine quality to them. If anyone has more concrete information on the genetic background and history of this particular OG Kush cut (this cut is NOT Abusive\'s OG Kush, which took on the nickname "LA Kush" in the early-middle 2000\'s, but a different one), please <a href="http://www.kindreviews.com/contact">contact us</a>.\n    [aroma] => Very sharp and aggressive pine-heavy Kush scent, with strong hints of the "tire shop" rubber/fuel smell<strong> </strong>\n    [flavor] => The taste is just as aggressive as the smell, with slightly more citrus and fuel… very sharp, chemical, and acrid Kush<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/L.A.+Kush/la-kush-3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'L.A. Kush', '', 'publish', 'closed', 'closed', '', 'l-a-kush', '', '', '2017-02-14 18:40:14', '2017-02-14 18:40:14', '', 0, 'http://tpb.waaark.dev/product/l-a-kush/', 0, 'product', '', 0),
