	(629, 3, '2017-02-14 18:40:17', '2017-02-14 18:40:17', 'Array\n(\n    [strain_name] => L.S.D.\n    [description] => Available in feminized seed form only, this plant was made by crossing Barney\'s favorite in-house Skunk strain with a potent Mazar, resulting in a fairly heavy Indica plant that manages to retain some of the Sativa head effects from the Skunk.? A hearty plant that resists disease and mold, it definitely gets its structure and height from the Afghani side of its lineage rather than the Skunk, though it is also a good producer thanks to the hybrid vigor of the cross.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 77\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Available in feminized seed form only, this plant was made by crossing Barney\'s favorite in-house Skunk strain with a potent Mazar, resulting in a fairly heavy Indica plant that manages to retain some of the Sativa head effects from the Skunk.  A hearty plant that resists disease and mold, it definitely gets its structure and height from the Afghani side of its lineage rather than the Skunk, though it is also a good producer thanks to the hybrid vigor of the cross.\n    [aroma] => A tangy lemon-lime musk is the standard smell, but at times there is a sweet, creamy, almost nutty aroma that comes out of certain phenotypes.<strong> </strong>\n    [flavor] => It varies according to phenotype, but generally it\'s a slightly sweet musk with hints of citrus.  The taste is definitely dominated by the Afghani part of the lineage rather than the Skunk.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/L.S.D/lsd_delta9_3(500?500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'L.S.D.', '', 'publish', 'closed', 'closed', '', 'l-s-d', '', '', '2017-02-14 18:40:17', '2