	(633, 3, '2017-02-14 18:40:22', '2017-02-14 18:40:22', 'Array\n(\n    [strain_name] => Maui Waui\n    [description] => <p>the best Maui Wowie we\'ve had the pleasure of trying, and it was certainly the most Sativa-looking. Very potent initially, it receded to an evenly energetic and clear-headed state but retained very strong eye effects throughout. It really shined when put under the camera lens, as it\'s a beautiful specimen.<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029326\n    [record_id] => 84\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>the best Maui Wowie we\'ve had the pleasure of trying, and it was certainly the most Sativa-looking. Very potent initially, it receded to an evenly energetic and clear-headed state but retained very strong eye effects throughout. It really shined when put under the camera lens, as it\'s a beautiful specimen.<br></p>\n    [aroma] => <p>A bit piney, a bit earthy, but with a unique spicy smell that reminded us of fennel or even holiday spices. It wasn\'t very pungent until it was ground up…</p>\n    [flavor] => <p>Much like the smell, a pine taste was the dominant note, but there was also some lemon and a slight sweetness. It was expansive yet very smooth on the throat.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Maui+Waui/maui-waui-31(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => Maui has a great, "positive" feeling in the high.  Not overly strong, I enjoy this strain during the daytime.  Not too racy and not too sedating make this my perfect hybrid. :Jbam4d,Maui has a great, "positive" feeling in the high.  Not overly strong, I enjoy this strain during the daytime.  Not too racy and not too sedating make this my perfect hybrid. :Jbam4d\n    [stars] => 4.0\n)\n', 'Maui Waui', '', 'publish', 'closed', 'closed', '', 'maui-waui', '', '', '2017-02-14 18:40:22', '2017-02-14 18:40:22', '', 0, 'http://tpb.waaark.dev/product/maui-waui/', 0, 'product', '', 0),
