	(635, 3, '2017-02-14 18:40:35', '2017-02-14 18:40:35', 'Array\n(\n    [strain_name] => Maui Wowie\n    [description] => Since the 1960\'s, "Maui Wowie" (or "Waui") was known as an especially exotic and desirable strain to cannabis?connoisseurs?the world over.? While it\'s unclear if the original genetic line is still alive and kicking, there are certainly many strains from Maui that are similar and capture the same smooth, citrus-pine taste and the enjoyable mid-level Sativa effects that it became famous for. ?As far as the dispensary scene goes, it seems that Maui Wowie and "Maui" operate interchangeably for the most part, with some plain "Maui" being distinguished from the Wowie by a more Indica growth profile and effect (at times this is called Hawaiian Indica as well). ?Maui strains are heavily Sativa in growth pattern, but the effect is generally mellow and clear-headed.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2929\n    [record_id] => 85\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Since the 1960\'s, "Maui Wowie" (or "Waui") was known as an especially exotic and desirable strain to cannabis connoisseurs the world over.  While it\'s unclear if the original genetic line is still alive and kicking, there are certainly many strains from Maui that are similar and capture the same smooth, citrus-pine taste and the enjoyable mid-level Sativa effects that it became famous for.  As far as the dispensary scene goes, it seems that Maui Wowie and "Maui" operate interchangeably for the most part, with some plain "Maui" being distinguished from the Wowie by a more Indica growth profile and effect (at times this is called Hawaiian Indica as well).  Maui strains are heavily Sativa in growth pattern, but the effect is generally mellow and clear-headed.\n    [aroma] => Some Maui is very tropical-smelling, with hints of sweet fruits and a floral quality - others (the ones with a greater Indica influence) have a more pine-dominant profile and are less sweet.\n    [flavor] => Again, there is some variation between the purer Sativa-dominant Maui and the pine-scented one - the pure Maui has a softly sweet flavor while the other one has a more earthy pine flavor with a hint of lemon.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Maui+Wowie/maui-wowie-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Maui Wowie', '', 'publish', 'closed', 'closed', '', 'maui-wowie', '', '', '2017-02-14 18:40:35', '2017-02-14 18:40:35', '', 0, 'http://tpb.waaark.dev/product/maui-wowie/', 0, 'product', '', 0),
	(636, 3, '2017-02-14 18:40:37', '2017-02-14 18:40:37', '', 'thumbnail_635', '', 'inherit', 'closed', 'closed', '', 'thumbnail_635', '', '', '2017-02-14 18:40:37', '2017-02-14 18:40:37', '', 635, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_635.jpg', 0, 'attachment', 'image/jpeg', 0),
	(637, 3, '2017-02-14 18:40:37', '2017-02-14 18:40:37', 'Array\n(\n    [strain_name] => Moby Dick\n    [description] => Dinafem chose their two best clones of White Widow and Haze and crossed them, likely using the colloidial silver sex-reversal process in order to create male flowers on female plants, thus producing feminized seed stock.? White Widow is known for its power and trichome production, well Haze is renowned for its soaring, cerebral effect - combining the two produces a Sativa-dominant plant which ups the frostiness of the Haze, lessens the flowering time, but still retains much of the Haze flavor and aroma.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0946\n    [record_id] => 88\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Dinafem chose their two best clones of White Widow and Haze and crossed them, likely using the colloidial silver sex-reversal process in order to create male flowers on female plants, thus producing feminized seed stock.  White Widow is known for its power and trichome production, well Haze is renowned for its soaring, cerebral effect - combining the two produces a Sativa-dominant plant which ups the frostiness of the Haze, lessens the flowering time, but still retains much of the Haze flavor and aroma.\n    [aroma] => Like a sweet Haze, carrying notes of flowers, citrus, vanilla, and tropical fruits - very appealing.<strong> </strong>\n    [flavor] => Flowery (even soapy), the Haze seems to come through more clearly in the flavor than the smell - it\'s not quite as sweet but still carries the same "smooth" qualities of vanilla and eucalyptus.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Moby+Dick/moby-dick(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Moby Dick', '', 'publish', 'closed', 'closed', '', 'moby-dick', '', '', '2017-02-14 18:40:37', '2017-02-14 18:40:37', '', 0, 'http://tpb.waaark.dev/product/moby-dick/', 0, 'product', '', 0),
