	(639, 3, '2017-02-14 18:40:39', '2017-02-14 18:40:39', 'Array\n(\n    [strain_name] => Moonshine Haze\n    [description] => This hybrid stunned the world when it won the 2011 High Times Cannabis Cup in Amsterdam for the Best Seed Company Sativa after being entered by first-time competitor Rare Dankness Seeds. ?It\'s a classic fusion of some of the best Hazes the Dutch scene has to offer with just a little bit of Cali genetics (the Trainwreck) to spice up the package. ?Its spear-shaped and pointed colas take after the Trainwreck, but otherwise it takes most strongly after the sweet Amnesia Haze, carrying slight elements of the reedy, slightly musky Neville\'s Haze as well.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 47\n    [record_id] => 89\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => This hybrid stunned the world when it won the 2011 High Times Cannabis Cup in Amsterdam for the Best Seed Company Sativa after being entered by first-time competitor Rare Dankness Seeds.  It\'s a classic fusion of some of the best Hazes the Dutch scene has to offer with just a little bit of Cali genetics (the Trainwreck) to spice up the package.  Its spear-shaped and pointed colas take after the Trainwreck, but otherwise it takes most strongly after the sweet Amnesia Haze, carrying slight elements of the reedy, slightly musky Neville\'s Haze as well.\n    [aroma] => The scent definitely seems to be Amnesia Haze-dominant, with a lightly citrusy, sweet, fresh aroma that is easily-noticed as soon as the jar is opened, though it\'s more of a "what\'s that lovely smell?" as opposed to "whew, what stinks?" situation.  When ground apart, its already strong pungency increases further, bringing out a slight sandalwood/spice Haziness which adds complexity to the exceedingly pleasant, floral Amnesia smell.  This strain brings to mind several of the best things about Haze, and lovers of that genetic line will undoubtedly find something to their liking here.\n    [flavor] => Sweet and floral elements are most prevalent on the inhale, but the hint of citrus comes out on the exhale, leaving a lingering Haze note on the palate.  The smoke perfumes the smoke perfumes the room like most good Haze tends to do and is very smooth on the throat and not particularly expansive.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Moonshine+Haze/moonshine-haze-61(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Moonshine Haze', '', 'publish', 'closed', 'closed', '', 'moonshine-haze', '', '', '2017-02-14 18:40:39', '2017-02-14 18:40:39', '', 0, 'http://tpb.waaark.dev/product/moonshine-haze/', 0, 'product', '', 0),
