	(641, 3, '2017-02-14 18:40:42', '2017-02-14 18:40:42', 'Array\n(\n    [strain_name] => Noggin\n    [description] => <p>A veritable melting pot of genetic lines, this hybrid is as unpredictable as its lineage would indicate.? When finished, it produces dense spear-shaped nugs that glimmer with trichomes and bright orange pistils.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928274\n    [record_id] => 90\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>A veritable melting pot of genetic lines, this hybrid is as unpredictable as its lineage would indicate.  When finished, it produces dense spear-shaped nugs that glimmer with trichomes and bright orange pistils.</p>\n    [aroma] => <p>Giving off a not particularly noticeable piney scent in the container, it turns into a lovely lemony-fertilizer burst of freshness when broken into.<strong> </strong></p>\n    [flavor] => <p>Some lightly sweet lemon blends with oddly spicy juniper<strong> </strong></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Noggin/noggin10(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Noggin', '', 'publish', 'closed', 'closed', '', 'noggin', '', '', '2017-02-14 18:40:42', '2017-02-14 18:40:42', '', 0, 'http://tpb.waaark.dev/product/noggin/', 0, 'product', '', 0),
