	(643, 3, '2017-02-14 18:40:45', '2017-02-14 18:40:45', 'Array\n(\n    [strain_name] => OG Sin\n    [description] => <p>OG Kush x Sour Diesel x C-99</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 91\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>OG Kush x Sour Diesel x C-99</p>\n    [aroma] => \n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/OG+Sin/og-sin-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'OG Sin', '', 'publish', 'closed', 'closed', '', 'og-sin', '', '', '2017-02-14 18:40:45', '2017-02-14 18:40:45', '', 0, 'http://tpb.waaark.dev/product/og-sin/', 0, 'product', '', 0),
