	(645, 3, '2017-02-14 18:40:47', '2017-02-14 18:40:47', 'Array\n(\n    [strain_name] => OJ Ghost\n    [description] => <p>OJ Ghost is a terrific example of an uplifting hybrid cannabis strain.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WWMMJ\n    [record_id] => 92\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>OJ Ghost is a terrific example of an uplifting hybrid cannabis strain.</p>\n    [aroma] => <p>As with all of the OJB crosses, the orange peel aroma is absolutely demonstrative! Unlike the familiar Tangerine Haze and Tangie lines which have softer, muted orange (citrus) scents, this family line brings childhood soccer game orange peel smells right to your face.</p>\n    [flavor] => <p>Upon intial inhale or dry puff the orange dominance makes its mark, but exhale of the smoke leaves a wonderful OG pinene flavor across the tongue and roof of mouth.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/OJ+Ghost/oj-ghost-og-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'OJ Ghost', '', 'publish', 'closed', 'closed', '', 'oj-ghost', '', '', '2017-02-14 18:40:47', '2017-02-14 18:40:47', '', 0, 'http://tpb.waaark.dev/product/oj-ghost/', 0, 'product', '', 0),
	(646, 3, '2017-02-14 18:40:49', '2017-02-14 18:40:49', '', 'thumbnail_645', '', 'inherit', 'closed', 'closed', '', 'thumbnail_645', '', '', '2017-02-14 18:40:49', '2017-02-14 18:40:49', '', 645, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_645.jpg', 0, 'attachment', 'image/jpeg', 0),
	(647, 3, '2017-02-14 18:40:49', '2017-02-14 18:40:49', 'Array\n(\n    [strain_name] => OJ Legend\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2348CCHG\n    [record_id] => 93\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => \n    [flavor] => <p>While still possessing the OJB male qualities, the OJ Legend brings more of the traditional OG pinene funk and chemical palette to bare.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/OJ+Legend/oj-legend-og-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'OJ Legend', '', 'publish', 'closed', 'closed', '', 'oj-legend', '', '', '2017-02-14 18:40:49', '2017-02-14 18:40:49', '', 0, 'http://tpb.waaark.dev/product/oj-legend/', 0, 'product', '', 0),
