	(649, 3, '2017-02-14 18:40:52', '2017-02-14 18:40:52', 'Array\n(\n    [strain_name] => OJ Sour Dubb\n    [description] => <p>Orange Juice Bud x Sour Dubb<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029326\n    [record_id] => 94\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Orange Juice Bud x Sour Dubb<br></p>\n    [aroma] => <p>Fresh flowers smell like lemon grass and orange zest and terpene development starts early as evident by its strong orange fragrance in early flower and even late vegetative stage.</p>\n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/OJ+Sour+Dubb/oj-sour-dubb-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'OJ Sour Dubb', '', 'publish', 'closed', 'closed', '', 'oj-sour-dubb', '', '', '2017-02-14 18:40:52', '2017-02-14 18:40:52', '', 0, 'http://tpb.waaark.dev/product/oj-sour-dubb/', 0, 'product', '', 0),
	(650, 3, '2017-02-14 18:40:54', '2017-02-14 18:40:54', '', 'thumbnail_649', '', 'inherit', 'closed', 'closed', '', 'thumbnail_649', '', '', '2017-02-14 18:40:54', '2017-02-14 18:40:54', '', 649, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_649.jpg', 0, 'attachment', 'image/jpeg', 0),
	(651, 3, '2017-02-14 18:40:55', '2017-02-14 18:40:55', 'Array\n(\n    [strain_name] => Outer Space\n    [description] => <p>The appearance was fairly spectacular thanks to the eminently visible trichomes that lay all over the bud surface. The smell/taste package was average but enjoyable enough not to hamper anything. The real star here though are the effects, which were blindingly potent at first, but dropped off to a very useful state of focused functionality. Some body attributes were present later on in the duration, but overall, this was a "heady" med that is best-suited for mental energy, mood, and ocular relief.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2929\n    [record_id] => 95\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The appearance was fairly spectacular thanks to the eminently visible trichomes that lay all over the bud surface. The smell/taste package was average but enjoyable enough not to hamper anything. The real star here though are the effects, which were blindingly potent at first, but dropped off to a very useful state of focused functionality. Some body attributes were present later on in the duration, but overall, this was a "heady" med that is best-suited for mental energy, mood, and ocular relief.</p>\n    [aroma] => <p>Not exactly appealing in the sense that you want to smell it regularly, this strain was a combination of a slightly creamy vegetal sweetness along with a more putrid, fecal, "cheese" type of smell that made us wrinkle our collective nose. It hints at potency, but isn\'t terribly appealing to most people. The smell also weirdly seemed to disappear after a grinding rather than getting stronger.</p>\n    [flavor] => <p>Much like the smell, the taste wasn\'t terribly appealing but wasn\'t bad either - it gave off a light, spicy citrus with some smooth, almost creamy notes present along with a floral (one reviewer said "soapy") quality. Contrary to many strains, this one seemed to taste better when you really go at it with the lighter rather than \'sipping\' it, filling the mouth with a floral-tinged smoke.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Outer+Space/image9(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Outer Space', '', 'publish', 'closed', 'closed', '', 'outer-space', '', '', '2017-02-14 18:40:55', '2017-02-14 18:40:55', '', 0, 'http://tpb.waaark.dev/product/outer-space/', 0, 'product', '', 0),
	(652, 3, '2017-02-14 18:40:56', '2017-02-14 18:40:56', '', 'thumbnail_651', '', 'inherit', 'closed', 'closed', '', 'thumbnail_651', '', '', '2017-02-14 18:40:56', '2017-02-14 18:40:56', '', 651, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_651.jpg', 0, 'attachment', 'image/jpeg', 0),
	(653, 3, '2017-02-14 18:40:57', '2017-02-14 18:40:57', 'Array\n(\n    [strain_name] => Phenom\n    [description] => <p>We wish we knew the origins of this strain so that we could better see where its potential lies medically - this one just seemed like it wasn\'t quite what it could be, and making judgments on the strain as a whole would be difficult. We saw huge potential in the smell/flavor package, which reminded us of some of our favorite fruity Hazes - but the iffy trim, overall "blah" visual appearance, and lack of visual trichomes knocked it down a peg. The effects were definitely Sativa-dominant, with a familiar Haze-influenced dream-like effect and some moderate muscle and mental relaxation. We sort of vacillated between active and sedative states, making the medical uses once again a little confusing and varied. We see this as a late daytime type of med for patients who want to retain functionality and energy but can still use a mental vacation.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 96\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>We wish we knew the origins of this strain so that we could better see where its potential lies medically - this one just seemed like it wasn\'t quite what it could be, and making judgments on the strain as a whole would be difficult. We saw huge potential in the smell/flavor package, which reminded us of some of our favorite fruity Hazes - but the iffy trim, overall "blah" visual appearance, and lack of visual trichomes knocked it down a peg. The effects were definitely Sativa-dominant, with a familiar Haze-influenced dream-like effect and some moderate muscle and mental relaxation. We sort of vacillated between active and sedative states, making the medical uses once again a little confusing and varied. We see this as a late daytime type of med for patients who want to retain functionality and energy but can still use a mental vacation.</p>\n    [aroma] => <p>This strain really reminded our crew of something from the Jack Herer line, as it had that familiar (yet sweeter, more in the Jack Flash vein) citrus Haze aroma that we all love - another reviewer mentioned Dutch Durban as another similar aroma profile. It was certainly noticeable in the jar, but it really developed when it was handled or ground up, getting a little more aggressive and taking on an almost Diesel-like backing musk that competed with the sweetness for attention.</p>\n    [flavor] => <p>Giving off a rather thick smoke, this strain mostly matched its aroma in the flavor, bringing a slightly more floral, eucalyptus-influenced flavor with many of the same citrus elements. It left a pleasantly hashy aftertaste in the mouth, and the actual flavor maintained well as it burned away. As mentioned, the smoke was rather thick, moderately harsh, and rather expansive - in short, you\'ll probably cough on this one from one or the other.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Phenom/phenom-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Phenom', '', 'publish', 'closed', 'closed', '', 'phenom', '', '', '2017-02-14 18:40:57', '2017-02-14 18:40:57', '', 0, 'http://tpb.waaark.dev/product/phenom/', 0, 'product', '', 0),
	(654, 3, '2017-02-14 18:41:00', '2017-02-14 18:41:00', '', 'thumbnail_653', '', 'inherit', 'closed', 'closed', '', 'thumbnail_653', '', '', '2017-02-14 18:41:00', '2017-02-14 18:41:00', '', 653, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_653.jpg', 0, 'attachment', 'image/jpeg', 0),
	(655, 3, '2017-02-14 18:41:01', '2017-02-14 18:41:01', 'Array\n(\n    [strain_name] => Pink Pez\n    [description] => <p>The smell this strain possessed was pretty wonderful - basically the opposite end of most of the impressive-smelling samples we\'ve had lately (most seem to be Diesel or Kush-dominant), it provided a wonderfully sweet candy-like aroma that still had a nice sharp quality to it. The appearance was very good as well, with lots of colors and great structure. Though the cannabinoid numbers came back kind of low, the initial potency actually felt rather strong and this strain held steady at medicinal levels for a solid 1.5 - 2 hours, which is very good. It might get on top of you a bit when it shifts gears mid-way through and gets heavy on the eyes, but the worst thing that would happen is an unexpected nap. We recommend this as a very good after-work relaxation med or one that leads into sleep; it was a quality Indica-dominant hybrid experience overall.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029327\n    [record_id] => 99\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The smell this strain possessed was pretty wonderful - basically the opposite end of most of the impressive-smelling samples we\'ve had lately (most seem to be Diesel or Kush-dominant), it provided a wonderfully sweet candy-like aroma that still had a nice sharp quality to it. The appearance was very good as well, with lots of colors and great structure. Though the cannabinoid numbers came back kind of low, the initial potency actually felt rather strong and this strain held steady at medicinal levels for a solid 1.5 - 2 hours, which is very good. It might get on top of you a bit when it shifts gears mid-way through and gets heavy on the eyes, but the worst thing that would happen is an unexpected nap. We recommend this as a very good after-work relaxation med or one that leads into sleep; it was a quality Indica-dominant hybrid experience overall.</p>\n    [aroma] => <p>This was the only area where the name really seemed to fit the strain - the smell it produced reminded us of a sweet pink grapefruit. There were notes of citrus, pine, cherry candy, and flowers, and it was nicely pungent once ground up.</p>\n    [flavor] => <p>While it wasn\'t a bad taste, we really struggled to get much of a read on this one. We got some sweet notes, some slightly spicy/floral notes, and that was about it. The smoke was smooth and enjoyable though, very easy to consume with it non-expansive nature and soft attack.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Pink+Pez/pink-pez-9(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid,\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Pink Pez', '', 'publish', 'closed', 'closed', '', 'pink-pez', '', '', '2017-02-14 18:41:01', '2017-02-14 18:41:01', '', 0, 'http://tpb.waaark.dev/product/pink-pez/', 0, 'product', '', 0),
	(656, 3, '2017-02-14 18:41:08', '2017-02-14 18:41:08', '', 'thumbnail_655', '', 'inherit', 'closed', 'closed', '', 'thumbnail_655', '', '', '2017-02-14 18:41:08', '2017-02-14 18:41:08', '', 655, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_655.jpg', 0, 'attachment', 'image/jpeg', 0),
	(657, 3, '2017-02-14 18:41:08', '2017-02-14 18:41:08', 'Array\n(\n    [strain_name] => Platinum Master Kush\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2930\n    [record_id] => 100\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => Musky and coffee-like pre-grind, it brightens up a bit and takes on some more standard citrus Kush notes when handled<strong> </strong>\n    [flavor] => Floral Kush with hints of menthol and spice<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Platinum+Master+Kush/platinum-master-kush2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Platinum Master Kush', '', 'publish', 'closed', 'closed', '', 'platinum-master-kush', '', '', '2017-02-14 18:41:08', '2017-02-14 18:41:08', '', 0, 'http://tpb.waaark.dev/product/platinum-master-kush/', 0, 'product', '', 0),
