	(659, 3, '2017-02-14 18:41:10', '2017-02-14 18:41:10', 'Array\n(\n    [strain_name] => Pootie Tang\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 101\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => The variations in phenotype will also result in variations in smell. However, Pootie Tang can generally be described as earthy, hashy, and tangy. The smell is predominantly earthy, which is consistent with the aroma of each of the parents. The underlying tangy-ness is a mild citrus smell – like a fresh grapefruit as opposed to a ripe orange.\n    [flavor] => Once again, flavor will vary between phenotypes; however, the taste can generally be described as dry, musty and slightly refreshing. The taste is predominantly earthy, which is consistent with both parents. The refreshing flavors can range from tangy (from the Tang Tang) to more piney (from the LA Kush). Despite the name, do not expect the flavor to be intensely ‘orange’.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Pootie+Tang/pootie-tang-mindful-5(500x00).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa dominant hybrid. There is the potential for variance in phenotypes but most are sativa dominant (as was intended by the breeder). The sample we tested certainly had more sativa dominant properties. \n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Pootie Tang', '', 'publish', 'closed', 'closed', '', 'pootie-tang', '', '', '2017-02-14 18:41:10', '2017-02-14 18:41:10', '', 0, 'http://tpb.waaark.dev/product/pootie-tang/', 0, 'product', '', 0),
