	(661, 3, '2017-02-14 18:41:13', '2017-02-14 18:41:13', 'Array\n(\n    [strain_name] => Power Kush\n    [description] => A hearty and quick-flowering variety, it has slender leaves for an Indica-dominant plant and produces a large amount of thick, creamy-orange pistils.? When it\'s finished, it produces a citrusy aroma with a light skunky backdrop - it\'s a moderate yielder, but a problem-free type of experience overall, good for beginners.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 102\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A hearty and quick-flowering variety, it has slender leaves for an Indica-dominant plant and produces a large amount of thick, creamy-orange pistils.  When it\'s finished, it produces a citrusy aroma with a light skunky backdrop - it\'s a moderate yielder, but a problem-free type of experience overall, good for beginners.\n    [aroma] => Surprisingly fresh citrus with a background of skunky musk<strong> </strong>\n    [flavor] => Cirtusy and spicy, with a smooth smoke<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Power+Kush/power-kush-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Power Kush', '', 'publish', 'closed', 'closed', '', 'power-kush', '', '', '2017-02-14 18:41:13', '2017-02-14 18:41:13', '', 0, 'http://tpb.waaark.dev/product/power-kush/', 0, 'product', '', 0),
