	(663, 3, '2017-02-14 18:41:15', '2017-02-14 18:41:15', 'Array\n(\n    [strain_name] => Presidential Kush\n    [description] => Developed in Florida and later moved to Colorado, Presidential Kush is a banger of a Sativa, testing at very high potency levels and finishing completely caked in tall, leaning trichomes.? Its lemony Kush flavor and smell make it a favorite of those who enjoy Kushes in the SFV and Ghost vein.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0945\n    [record_id] => 103\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Developed in Florida and later moved to Colorado, Presidential Kush is a banger of a Sativa, testing at very high potency levels and finishing completely caked in tall, leaning trichomes.  Its lemony Kush flavor and smell make it a favorite of those who enjoy Kushes in the SFV and Ghost vein.\n    [aroma] => Soil, spice, and skunkiness gives way to a fresh citrus Kush when ground up<strong> </strong>\n    [flavor] => Clean pine, soil, and a strong but not sweet lemon component<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Presidential+Kush/preskush_herbalconnectionscc_4(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Presidential Kush', '', 'publish', 'closed', 'closed', '', 'presidential-kush', '', '', '2017-02-14 18:41:15', '2017-02-14 18:41:15', '', 0, 'http://tpb.waaark.dev/product/presidential-kush/', 0, 'product', '', 0),
