	(665, 3, '2017-02-14 18:41:18', '2017-02-14 18:41:18', 'Array\n(\n    [strain_name] => Pura Vida\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 48\n    [record_id] => 104\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => Pura Vida has a nearly offensive-strength terpenes and produces heavy pine, skunk and lemon aromas. Fresh flowers have a more chemy sting to the nose and as the flower dries the skunk and lemon become more dominant.\n    [flavor] => Pura Vida produces a thick and rich smoke. Whichever way you prefer to consume cannabis, Pura Vida delivers. Because of its high yield, this flower is prevalent in many concentrates to boost cannabinoids while not compromising any flavor or aroma. A tightly rolled joint may deliver flavor nuances of citrus fruit, pine forest and hopps.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Pura+Vida/pura-vida-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Pura Vida', '', 'publish', 'closed', 'closed', '', 'pura-vida', '', '', '2017-02-14 18:41:18', '2017-02-14 18:41:18', '', 0, 'http://tpb.waaark.dev/product/pura-vida/', 0, 'product', '', 0),
