	(667, 3, '2017-02-14 18:41:20', '2017-02-14 18:41:20', 'Array\n(\n    [strain_name] => Purple Dream\n    [description] => <p>Overall this plant appears like any other thin leaved equitorial cannabis varietal until mid to late flower when it starts taking on beautiful purple pastel hues and gains its signature fake grape candy scent.<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928275\n    [record_id] => 105\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Overall this plant appears like any other thin leaved equitorial cannabis varietal until mid to late flower when it starts taking on beautiful purple pastel hues and gains its signature fake grape candy scent.<br></p>\n    [aroma] => <p>The aroma is one of a kind, with very sweet notes mixed with synthetic purple candies. The hazey nature comes through with a bit of sharp spice reminding you this really does carry the Blue Dream family line very well.</p>\n    [flavor] => <p>Spicy haze is the dominant flavor, though if smoked through fresh glass plenty of the aromatic fruitfulness will strike the back of the tongue.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Purple+Dream/purple-dream-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Purple Dream', '', 'publish', 'closed', 'closed', '', 'purple-dream', '', '', '2017-02-14 18:41:20', '2017-02-14 18:41:20', '', 0, 'http://tpb.waaark.dev/product/purple-dream/', 0, 'product', '', 0),
