	(669, 3, '2017-02-14 18:41:23', '2017-02-14 18:41:23', 'Array\n(\n    [strain_name] => Purple Kush\n    [description] => Garberville Purple Kush is most notably held by Swerve of Cali Connection Seeds fame and tends to grow with some foxtails and has more of a straight-up Kush taste/smell with hints of the "purple".? Kyle Kushman\'s Las Vegas Purple Kush was claimed in a New Yorker article to be a special Purple Indica x Northern Lights find, but many have since claimed it\'s an S1 Bubba Kush of some kind due to the dark flavors present.? And finally, many old-school people claim that none of the famous clone-only PK\'s around are in fact the original Purple Kush, which is said to be a very special Purple Pakistani variety that was found in the late 70\'s or early 80\'s.? As you can see, the history of a strain that\'s been renamed several times and has several legit versions floating around gets very murky quickly.~\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 106\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => The SR-71 cut is thought to be a very similar to Purple Urkle (possibly a hybrid) and has more of the typical "purple"/hashy grape flavor - it was passed most commonly by the SR-71 (now Blue Sky) Coffeeshop in the "Oaksterdam" section of Oakland, CA and may be Purple Afghani x Hindu Kush.  The Garberville Purple Kush is most notably held by Swerve of Cali Connection Seeds fame and tends to grow with some foxtails and has more of a straight-up Kush taste/smell with hints of the "purple".  Kyle Kushman\'s Las Vegas Purple Kush was claimed in a New Yorker article to be a special Purple Indica x Northern Lights find, but many have since claimed it\'s an S1 Bubba Kush of some kind due to the dark flavors present.  And finally, many old-school people claim that none of the famous clone-only PK\'s around are in fact the original Purple Kush, which is said to be a very special Purple Pakistani variety that was found in the late 70\'s or early 80\'s.  As you can see, the history of a strain that\'s been renamed several times and has several legit versions floating around gets very murky quickly.\n    [aroma] => Pungent, with notes of "purple" (incense, perfume, musky grapes), and the spicy Kush end of the spectrum as well.  The SR-71 and Garberville cuts are more "purple" in both flavor and smell compared to the Kyle Kushman/Las Vegas Purple Kush.<strong> </strong>\n    [flavor] =>  a bit of sweetness at times - a great blend of the typical purple flavor and traditional Afghani/Pakistani Kush varieties.<strong> </strong>~\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Purple+Kush/purple-kush-RiNO-supply-co-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Purple Kush', '', 'publish', 'closed', 'closed', '', 'purple-kush', '', '', '2017-02-14 18:41:23', '2017-02-14 18:41:23', '', 0, 'http://tpb.waaark.dev/product/purple-kush/', 0, 'product', '', 0),
