	(671, 3, '2017-02-14 18:41:25', '2017-02-14 18:41:25', 'Array\n(\n    [strain_name] => Purple Urkle\n    [description] => A California medical scene cut that is dated back to the late 1980\'s, the Urkle (also called Purple Urple, and Purple Urkel) is thought to have come from the Mendo Purps line.? It\'s a slow-vegging plant that almost always turns a deep shade of purple by the time it\'s finished. It\'s the purple plant of choice for many, as it\'s known for being more potent and flavorful than many of the others.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2349CCHG\n    [record_id] => 107\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A California medical scene cut that is dated back to the late 1980\'s, the Urkle (also called Purple Urple, and Purple Urkel) is thought to have come from the Mendo Purps line.  It\'s a slow-vegging plant that almost always turns a deep shade of purple by the time it\'s finished. It\'s the purple plant of choice for many, as it\'s known for being more potent and flavorful than many of the others.\n    [aroma] => Skunky and sweet dark fruit fragrance with notes of nag champa incense<strong> </strong>\n    [flavor] => Grapey, sweet, and musky - Urkle is the gold standard Purple taste for many people<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Purple+Urkle/purple-urkle-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Purple Urkle', '', 'publish', 'closed', 'closed', '', 'purple-urkle', '', '', '2017-02-14 18:41:25', '2017-02-14 18:41:25', '', 0, 'http://tpb.waaark.dev/product/purple-urkle/', 0, 'product', '', 0),
	(672, 3, '2017-02-14 18:41:38', '2017-02-14 18:41:38', '', 'thumbnail_671', '', 'inherit', 'closed', 'closed', '', 'thumbnail_671', '', '', '2017-02-14 18:41:38', '2017-02-14 18:41:38', '', 671, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_671.jpg', 0, 'attachment', 'image/jpeg', 0),
	(673, 3, '2017-02-14 18:41:39', '2017-02-14 18:41:39', 'Array\n(\n    [strain_name] => Purple VooDoo\n    [description] => <p>This "purple" was better than many in that it didn\'t leave us feeling totally groggy and sleepy, but rather had a fairly clear-headed feeling for the majority of the effects. Some of the typical Purple taste combined with a strong Afghani influence made this an average medicine in terms of taste and smell, but the duration and effects mostly made up for it. We would recommend this strain for an indoors nighttime activity or work, as we were functional but not exactly full of energy - it would put you in an appropriate mental state for sleeping as well by the end of the effects if consumed in the evening.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029327\n    [record_id] => 108\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>This "purple" was better than many in that it didn\'t leave us feeling totally groggy and sleepy, but rather had a fairly clear-headed feeling for the majority of the effects. Some of the typical Purple taste combined with a strong Afghani influence made this an average medicine in terms of taste and smell, but the duration and effects mostly made up for it. We would recommend this strain for an indoors nighttime activity or work, as we were functional but not exactly full of energy - it would put you in an appropriate mental state for sleeping as well by the end of the effects if consumed in the evening.</p>\n    [aroma] => <p>Sweet dark florals and grape candy over an earthy musk</p>\n    [flavor] => <p>Musky dark fruits, currant, bitter grape</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Purple+Voodoo/purple-voodoo-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Purple VooDoo', '', 'publish', 'closed', 'closed', '', 'purple-voodoo', '', '', '2017-02-14 18:41:39', '2017-02-14 18:41:39', '', 0, 'http://tpb.waaark.dev/product/purple-voodoo/', 0, 'product', '', 0),
