	(675, 3, '2017-02-14 18:41:41', '2017-02-14 18:41:41', 'Array\n(\n    [strain_name] => Querkle\n    [description] => Querkle has two main phenotypes: one pheno is shorter and more purple, while the other trends toward the Space Queen and lacks the coloration and also has more of a Sativa effect.? It\'s a moderate to heavy yielder, especially if it gets a long veg time and lots of root space.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2930\n    [record_id] => 109\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Querkle has two main phenotypes: one pheno is shorter and more purple, while the other trends toward the Space Queen and lacks the coloration and also has more of a Sativa effect.  It\'s a moderate to heavy yielder, especially if it gets a long veg time and lots of root space.\n    [aroma] => Much like the Urkle mom, it smells of musky yet sweet grape and dark fruits - the Space Queen-leaning pheno can have notes of the C-99 sharpness as well.\n    [flavor] => Moderately sweet but with a lovely sharp quality, the flavor is much like the smell, consisting of candy grapes and musky, almost Kush-like flavors.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Querkle/querkle-awc-3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Querkle', '', 'publish', 'closed', 'closed', '', 'querkle', '', '', '2017-02-14 18:41:41', '2017-02-14 18:41:41', '', 0, 'http://tpb.waaark.dev/product/querkle/', 0, 'product', '', 0),
