	(677, 3, '2017-02-14 18:41:44', '2017-02-14 18:41:44', 'Array\n(\n    [strain_name] => R2\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 110\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => \n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/R2/R2-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'R2', '', 'publish', 'closed', 'closed', '', 'r2', '', '', '2017-02-14 18:41:44', '2017-02-14 18:41:44', '', 0, 'http://tpb.waaark.dev/product/r2/', 0, 'product', '', 0),
