	(679, 3, '2017-02-14 18:41:46', '2017-02-14 18:41:46', 'Array\n(\n    [strain_name] => S.A.G.E.\n    [description] => <p>S.A.G.E. stands for "Sativa-Afghani Genetic Equilibrium", indicating that the mission for this plant was to provide the best of both worlds. ?Many believe that\'s the case, as this plants has been extremely popular, with some elite selections being grown, cloned, and passed around for 10+ years now. ?While it is certainly a hybrid, S.A.G.E. is clearly Sativa-dominant, with some phenotypes going out to 80 days flowering. ?Its Haze-heavy mother shines through in the effect and the appearance.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 111\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>S.A.G.E. stands for "Sativa-Afghani Genetic Equilibrium", indicating that the mission for this plant was to provide the best of both worlds.  Many believe that\'s the case, as this plants has been extremely popular, with some elite selections being grown, cloned, and passed around for 10+ years now.  While it is certainly a hybrid, S.A.G.E. is clearly Sativa-dominant, with some phenotypes going out to 80 days flowering.  Its Haze-heavy mother shines through in the effect and the appearance.</p>\n    [aroma] => <p>A spicy Haze scent with notes of sandalwood, bay leaves, garlic, and a light Dutch Haze type of sweetness at times, which comes through heavily in certain phenotypes.</p>\n    [flavor] => <p>Though the quicker-finishing Afghan-heavy phenotypes are at times sweet, the flavor of the most prized cuts is similar to its namesake, with a bouquet of spice-like flavors with a fresh nature - this one tastes like a true Sativa, reedy and clean on the palate with an expansive but smooth smoke.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/S.A.G.E/SAGE_Silver-Lizard_Sativa-002(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'S.A.G.E.', '', 'publish', 'closed', 'closed', '', 's-a-g-e', '', '', '2017-02-14 18:41:46', '2017-02-14 18:41:46', '', 0, 'http://tpb.waaark.dev/product/s-a-g-e/', 0, 'product', '', 0),
