	(681, 3, '2017-02-14 18:41:49', '2017-02-14 18:41:49', 'Array\n(\n    [strain_name] => S.D.D.C.\n    [description] => A wonderful example of hybrid vigor, this strain brings together two strains on nearly opposite ends of the spectrum in the 70+ day flowering Sativa-dominant Sour Diesel and the burly, hashy, trich-covered Indica Deep Chunk. ?The flavor and scent expression of the parents changes slightly depending upon medium, phenotype, and growing conditions. ?It normally finishes a deep purple color, with both leaves and calyxes darkening as it approaches harvest time.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0945\n    [record_id] => 112\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A wonderful example of hybrid vigor, this strain brings together two strains on nearly opposite ends of the spectrum in the 70+ day flowering Sativa-dominant Sour Diesel and the burly, hashy, trich-covered Indica Deep Chunk.  The flavor and scent expression of the parents changes slightly depending upon medium, phenotype, and growing conditions.  It normally finishes a deep purple color, with both leaves and calyxes darkening as it approaches harvest time.\n    [aroma] => The ECSD comes through most clearly in the scent, which has strong notes of rubber, fuel, skunks.  However, there is a creamy, hashy Deep Chunk sweetness that manages to make its way to the forefront now and then.  The astringent aromas dominate post-grind and this is a strain that is easily-noticed from several feet away when disturbed.\n    [flavor] => When properly-grown, a deep flavor which nearly matches the pungency of the aroma lingers on the palate after smoking.  The flavor is slightly hashier than the aroma, but still has clear skunk, rubber, and fuel elements, especially on the attack.  The smoke tends to be fairly thick and can cause coughing, but if well-trimmed and cured, it can be very smooth for such a potent smoke.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/S.D.D.C/SDDC-2nd-run-7(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'S.D.D.C.', '', 'publish', 'closed', 'closed', '', 's-d-d-c', '', '', '2017-02-14 18:41:49', '2017-02-14 18:41:49', '', 0, 'http://tpb.waaark.dev/product/s-d-d-c/', 0, 'product', '', 0),
