	(683, 3, '2017-02-14 18:41:51', '2017-02-14 18:41:51', 'Array\n(\n    [strain_name] => SFV OG Kush\n    [description] => One of the most prized OG Kush varieties today, the SFV cut is known for its Lemon Pledge funk and its meditative Sativa effects package.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 48\n    [record_id] => 113\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => One of the most prized OG Kush varieties today, the SFV cut is known for its Lemon Pledge funk and its meditative Sativa effects package.\n    [aroma] => Lemon-pine cleaner - it lacks the fuel and skunk elements which are often present in other OG Kush cuts.<strong> </strong>\n    [flavor] => Lemons and spice, it tastes much like the Ghost cut with a little more straight-up lemon flavor.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/SFV+OG+Kush/whitewidow1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'SFV OG Kush', '', 'publish', 'closed', 'closed', '', 'sfv-og-kush', '', '', '2017-02-14 18:41:51', '2017-02-14 18:41:51', '', 0, 'http://tpb.waaark.dev/product/sfv-og-kush/', 0, 'product', '', 0),
