	(685, 3, '2017-02-14 18:41:54', '2017-02-14 18:41:54', 'Array\n(\n    [strain_name] => Shaman\n    [description] => One of Dutch Passion\'s early crosses primarily meant for outdoor growing in the northern latitudes of The Netherlands, Shaman is known for most of its specimens turning a deep purple. ?The plant isn\'t a big yielder, and it also isn\'t the most potent variety, but its pleasant uplifting Sativa effect and complex floral-pine-incense aroma make it a great daytime choice for beginner and intermediate users.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928275\n    [record_id] => 114\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => One of Dutch Passion\'s early crosses primarily meant for outdoor growing in the northern latitudes of The Netherlands, Shaman is known for most of its specimens turning a deep purple.  The plant isn\'t a big yielder, and it also isn\'t the most potent variety, but its pleasant uplifting Sativa effect and complex floral-pine-incense aroma make it a great daytime choice for beginner and intermediate users.\n    [aroma] => Though it possesses a light "purple" scent, with notes of incense and a backing Skunky quality, Shaman has a tangy and fresh aroma once broken apart.  Hints of citrus, pine, and the smooth floral purple aroma from the pre-grind smell blend into a surprisingly appealing whole.\n    [flavor] => Much like the smell, it\'s not the most pungent thing around, but it is complex enough to keep a veteran user\'s interest.  A light skunky and floral flavor brings to mind the Skunk more than the Purple side of the family, and the light citrus elements come through as well in the aftertaste.  Beyond the first hit or two, it\'s mostly an earthy experience, but the smoke is smooth and light when properly grown and flushed.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Shaman/shaman-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Shaman', '', 'publish', 'closed', 'closed', '', 'shaman', '', '', '2017-02-14 18:41:54', '2017-02-14 18:41:54', '', 0, 'http://tpb.waaark.dev/product/shaman/', 0, 'product', '', 0),
