	(687, 3, '2017-02-14 18:41:56', '2017-02-14 18:41:56', 'Array\n(\n    [strain_name] => Showdawg\n    [description] => <p>Chem D x TK Stardawg<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 115\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Chem D x TK Stardawg<br></p>\n    [aroma] => <p>Sour, pine and chemical. <br></p>\n    [flavor] => <p>Tart and pungent. Skunky and a thick, heavy smoke. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Showdawg/show-dog-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Showdawg', '', 'publish', 'closed', 'closed', '', 'showdawg', '', '', '2017-02-14 18:41:56', '2017-02-14 18:41:56', '', 0, 'http://tpb.waaark.dev/product/showdawg/', 0, 'product', '', 0),
