	(689, 3, '2017-02-14 18:41:59', '2017-02-14 18:41:59', 'Array\n(\n    [strain_name] => SnowDawg\n    [description] => The sweetest and quickest to harvest of all the original ChemDawg varieties, the SnowDawg (sometimes known as "Super SnowDawg") yields well and forms pointed light green colas which appear almost white with trichomes. ?The influence of the Bubbleberry is evident in the aroma and flavor, which sweetens up the often acrid Chem family.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WWMMJ\n    [record_id] => 116\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => The sweetest and quickest to harvest of all the original ChemDawg varieties, the SnowDawg (sometimes known as "Super SnowDawg") yields well and forms pointed light green colas which appear almost white with trichomes.  The influence of the Bubbleberry is evident in the aroma and flavor, which sweetens up the often acrid Chem family.\n    [aroma] => SnowDawg has a tantalizing and complex aroma which really develops as it is broken apart.  A softly sweet and earthy aroma in its undisturbed state gives way to a blend of fruity sweetness, chemical funk, and earthy citrus that recalls its Chem family origins but seems wholly different.\n    [flavor] => There are many elements of the aroma present in the flavor, but there is a more direct Chem element, while still displaying a very healthy almost floral sweetness.  The smoke is smooth and crisp, with a mentholated quality which leaves the mouth feeling clean.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/SnowDawg/snowdawg-14(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'SnowDawg', '', 'publish', 'closed', 'closed', '', 'snowdawg', '', '', '2017-02-14 18:41:59', '2017-02-14 18:41:59', '', 0, 'http://tpb.waaark.dev/product/snowdawg/', 0, 'product', '', 0),
