	(691, 3, '2017-02-14 18:42:01', '2017-02-14 18:42:01', 'Array\n(\n    [strain_name] => Sour Diesel\n    [description] => Thought to be an accidental cross when the DNL hermied, Sour Diesel (or East Coast Sour Diesel, as it\'s commonly called) is a special plant in the OG Kush/ChemDawg line of strains.? Its often "crushing" Sativa effect actually seems to hit most people as more of an Indica, increasing couchlock and being strong to the point of being overwhelming at times.? The plant itself is a fairly lanky one that tends to show lots of foxtailing when finished, practically stinking up the room with its pungent fuel-skunk-citrus bouquet.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2349CCHG\n    [record_id] => 117\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Thought to be an accidental cross when the DNL hermied, Sour Diesel (or East Coast Sour Diesel, as it\'s commonly called) is a special plant in the OG Kush/ChemDawg line of strains.  Its often "crushing" Sativa effect actually seems to hit most people as more of an Indica, increasing couchlock and being strong to the point of being overwhelming at times.  The plant itself is a fairly lanky one that tends to show lots of foxtailing when finished, practically stinking up the room with its pungent fuel-skunk-citrus bouquet.\n    [aroma] => Sour Diesel displays an extremely pungent blend of fuel, skunk, citrus, and spice that will leak through many jars and bags when the strain is well-grown.  The sharpness gets stronger after breaking it up, adding a stronger kick of citrus as well as a cutting fuel aroma that tickles the nose.<strong></strong>\n    [flavor] => A frontal attack of skunky citrus funk gives way to a mentholated lime-kissed spice which lingers in the mouth.  The smoke is expansive and will definitely cause coughing on larger hits.\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Sour+Diesel/sour-diesel-urban-dispensary-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => My favorite strain, sour diesel has an energetic, clear headed high.  I love sativa but dislike haze influenced strains as they make me, well, feel hazy.  Sour Diesel has that clear headed high that allows me to socialize and stay active.\r\n\r\nThe only downside with this strain are the low yields, and the flowers tend to stretch and be a bit thin, typical of sativas.  \r\n\r\nFor what is lacks in bud structure, it more than makes up for in its effect. :Jbam4d,My favorite strain, sour diesel has an energetic, clear headed high.  I love sativa but dislike haze influenced strains as they make me, well, feel hazy.  Sour Diesel has that clear headed high that allows me to socialize and stay active.\r\n\r\nThe only downside with this strain are the low yields, and the flowers tend to stretch and be a bit thin, typical of sativas.  \r\n\r\nFor what is lacks in bud structure, it more than makes up for in its effect. :Jbam4d\n    [stars] => 4.8\n)\n', 'Sour Diesel', '', 'publish', 'closed', 'closed', '', 'sour-diesel', '', '', '2017-02-14 18:42:01', '2017-02-14 18:42:01', '', 0, 'http://tpb.waaark.dev/product/sour-diesel/', 0, 'product', '', 0),
	(692, 3, '2017-02-14 18:42:11', '2017-02-14 18:42:11', '', 'thumbnail_691', '', 'inherit', 'closed', 'closed', '', 'thumbnail_691', '', '', '2017-02-14 18:42:11', '2017-02-14 18:42:11', '', 691, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_691.jpg', 0, 'attachment', 'image/jpeg', 0),
	(693, 3, '2017-02-14 18:42:12', '2017-02-14 18:42:12', 'Array\n(\n    [strain_name] => Sour Grape\n    [description] => <p>Different from the Gage Green Grape Stomper which was renamed "Sour Grapes" by Blue Sky Collective in Oakland, this cut is from Apothecary Genetics and is their Grape Ape crossed with a Sour Diesel. ?The hybrid produces larger nugs than the Ape and demonstrates the hybrid vigor one would expect from such a cross. ?The mottled purple coloration and tangy sour grape-meets flowers aroma is immediately enticing to users, while the flavor and potent effects keep them coming back for more.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029327\n    [record_id] => 118\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Different from the Gage Green Grape Stomper which was renamed "Sour Grapes" by Blue Sky Collective in Oakland, this cut is from Apothecary Genetics and is their Grape Ape crossed with a Sour Diesel.  The hybrid produces larger nugs than the Ape and demonstrates the hybrid vigor one would expect from such a cross.  The mottled purple coloration and tangy sour grape-meets flowers aroma is immediately enticing to users, while the flavor and potent effects keep them coming back for more.</p>\n    [aroma] => <p>An engaging mix of the two parent strains, Sour Grapes has a fairly soft grape sweetness in the bag but blows up into a complex sour fruit aroma with hints of flowers and incense lingering in the background.  It doesn\'t tend to have outward Diesel elements, but the added sharpness can definitely be detected among the Grape-dominant package of smells.</p>\n    [flavor] => <p>Sweet and sour grape dominates the flavor, and the Diesel takes a definite backseat, never really being picked up except in that the taste is unlike the standard Grape Ape.  It has an expansive, thick smoke which can often cause coughing.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Sour+Grape/sour-grape-4(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid (leans Indica)\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Sour Grape', '', 'publish', 'closed', 'closed', '', 'sour-grape', '', '', '2017-02-14 18:42:12', '2017-02-14 18:42:12', '', 0, 'http://tpb.waaark.dev/product/sour-grape/', 0, 'product', '', 0),
	(694, 3, '2017-02-14 18:42:15', '2017-02-14 18:42:15', '', 'thumbnail_693', '', 'inherit', 'closed', 'closed', '', 'thumbnail_693', '', '', '2017-02-14 18:42:15', '2017-02-14 18:42:15', '', 693, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_693.jpg', 0, 'attachment', 'image/jpeg', 0),
	(695, 3, '2017-02-14 18:42:15', '2017-02-14 18:42:15', 'Array\n(\n    [strain_name] => Stardawg\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2930\n    [record_id] => 119\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => <p>Stardawg is alarmingly potent in chemical, acidic and pine fragrances. Like it\'s counterparts in the Chem Dog family, It truly smells like a dead skunk and has a very pevasive odor.</p>\n    [flavor] => <p>The musk lingering in the ambient aroma translates directly to flavor, where one may have a salivating or lip smacking reaction when consuming. Thus it is a favorite for processing into concentrates and the lineage of Chem Dog has spread to most modern day strains.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Stardawg/image5(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Stardawg', '', 'publish', 'closed', 'closed', '', 'stardawg', '', '', '2017-02-14 18:42:15', '2017-02-14 18:42:15', '', 0, 'http://tpb.waaark.dev/product/stardawg/', 0, 'product', '', 0),
