	(697, 3, '2017-02-14 18:42:18', '2017-02-14 18:42:18', 'Array\n(\n    [strain_name] => Starfruit\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 120\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => The smell is almost like rotting fruit, with a slightly putrid and musky element to it. <strong> </strong>\n    [flavor] => Rather neutral and in the earthy/herby category.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Starfruit/starfruit_atternativewellnesscenter_31(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Starfruit', '', 'publish', 'closed', 'closed', '', 'starfruit', '', '', '2017-02-14 18:42:18', '2017-02-14 18:42:18', '', 0, 'http://tpb.waaark.dev/product/starfruit/', 0, 'product', '', 0),
