	(699, 3, '2017-02-14 18:42:21', '2017-02-14 18:42:21', 'Array\n(\n    [strain_name] => Stevie Wonder\n    [description] => Its amazingly sweet-smelling tropical fruit bouquet and a relaxing Sativa experience make this a special plant.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 121\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Its amazingly sweet-smelling tropical fruit bouquet and a relaxing Sativa experience make this a special plant.\n    [aroma] => Sweet and sour tropical fruit, flowery at times, with a hint of sharpness when ground up.<strong> </strong>\n    [flavor] => The sweetness from the Blueberry comes through in the taste, and it mimics the smell to a great extent.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Stevie+Wonder/stevie_wonder_pure_3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Stevie Wonder', '', 'publish', 'closed', 'closed', '', 'stevie-wonder', '', '', '2017-02-14 18:42:21', '2017-02-14 18:42:21', '', 0, 'http://tpb.waaark.dev/product/stevie-wonder/', 0, 'product', '', 0),
