	(701, 3, '2017-02-14 18:42:24', '2017-02-14 18:42:24', 'Array\n(\n    [strain_name] => Stone Mountain\n    [description] => Bred and selected for a very potent, Indica-dominant effect, it appears that the mission was accomplished.? This strain really packs a punch and can send the user into sleep rather easily - very relaxing and narcotic in nature.? The plant itself is stretchier than the Bubba Kush mom but has tighter buds. ?Blue-purple is the dominant color once it gets close to harvest? a very dark-colored and resinous plant.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2350CCHG\n    [record_id] => 122\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Bred and selected for a very potent, Indica-dominant effect, it appears that the mission was accomplished.  This strain really packs a punch and can send the user into sleep rather easily - very relaxing and narcotic in nature.  The plant itself is stretchier than the Bubba Kush mom but has tighter buds.  Blue-purple is the dominant color once it gets close to harvest… a very dark-colored and resinous plant.\n    [aroma] => Very strong and musky, reminiscent mostly of the Bubba Kush mother with tinges of hashy sweet fruit<strong></strong>\n    [flavor] => Again, strong and musky, with some of the Bubba Kush dark tastes (coffee, chocolate, garlic) and just a slight sweetness that comes out at times<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Stone+Mountain/stone-mountain-dry-2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Stone Mountain', '', 'publish', 'closed', 'closed', '', 'stone-mountain', '', '', '2017-02-14 18:42:24', '2017-02-14 18:42:24', '', 0, 'http://tpb.waaark.dev/product/stone-mountain/', 0, 'product', '', 0),
	(702, 3, '2017-02-14 18:42:26', '2017-02-14 18:42:26', '', 'thumbnail_701', '', 'inherit', 'closed', 'closed', '', 'thumbnail_701', '', '', '2017-02-14 18:42:26', '2017-02-14 18:42:26', '', 701, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_701.jpg', 0, 'attachment', 'image/jpeg', 0),
	(703, 3, '2017-02-14 18:42:26', '2017-02-14 18:42:26', 'Array\n(\n    [strain_name] => Strawberry Cough\n    [description] => Known for its sweet and Hazy smell, this special clone-only strain was discovered by chance and went on to become a High times Strain of the Year in 2005 while also becoming a major piece in breeding projects for its collection of terpenes.? The 100% Indica Strawberry Fields mother lends stoutness, weight, and that lovely sweetness to the strain, while the Haze seems to contribute the majority of the effects.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029328\n    [record_id] => 123\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Known for its sweet and Hazy smell, this special clone-only strain was discovered by chance and went on to become a High times Strain of the Year in 2005 while also becoming a major piece in breeding projects for its collection of terpenes.  The 100% Indica Strawberry Fields mother lends stoutness, weight, and that lovely sweetness to the strain, while the Haze seems to contribute the majority of the effects.\n    [aroma] => The sweet berry cream elements dominate, but there is a sharp Haze in the background.<strong> </strong>\n    [flavor] => Slightly flowery and almost soapy at times, there is a bit of fruity sweetness, but it changes places from the smell and takes its turn in the background.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Strawberry+Cough/strawberrycough_bcc_3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Strawberry Cough', '', 'publish', 'closed', 'closed', '', 'strawberry-cough', '', '', '2017-02-14 18:42:26', '2017-02-14 18:42:26', '', 0, 'http://tpb.waaark.dev/product/strawberry-cough/', 0, 'product', '', 0),
	(704, 3, '2017-02-14 18:42:28', '2017-02-14 18:42:28', '', 'thumbnail_703', '', 'inherit', 'closed', 'closed', '', 'thumbnail_703', '', '', '2017-02-14 18:42:28', '2017-02-14 18:42:28', '', 703, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_703.jpg', 0, 'attachment', 'image/jpeg', 0),
	(705, 3, '2017-02-14 18:42:29', '2017-02-14 18:42:29', 'Array\n(\n    [strain_name] => Strawberry Haze\n    [description] => <p>The sweet Swiss Sativa on the mother\'s side gives this strain its distinct sugary berry aroma and taste, while the workhorse NL #5 x Haze on the "father\'s side" (this is feminized stock, so it was also a female plant) adds robust growth and vigor while reducing overall size.? With tight internodal spacing, it is a solid choice for Haze lovers who don\'t want a gigantic plant that is impossible to keep contained indoors.? The structure also tends to be fairly linear, making it a good choice for SOG methods and other vertical growing.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2931\n    [record_id] => 124\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The sweet Swiss Sativa on the mother\'s side gives this strain its distinct sugary berry aroma and taste, while the workhorse NL #5 x Haze on the "father\'s side" (this is feminized stock, so it was also a female plant) adds robust growth and vigor while reducing overall size.  With tight internodal spacing, it is a solid choice for Haze lovers who don\'t want a gigantic plant that is impossible to keep contained indoors.  The structure also tends to be fairly linear, making it a good choice for SOG methods and other vertical growing.</p>\n    [aroma] => <p>Saccharine sweet strawberry + melons + flowers aroma, one of the sweetest-smelling Sativas you\'ll find.<strong> </strong></p>\n    [flavor] => <p>Slightly less pronounced than the smell, the flavor is still almost identical to the aroma, with its candy-like fruit flavor lasting through the majority of the dosage.<strong> </strong></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Strawberry+Haze/DSC_0004(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Strawberry Haze', '', 'publish', 'closed', 'closed', '', 'strawberry-haze', '', '', '2017-02-14 18:42:29', '2017-02-14 18:42:29', '', 0, 'http://tpb.waaark.dev/product/strawberry-haze/', 0, 'product', '', 0),
	(706, 3, '2017-02-14 18:42:34', '2017-02-14 18:42:34', '', 'thumbnail_705', '', 'inherit', 'closed', 'closed', '', 'thumbnail_705', '', '', '2017-02-14 18:42:34', '2017-02-14 18:42:34', '', 705, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_705.jpg', 0, 'attachment', 'image/jpeg', 0),
	(707, 3, '2017-02-14 18:42:36', '2017-02-14 18:42:36', 'Array\n(\n    [strain_name] => Strawberry Kush\n    [description] => <p>Smelling fruity and sweet, the Sour Diesel elements seem to come through more on the smoke, chasing off the berry notes.? Several versions exist, but the most common version is a mellow Sativa that gets its smell from the Strawberry Cough and its appearance and flavor primarily from the Sour Diesel/Kush side of the family.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 125\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Smelling fruity and sweet, the Sour Diesel elements seem to come through more on the smoke, chasing off the berry notes.  Several versions exist, but the most common version is a mellow Sativa that gets its smell from the Strawberry Cough and its appearance and flavor primarily from the Sour Diesel/Kush side of the family.</p>\n    [aroma] => <p>Sweet and fruity, very much reminiscent of the strawberry and raspberry genetics - only a hint of sharpness<strong> </strong></p>\n    [flavor] => <p>Spicy and Kush-dominant, lacking the fruitiness that was present in the smell.<strong> </strong></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Strawberry+Kush/strawberry-kush-21(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid (most common version)\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Strawberry Kush', '', 'publish', 'closed', 'closed', '', 'strawberry-kush', '', '', '2017-02-14 18:42:36', '2017-02-14 18:42:36', '', 0, 'http://tpb.waaark.dev/product/strawberry-kush/', 0, 'product', '', 0),
	(708, 3, '2017-02-14 18:42:42', '2017-02-14 18:42:42', '', 'thumbnail_707', '', 'inherit', 'closed', 'closed', '', 'thumbnail_707', '', '', '2017-02-14 18:42:42', '2017-02-14 18:42:42', '', 707, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_707.jpg', 0, 'attachment', 'image/jpeg', 0),
	(709, 3, '2017-02-14 18:42:42', '2017-02-14 18:42:42', 'Array\n(\n    [strain_name] => Sugar Cookie\n    [description] => <p>The smell is something very unique that most of us hadn\'t encountered previously, a very refreshing and complex aroma that reminded us of other strains but always threw a wrench into the mix with an unexpected whiff of something. The effects were certainly Indica-dominant in the "stoned" vein where sitting on the couch relaxing and staring blankly at a movie seems like a great idea, making this a highly recommendable evening medication. It\'s great for unwinding at the end of the day without being incapacitated and serves to prepare the body and mind for a night of restful sleep.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 126\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The smell is something very unique that most of us hadn\'t encountered previously, a very refreshing and complex aroma that reminded us of other strains but always threw a wrench into the mix with an unexpected whiff of something. The effects were certainly Indica-dominant in the "stoned" vein where sitting on the couch relaxing and staring blankly at a movie seems like a great idea, making this a highly recommendable evening medication. It\'s great for unwinding at the end of the day without being incapacitated and serves to prepare the body and mind for a night of restful sleep.</p>\n    [aroma] => <p>This strain has a very unique aroma that brought to mind a variety of sharp yet sweet scents. A burst of lime-kissed cleaner meets a sugary cherry syrup quality - it\'s certainly very sweet but the freshness and sharpness adds a complex dimension that was not noticed before breaking/grinding it up. Top-notch aroma here, and very unique.</p>\n    [flavor] => <p>The initial flavor was much like the smell - a more flowery and smooth version of the lime-pine-sweetness combination. As the taste progressed though, it took on more of a holiday spice + anise quality, with an interesting sharp muskiness. The flavor degraded quite a bit th0ugh as it progressed, making us cough quite a bit and leaving a slightly funky aftertaste. Flush-wise, it could definitely use some work, as the final ash was a somewhat murky dark gray for most of the review staff.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Sugar+Cookie/sugar-cookie-21(500x500).jpg\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Sugar Cookie', '', 'publish', 'closed', 'closed', '', 'sugar-cookie', '', '', '2017-02-14 18:42:42', '2017-02-14 18:42:42', '', 0, 'http://tpb.waaark.dev/product/sugar-cookie/', 0, 'product', '', 0),
	(710, 3, '2017-02-14 18:42:45', '2017-02-14 18:42:45', '', 'thumbnail_709', '', 'inherit', 'closed', 'closed', '', 'thumbnail_709', '', '', '2017-02-14 18:42:45', '2017-02-14 18:42:45', '', 709, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_709.jpg', 0, 'attachment', 'image/jpeg', 0),
	(711, 3, '2017-02-14 18:42:45', '2017-02-14 18:42:45', 'Array\n(\n    [strain_name] => Summit Sweet Skunk\n    [description] => Seeming much like a standard Island Sweet Skunk or another BC Sweet Skunk variety, this one may have been simply renamed or may be a special phenotype or S1 coming from that genetic line that was stabilized in Summit County, CO.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0944\n    [record_id] => 127\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Seeming much like a standard Island Sweet Skunk or another BC Sweet Skunk variety, this one may have been simply renamed or may be a special phenotype or S1 coming from that genetic line that was stabilized in Summit County, CO.\n    [aroma] => Skunky and not particularly sweet, it has a little background of citrus-pine as well.<strong> </strong>\n    [flavor] => Mild citrus<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Summit+Sweet+Skunk/summitsweetskunk_dkc_3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid, claimed to be Indica in growth pattern, but the ISS line is generally Sativa\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Summit Sweet Skunk', '', 'publish', 'closed', 'closed', '', 'summit-sweet-skunk', '', '', '2017-02-14 18:42:45', '2017-02-14 18:42:45', '', 0, 'http://tpb.waaark.dev/product/summit-sweet-skunk/', 0, 'product', '', 0),
	(712, 3, '2017-02-14 18:42:47', '2017-02-14 18:42:47', '', 'thumbnail_711', '', 'inherit', 'closed', 'closed', '', 'thumbnail_711', '', '', '2017-02-14 18:42:47', '2017-02-14 18:42:47', '', 711, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_711.jpg', 0, 'attachment', 'image/jpeg', 0),
	(713, 3, '2017-02-14 18:42:47', '2017-02-14 18:42:47', 'Array\n(\n    [strain_name] => Super Lemon Haze\n    [description] => <p>With its strong and sweet lemon qualities in both the smell and taste, this strain certainly lives up to its reputation and name when well-grown. ?With the Indica lineage present in the Sativa-dominant hybrid, it results in a rather calm experience for a Haze-based strain - rather balanced between head and body effects overall. ?The plant grows with short internodes and responds well to topping. ?The standard shape for the untrained plant is a Christmas tree-style Sativa, with solid buds that have a high calyx-to-leaf ratio.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 49\n    [record_id] => 128\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>With its strong and sweet lemon qualities in both the smell and taste, this strain certainly lives up to its reputation and name when well-grown.  With the Indica lineage present in the Sativa-dominant hybrid, it results in a rather calm experience for a Haze-based strain - rather balanced between head and body effects overall.  The plant grows with short internodes and responds well to topping.  The standard shape for the untrained plant is a Christmas tree-style Sativa, with solid buds that have a high calyx-to-leaf ratio.</p>\n    [aroma] => <p>Strongly citrusy (lemon peel, grapefruit), often smelling sweet like Lemonheads candy - the Haze elements come through in the form of a flowery and spicy undertone.</p>\n    [flavor] => <p>Rather lemony with some flowery elements, almost identical to the smell when grown properly.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Super+Lemon+Haze/super-lemon-haze-releaf-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => This strain is loaded with terps! High limonene content makes this strain full of lemon and citrus flavor, and is great for improving mood. I always get a strong case of the munchies after smoking super lemon haze. Be sure you keep the fridge well stocked with snacks!:Terpene_Barnes\n    [stars] => 4.5\n)\n', 'Super Lemon Haze', '', 'publish', 'closed', 'closed', '', 'super-lemon-haze', '', '', '2017-02-14 18:42:47', '2017-02-14 18:42:47', '', 0, 'http://tpb.waaark.dev/product/super-lemon-haze/', 0, 'product', '', 0),
	(714, 3, '2017-02-14 18:42:49', '2017-02-14 18:42:49', '', 'thumbnail_713', '', 'inherit', 'closed', 'closed', '', 'thumbnail_713', '', '', '2017-02-14 18:42:49', '2017-02-14 18:42:49', '', 713, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_713.jpg', 0, 'attachment', 'image/jpeg', 0),
	(715, 3, '2017-02-14 18:42:50', '2017-02-14 18:42:50', 'Array\n(\n    [strain_name] => Super Silver Crippler\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928276\n    [record_id] => 129\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => \n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/Super+Silver+Crippler/image2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Mostly Sativa hybrid, Super Silver Haze x Wheelchair Crippler (reportedly Basic 5, a Super Sativa Seed Club breeding project that is a precursor to Northern Lights #5, crossed with a Skunk)\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Super Silver Crippler', '', 'publish', 'closed', 'closed', '', 'super-silver-crippler', '', '', '2017-02-14 18:42:50', '2017-02-14 18:42:50', '', 0, '', 0, 'product', '', 0),
	(716, 3, '2017-02-14 18:57:29', '2017-02-14 18:57:29', 'Array\n(\n    [strain_name] => Super Silver Haze\n    [description] => Perhaps the most award-winning strain ever created, Super Silver Haze was the prized brainchild of renowned Green House breeder Shantibaba.? A fusion of 2 of the most desirable commercial strains (Skunk #1 and Northern Lights #5) and the racy and rangy Haze C, SSH is considered by many to be the perfect Sativa-dominant hybrid, combining the best in mental and physical effects.? The addition of the Skunk and NL keep the flowering times and size manageable for indoor growth, making the normally-equatorial Haze feasible for indoor growing.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 130\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Perhaps the most award-winning strain ever created, Super Silver Haze was the prized brainchild of renowned Green House breeder Shantibaba.  A fusion of 2 of the most desirable commercial strains (Skunk #1 and Northern Lights #5) and the racy and rangy Haze C, SSH is considered by many to be the perfect Sativa-dominant hybrid, combining the best in mental and physical effects.  The addition of the Skunk and NL keep the flowering times and size manageable for indoor growth, making the normally-equatorial Haze feasible for indoor growing.\n    [aroma] => Pine, menthol, and sour citrus are the main smells with this variety - some can get more towards the flowery Haze side of the spectrum as well.<strong> </strong>\n    [flavor] => Citrus-pine Haze with some eucalyptus notes.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Super+Silver+Haze/super-silver-haze-3{500x500}.png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Super Silver Haze', '', 'publish', 'closed', 'closed', '', 'super-silver-haze', '', '', '2017-02-14 18:57:29', '2017-02-14 18:57:29', '', 0, 'http://tpb.waaark.dev/product/super-silver-haze/', 0, 'product', '', 0),
	(717, 3, '2017-02-14 18:57:32', '2017-02-14 18:57:32', '', 'thumbnail_716', '', 'inherit', 'closed', 'closed', '', 'thumbnail_716', '', '', '2017-02-14 18:57:32', '2017-02-14 18:57:32', '', 716, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_716.jpg', 0, 'attachment', 'image/jpeg', 0),
	(718, 3, '2017-02-14 18:57:33', '2017-02-14 18:57:33', 'Array\n(\n    [strain_name] => Sweet Afghani Delicious\n    [description] => <p>Unexpectedly sweet and fruity, this strain will certainly please those patients who place smell on the top of their list of qualities to look for. But even if that\'s not your thing, the effects were genuinely enjoyed by all of the staff, especially as a late-day or night-time med when relaxation is the goal. A very interesting strain indeed, though we wish the duration was a little longer.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2350CCHG\n    [record_id] => 131\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => duration was a little longer.</p>~\n    [aroma] => <p>Totally unexpected except for that it was in the name, this strain was extremely sweet-smelling, reminding us of movie theater red rope licorice or a strawberry fruit roll-up - wonderful sweet, fruity scent with no trace of the normal musk seen in the parent strains. Truly a top-notch smell package for people who like sweet and fruity… the pungency is quite remarkable as well.</p>\n    [flavor] => <p>Though one reviewer picked up some sweetness, this one was thought to be mainly earthy and much more reminiscent of the usual Afghani varietals. This one had a variety of woodsy and earthy tastes but also a twang that reminded one reviewer of fancy cheeses. It was a rather smooth smoking experience but left a medium gray ash and likely could\'ve used a slightly longer flush.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Sweet+Afghani+Delicious/image1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Sweet Afghani Delicious', '', 'publish', 'closed', 'closed', '', 'sweet-afghani-delicious', '', '', '2017-02-14 18:57:33', '2017-02-14 18:57:33', '', 0, 'http://tpb.waaark.dev/product/sweet-afghani-delicious/', 0, 'product', '', 0),
	(719, 3, '2017-02-14 18:57:37', '2017-02-14 18:57:37', '', 'thumbnail_718', '', 'inherit', 'closed', 'closed', '', 'thumbnail_718', '', '', '2017-02-14 18:57:37', '2017-02-14 18:57:37', '', 718, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_718.jpg', 0, 'attachment', 'image/jpeg', 0),
	(720, 3, '2017-02-14 18:57:37', '2017-02-14 18:57:37', 'Array\n(\n    [strain_name] => Sweet Tooth\n    [description] => \n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029328\n    [record_id] => 132\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => \n    [aroma] => <p>Sweet and pungent almost like a good blueberry - berries in general.</p>\n    [flavor] => <p>Similar to smell, a sweet and sour tinge.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Sweet+Tooth/image2(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Sweet Tooth', '', 'publish', 'closed', 'closed', '', 'sweet-tooth', '', '', '2017-02-14 18:57:37', '2017-02-14 18:57:37', '', 0, 'http://tpb.waaark.dev/product/sweet-tooth/', 0, 'product', '', 0),
