	(724, 3, '2017-02-14 18:57:42', '2017-02-14 18:57:42', 'Array\n(\n    [strain_name] => Tangerine Haze\n    [description] => <p>A very special phenotype of Soma\'s original NYCD x G-13/Haze, Tangerine Haze was discovered by the Devil\'s Harvest Krew in 2003-04 and has since become something of a legend, especially in Colorado. ?The plant is one of the most uncanny-smelling fruity strains on the planet, smelling and tasting exactly like a freshly-peeled tangerine, down to the sensation of the semi-bitter skin. ?It grows tall and vigorously, forming strong creamy-orange colas that perfume the room.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 134\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>A very special phenotype of Soma\'s original NYCD x G-13/Haze, Tangerine Haze was discovered by the Devil\'s Harvest Krew in 2003-04 and has since become something of a legend, especially in Colorado.  The plant is one of the most uncanny-smelling fruity strains on the planet, smelling and tasting exactly like a freshly-peeled tangerine, down to the sensation of the semi-bitter skin.  It grows tall and vigorously, forming strong creamy-orange colas that perfume the room.</p>\n    [aroma] => <p>The smell of Tangerine Haze is legendary as being one of the few fruit-named strains that is a perfect replica of its namesake, filling the sinuses with a pungent and uncanny tangerine smell with a floral backdrop.  If it\'s let go beyond 65 days, it often takes on an astringent quality, so most growers like to take her down early if anything.</p>\n    [flavor] => <p>The flavor is almost more tangerine-heavy than the scent, even going as far as to give the flavor of the semi-bitter skin or citrus zest along with the fresh citrus attack.  The flavor tends to linger in the mouth and sinuses for a long time after consumption, which increases the already amazing taste appeal of this strain.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Tangerine+Haze/tangerine-haze-4(500x500).pngGirl+Scout+Cookies/girl-scout-cookies-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Tangerine Haze', '', 'publish', 'closed', 'closed', '', 'tangerine-haze', '', '', '2017-02-14 18:57:42', '2017-02-14 18:57:42', '', 0, 'http://tpb.waaark.dev/product/tangerine-haze/', 0, 'product', '', 0),
	(725, 3, '2017-02-14 18:57:43', '2017-02-14 18:57:43', '', 'thumbnail_724', '', 'inherit', 'closed', 'closed', '', 'thumbnail_724', '', '', '2017-02-14 18:57:43', '2017-02-14 18:57:43', '', 724, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_724.jpg', 0, 'attachment', 'image/jpeg', 0),
	(726, 3, '2017-02-14 18:57:44', '2017-02-14 18:57:44', 'Array\n(\n    [strain_name] => Thai Passion\n    [description] => <p>Like many Sativas, this one hit our staff a bit differently depending on the time of day and incoming mood - your experience may vary according to the same. It\'s definitely a strong Sativa though, which we would probably peg at around 85%? the effects package was almost entirely mental and/or body energy. While the taste was a bit confusing, the rest of the appeal categories were definitely above-average, displaying very traditional Sativa structure and texture that\'s always nice to see. We recommend this to those patients who are looking for a Sativa to give them a boost of energy but don\'t mind a possible bit of anxiousness - depending on how it affects you, your mental state should still be active and engaged? whether or not the body follows along is another matter.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 135\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Like many Sativas, this one hit our staff a bit differently depending on the time of day and incoming mood - your experience may vary according to the same. It\'s definitely a strong Sativa though, which we would probably peg at around 85%… the effects package was almost entirely mental and/or body energy. While the taste was a bit confusing, the rest of the appeal categories were definitely above-average, displaying very traditional Sativa structure and texture that\'s always nice to see. We recommend this to those patients who are looking for a Sativa to give them a boost of energy but don\'t mind a possible bit of anxiousness - depending on how it affects you, your mental state should still be active and engaged… whether or not the body follows along is another matter.</p>\n    [aroma] => <p>Not very pungent in the jar at all, this strain had a sweet-sour and slightly putrid tropical fruit bouquet when ground up, reminding one reviewer of papaya. This was a fairly unique smell, though not pungent enough to be all that impressive.</p>\n    [flavor] => <p>The majority of reviewers picked up on darker sweet flavors, such as roasted marshmallows, coffee, and nuts… but one reviewer (using an Incredibowl) caught a faint distinct yet disitinct fruit skin taste that danced peach skin that and grapefruit peel as the bowl burned. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Thai+Passion/thai-passion-8(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Thai Passion', '', 'publish', 'closed', 'closed', '', 'thai-passion', '', '', '2017-02-14 18:57:44', '2017-02-14 18:57:44', '', 0, 'http://tpb.waaark.dev/product/thai-passion/', 0, 'product', '', 0),
