	(728, 3, '2017-02-14 18:57:47', '2017-02-14 18:57:47', 'Array\n(\n    [strain_name] => The Church\n    [description] => A relaxing Indica-dominant strain that is hearty and resistant to mold and disease.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 82-0944\n    [record_id] => 136\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A relaxing Indica-dominant strain that is hearty and resistant to mold and disease.\n    [aroma] => \n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/The+Church/image12(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'The Church', '', 'publish', 'closed', 'closed', '', 'the-church', '', '', '2017-02-14 18:57:47', '2017-02-14 18:57:47', '', 0, 'http://tpb.waaark.dev/product/the-church/', 0, 'product', '', 0),
