	(730, 3, '2017-02-14 18:57:51', '2017-02-14 18:57:51', 'Array\n(\n    [strain_name] => The Prophet\n    [description] => <p>The Tang Tang is from Grindhouse Medical Seeds\' Sonja line (derived from Blockhead but Sativa-dominant) and adds some needed heft, vigor, and yield to the normally stingy Pre-\'98 Bubba Kush mom. ?The different phenotypes are almost like different strains, with the Bubba-dominant phenos taking on the rounded shape and large calyxes of the mother, and the Tang Tang growing pointed colas with leaves coated from stem to tip with trichomes. ?A skilled selection process will yield incredible results with this one. ?</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 49\n    [record_id] => 137\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The Tang Tang is from Grindhouse Medical Seeds\' Sonja line (derived from Blockhead but Sativa-dominant) and adds some needed heft, vigor, and yield to the normally stingy Pre-\'98 Bubba Kush mom.  The different phenotypes are almost like different strains, with the Bubba-dominant phenos taking on the rounded shape and large calyxes of the mother, and the Tang Tang growing pointed colas with leaves coated from stem to tip with trichomes.  A skilled selection process will yield incredible results with this one.  </p>\n    [aroma] => <p>The Bubba-dominant plants definitely recall the mother, but have a less foreboding and musky aroma, seemingly being freshened up by the herbal and zesty Tang Tang.  Both phenos have notes of incense, hash, citrus, and the backing  deep chocolate/coffee notes of the Bubba, but the Tang Tang just has less aroma overall, smelling mostly of the trichomes that coat every surface.</p>\n    [flavor] => <p>With a background of the Bubba dankness, the flavor is lightened up by the Tang Tang, adding elements of citrus and herbs.  The flavor isn\'t overwhelmingly strong like a proper Bubba is, but it hands in the mouth in much the same way, reminding the user of the flavor seemingly at random for a while after smoking.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/The+Prophet/prophet-tang-tang-5(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid, depends upon phenotype\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'The Prophet', '', 'publish', 'closed', 'closed', '', 'the-prophet', '', '', '2017-02-14 18:57:51', '2017-02-14 18:57:51', '', 0, 'http://tpb.waaark.dev/product/the-prophet/', 0, 'product', '', 0),
