	(732, 3, '2017-02-14 18:57:54', '2017-02-14 18:57:54', 'Array\n(\n    [strain_name] => The Purps\n    [description] => A stout plant that often finishes a deep purple, it came out of the Mendocino County medical scene and has been a mainstay on dispensary menus ever since.? A musky Afghani smell and taste package with some hints of sweetness and dark fruit and an average yield.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 8928276\n    [record_id] => 138\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A stout plant that often finishes a deep purple, it came out of the Mendocino County medical scene and has been a mainstay on dispensary menus ever since.  A musky Afghani smell and taste package with some hints of sweetness and dark fruit and an average yield.\n    [aroma] => \n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/The+Purps/image12(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid (some Sativa phenos exist)\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'The Purps', '', 'publish', 'closed', 'closed', '', 'the-purps', '', '', '2017-02-14 18:57:54', '2017-02-14 18:57:54', '', 0, 'http://tpb.waaark.dev/product/the-purps/', 0, 'product', '', 0),
	(733, 3, '2017-02-14 18:57:57', '2017-02-14 18:57:57', '', 'thumbnail_732', '', 'inherit', 'closed', 'closed', '', 'thumbnail_732', '', '', '2017-02-14 18:57:57', '2017-02-14 18:57:57', '', 732, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_732.jpg', 0, 'attachment', 'image/jpeg', 0),
	(734, 3, '2017-02-14 18:57:57', '2017-02-14 18:57:57', 'Array\n(\n    [strain_name] => The White\n    [description] => <p>Named "The White" for the color of the finished buds (which absolutely drip with resin glands), this strain seems to be somewhere in the Kush family but is thought to have come from Triangle, an elite Florida strain. ?Though it\'s not considered a true OG among most collectors, it\'s reached the stratified air shared with those elite OG cuts in terms of rarity and overall value. ?The potency tends to be the most noteworthy trait of the strain aside from its incredible appearance, with many growers complaining of an overall weak taste compared to other OG-derived lines.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => MMJOBAMA\n    [record_id] => 139\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Named "The White" for the color of the finished buds (which absolutely drip with resin glands), this strain seems to be somewhere in the Kush family but is thought to have come from Triangle, an elite Florida strain.  Though it\'s not considered a true OG among most collectors, it\'s reached the stratified air shared with those elite OG cuts in terms of rarity and overall value.  The potency tends to be the most noteworthy trait of the strain aside from its incredible appearance, with many growers complaining of an overall weak taste compared to other OG-derived lines.</p>\n    [aroma] => <p>Lemon, pine, and hash, with some oddly sweet qualities creeping in at times - definitely "Kushy" in nature, though not as sharp as some OGs, trending instead towards the musky side of things.<strong></strong></p>\n    [flavor] => <p>Not necessarily known for its taste (many breeders cross it for its trichome coverage with another, tastier strain), The White gives off a pine-heavy taste with hints of Kush spice.  The smoke is thick and expansive, filling the chest and often causing coughing, especially on larger hits.<strong></strong></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/The+White/the-white-3(500?500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Hybrid, trends towards Indica dominance\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'The White', '', 'publish', 'closed', 'closed', '', 'the-white', '', '', '2017-02-14 18:57:57', '2017-02-14 18:57:57', '', 0, 'http://tpb.waaark.dev/product/the-white/', 0, 'product', '', 0),
	(735, 3, '2017-02-14 18:57:59', '2017-02-14 18:57:59', '', 'thumbnail_734', '', 'inherit', 'closed', 'closed', '', 'thumbnail_734', '', '', '2017-02-14 18:57:59', '2017-02-14 18:57:59', '', 734, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_734.jpg', 0, 'attachment', 'image/jpeg', 0),
	(736, 3, '2017-02-14 18:57:59', '2017-02-14 18:57:59', 'Array\n(\n    [strain_name] => The Wiz\n    [description] => <p>Without knowing much about what goes into this cross, it\'s hard to say which elements of the breeding were picked up in the experience. It was definitely Sativa-dominant during the initial effects part, but shifted gears heavily around the mid-way point, making this feel more like a 60/40% Sativa type of hybrid experience. The structure and texture were superb, while the rest of the "bag appeal" areas were only average. This one started off rather potent but seemed to tail off majorly, with the 2nd half feeling more like residual effects than anything. Overall though, we recommend this to mid-level patients who desire a smooth-smoking Sativa hybrid that won\'t keep them at peak potency for too long while also providing some quality body/mental relaxation, possibly leading to sleep (we\'d suggest it as a late afternoon/early PM strain).</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WWMMJ\n    [record_id] => 140\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Without knowing much about what goes into this cross, it\'s hard to say which elements of the breeding were picked up in the experience. It was definitely Sativa-dominant during the initial effects part, but shifted gears heavily around the mid-way point, making this feel more like a 60/40% Sativa type of hybrid experience. The structure and texture were superb, while the rest of the "bag appeal" areas were only average. This one started off rather potent but seemed to tail off majorly, with the 2nd half feeling more like residual effects than anything. Overall though, we recommend this to mid-level patients who desire a smooth-smoking Sativa hybrid that won\'t keep them at peak potency for too long while also providing some quality body/mental relaxation, possibly leading to sleep (we\'d suggest it as a late afternoon/early PM strain).</p>\n    [aroma] => <p>Though it wasn\'t pungent really, the smell was a pleasingly fresh-smelling blend of pine (at times with a chemical bent to it), vegetation, and a light sweetness.</p>\n    [flavor] => <p>There just wasn\'t much to this sample taste-wise - it seemed to mostly taste like smoke. It was never unpleasant though, only taking a turn for the worse towards the very end of the session. The smoke itself was light and easy to inhale, making this a good choice for those who don\'t wish to cough.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/The+Wiz/the-wiz-18(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'The Wiz', '', 'publish', 'closed', 'closed', '', 'the-wiz', '', '', '2017-02-14 18:57:59', '2017-02-14 18:57:59', '', 0, 'http://tpb.waaark.dev/product/the-wiz/', 0, 'product', '', 0),
	(737, 3, '2017-02-14 18:58:01', '2017-02-14 18:58:01', '', 'thumbnail_736', '', 'inherit', 'closed', 'closed', '', 'thumbnail_736', '', '', '2017-02-14 18:58:01', '2017-02-14 18:58:01', '', 736, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_736.jpg', 0, 'attachment', 'image/jpeg', 0),
	(738, 3, '2017-02-14 18:58:01', '2017-02-14 18:58:01', 'Array\n(\n    [strain_name] => Third Dimension\n    [description] => <p>The "bag appeal" for this one was very high, and it boasts a complex taste and smell package led into a supremely energetic but unfocused state that may be good for creativity but made it a little difficult to deal with daily tasks. This was a very strongly Sativa experience, complete with slight "crash" at the end - people who cannot handle the racy varieties should steer clear of this one, as that was its main property.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2350CCHG\n    [record_id] => 141\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>The "bag appeal" for this one was very high, and it boasts a complex taste and smell package led into a supremely energetic but unfocused state that may be good for creativity but made it a little difficult to deal with daily tasks. This was a very strongly Sativa experience, complete with slight "crash" at the end - people who cannot handle the racy varieties should steer clear of this one, as that was its main property.</p>\n    [aroma] => <p>Reminding us of expensive hand soaps, tropical fruit and dryer sheets, the aroma from the Third Dimension was a relatively sweet pine-citrus sharpness. with a little whiff of skunk The sweet elements came out more after a grind, but it was relatively pungent even in the jar.</p>\n    [flavor] => <p>Much like the aroma but less pungent, the flavor was an odd, yet appealing mix of citrus chemical pine and an almost flowery/perfumed sweetness. We wish it was more pungent, but it was a bit of an ethereal taste. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Third+Dimension/third-dimension-12(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Third Dimension', '', 'publish', 'closed', 'closed', '', 'third-dimension', '', '', '2017-02-14 18:58:01', '2017-02-14 18:58:01', '', 0, 'http://tpb.waaark.dev/product/third-dimension/', 0, 'product', '', 0),
