	(740, 3, '2017-02-14 18:58:05', '2017-02-14 18:58:05', 'Array\n(\n    [strain_name] => Tres Stardawg\n    [description] => <p>Chem D Backcross</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029328\n    [record_id] => 142\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Chem D Backcross</p>\n    [aroma] => \n    [flavor] => \n    [photo] => http://branch-designs.com/peakbeyond/final_images/Tres+Stardawg/image3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Tres Stardawg', '', 'publish', 'closed', 'closed', '', 'tres-stardawg', '', '', '2017-02-14 18:58:05', '2017-02-14 18:58:05', '', 0, 'http://tpb.waaark.dev/product/tres-stardawg/', 0, 'product', '', 0),
