	(742, 3, '2017-02-14 18:58:08', '2017-02-14 18:58:08', 'Array\n(\n    [strain_name] => Triangle\n    [description] => <p>Many people believe that Triangle is the mother of the OG Kush genetic line, as it was around in the early 1990\'s and carries all the hallmarks of a world-class OG Kush.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2931\n    [record_id] => 143\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Many people believe that Triangle is the mother of the OG Kush genetic line, as it was around in the early 1990\'s and carries all the hallmarks of a world-class OG Kush.</p>\n    [aroma] => <p>It has perhaps the most pure and strongest OG Kush aroma we\'ve encountered, with a pungent blend of lemons, spice, and floor cleaner that will raise the eyebrow of anyone questioning the "mother of OG Kush" story.  To us, it tastes and smells like Ghost\'s OG Kush on steroids - just more of everything.</p>\n    [flavor] => <p>Pine, gas, fuel that OG Kush is famous for.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Triangle/triangle-11(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Triangle', '', 'publish', 'closed', 'closed', '', 'triangle', '', '', '2017-02-14 18:58:08', '2017-02-14 18:58:08', '', 0, 'http://tpb.waaark.dev/product/triangle/', 0, 'product', '', 0),
	(743, 3, '2017-02-14 18:58:10', '2017-02-14 18:58:10', '', 'thumbnail_742', '', 'inherit', 'closed', 'closed', '', 'thumbnail_742', '', '', '2017-02-14 18:58:10', '2017-02-14 18:58:10', '', 742, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_742.jpg', 0, 'attachment', 'image/jpeg', 0),
	(744, 3, '2017-02-14 18:58:10', '2017-02-14 18:58:10', 'Array\n(\n    [strain_name] => Triple Diesel\n    [description] => <p>This is one of the real "crusher sativas" that almost mimics an indica couch lock with its oppressive head high. We\'ve found this in other diesels as well. The popularity of the standard Sour Diesel has pushed forward the palette for various Diesel varieties. <br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 144\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>This is one of the real "crusher sativas" that almost mimics an indica couch lock with its oppressive head high. We\'ve found this in other diesels as well. The popularity of the standard Sour Diesel has pushed forward the palette for various Diesel varieties. <br></p>\n    [aroma] => <p>Soily and slightly sweet in the jar, it breaks up to produce a fresh menthol-tinged soil scent when handled. It reminded one reviewer of freshly torn mint leaves… The pungency was pretty average, but it was enough to be noticed without being right near the bud.</p>\n    [flavor] => <p>Not as tasty as we expected, it was a pretty standard Diesel type taste, with a soil tinge similar to what was presented in the smell. There were no traces of the NYCD or Strawberry Diesel influence with their brand of sweetness, it was mostly just a fuel and soil taste, but not a particularly pungent one. It burned down to a medium-light gray ash, showing that it had an above-average flush job.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Triple+Diesel/image21(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Triple Diesel', '', 'publish', 'closed', 'closed', '', 'triple-diesel', '', '', '2017-02-14 18:58:10', '2017-02-14 18:58:10', '', 0, 'http://tpb.waaark.dev/product/triple-diesel/', 0, 'product', '', 0),
