	(746, 3, '2017-02-14 18:58:13', '2017-02-14 18:58:13', 'Array\n(\n    [strain_name] => Twilight\n    [description] => Originally intended for outdoor cropping, Twilight is a 100% Indica Afghani that often turns deep purple when mature.\n    [category] => Flowers\n    [type] => Indica\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 145\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Originally intended for outdoor cropping, Twilight is a 100% Indica Afghani that often turns deep purple when mature.\n    [aroma] => Musky Afghani with a sweetness creeping in at times<strong> </strong>\n    [flavor] => Spicy and smooth<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Twilight/image1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => 100% Indica\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Twilight', '', 'publish', 'closed', 'closed', '', 'twilight', '', '', '2017-02-14 18:58:13', '2017-02-14 18:58:13', '', 0, 'http://tpb.waaark.dev/product/twilight/', 0, 'product', '', 0),
