	(748, 3, '2017-02-14 18:58:17', '2017-02-14 18:58:17', 'Array\n(\n    [strain_name] => Urkle x OG Kush\n    [description] => A combination of two of California\'s most famous and popular strains, this one seems to have taken on the appearance of the Urkle with its radiant purple tones while taking on the OG Kush\'s distinct flavor.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2351CCHG\n    [record_id] => 146\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A combination of two of California\'s most famous and popular strains, this one seems to have taken on the appearance of the Urkle with its radiant purple tones while taking on the OG Kush\'s distinct flavor.\n    [aroma] => Soil, fuel, and that distinct Kush scent (mix of spices, often described as similar to ginger ale).<strong> </strong>\n    [flavor] => Much like the smell, it was definitely Kush-dominant, with an earthy tinge to it.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Urkle+x+OG+Kush/image6(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Urkle x OG Kush', '', 'publish', 'closed', 'closed', '', 'urkle-x-og-kush', '', '', '2017-02-14 18:58:17', '2017-02-14 18:58:17', '', 0, 'http://tpb.waaark.dev/product/urkle-x-og-kush/', 0, 'product', '', 0),
	(749, 3, '2017-02-14 18:58:21', '2017-02-14 18:58:21', '', 'thumbnail_748', '', 'inherit', 'closed', 'closed', '', 'thumbnail_748', '', '', '2017-02-14 18:58:21', '2017-02-14 18:58:21', '', 748, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_748.jpg', 0, 'attachment', 'image/jpeg', 0),
	(750, 3, '2017-02-14 18:58:21', '2017-02-14 18:58:21', 'Array\n(\n    [strain_name] => Warlock\n    [description] => <p>Crossed from ho-hum commercial strains (Afghani and Skunk #1), this plant was a bit of a surprise for Gerrit Slot, the owner/founder of Magus Genetics. ?The plant shows some Sativa-dominant traits such as its high calyx-to-leaf ratio, its stretch after start of flowering, and its overall "up" effects. It\'s a branchy plant that is easy to manicure due to low amounts of leaves - the finished smell is generally a strong sweet/sour, slightly fruity combo.</p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 3029329\n    [record_id] => 147\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Crossed from ho-hum commercial strains (Afghani and Skunk #1), this plant was a bit of a surprise for Gerrit Slot, the owner/founder of Magus Genetics.  The plant shows some Sativa-dominant traits such as its high calyx-to-leaf ratio, its stretch after start of flowering, and its overall "up" effects. It\'s a branchy plant that is easy to manicure due to low amounts of leaves - the finished smell is generally a strong sweet/sour, slightly fruity combo.</p>\n    [aroma] => <p>A strong, sweet, and sometimes sour aroma that is of the fruity variety.</p>\n    [flavor] => <p>A sharp, somewhat hashy taste going in, with a sweet and soft fruitiness on the exhale.  The smoke can be a bit on the harsh and expansive side.</p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Warlock/warlock-3(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Warlock', '', 'publish', 'closed', 'closed', '', 'warlock', '', '', '2017-02-14 18:58:21', '2017-02-14 18:58:21', '', 0, 'http://tpb.waaark.dev/product/warlock/', 0, 'product', '', 0),
	(751, 3, '2017-02-14 18:58:23', '2017-02-14 18:58:23', '', 'thumbnail_750', '', 'inherit', 'closed', 'closed', '', 'thumbnail_750', '', '', '2017-02-14 18:58:23', '2017-02-14 18:58:23', '', 750, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_750.jpg', 0, 'attachment', 'image/jpeg', 0),
	(752, 3, '2017-02-14 18:58:24', '2017-02-14 18:58:24', 'Array\n(\n    [strain_name] => White Rhino\n    [description] => A cross of the award-winning White Widow with an Afghani to increase yields and add more of an Indica effects package, White Rhino is a stout and sturdy plant that hardly stretches at all in flowering.? The Afghani genetics improve heartiness and disease/mold resistance while also shortening the flowering time slightly.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => 2932\n    [record_id] => 148\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => A cross of the award-winning White Widow with an Afghani to increase yields and add more of an Indica effects package, White Rhino is a stout and sturdy plant that hardly stretches at all in flowering.  The Afghani genetics improve heartiness and disease/mold resistance while also shortening the flowering time slightly.\n    [aroma] => Not really known for its flavor or smell, it\'s mostly a musky vegetal smell.<strong> </strong>\n    [flavor] => Hashy and a bit harsh normally, with some phenotypes/plants producing a more lemon taste.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/White+Rhino/image5(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica-dominant hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'White Rhino', '', 'publish', 'closed', 'closed', '', 'white-rhino', '', '', '2017-02-14 18:58:24', '2017-02-14 18:58:24', '', 0, 'http://tpb.waaark.dev/product/white-rhino/', 0, 'product', '', 0),
