	(754, 3, '2017-02-14 18:58:26', '2017-02-14 18:58:26', 'Array\n(\n    [strain_name] => White Widow\n    [description] => Called" white" due to its resin gland content as well as its tendency to not fully color up when ready to harvest, White Widow is known for being extremely potent.? A solid producer of connoisseur-quality nugs, it has been popular in Amsterdam coffee shops for many years and has been used in many breeding projects to increase the potency and vigor of other strains.? While not an outstanding yielder, it stays relatively short and compact, making it a good choice for home grows.? The males are said to be best for breeding because the females are not known for their smell and taste? the male will often lend the potency and trichomes of the strain while retaining the flavor terpenes of the chosen mother plant.\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => WW\n    [record_id] => 149\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => Called" white" due to its resin gland content as well as its tendency to not fully color up when ready to harvest, White Widow is known for being extremely potent.  A solid producer of connoisseur-quality nugs, it has been popular in Amsterdam coffee shops for many years and has been used in many breeding projects to increase the potency and vigor of other strains.  While not an outstanding yielder, it stays relatively short and compact, making it a good choice for home grows.  The males are said to be best for breeding because the females are not known for their smell and taste… the male will often lend the potency and trichomes of the strain while retaining the flavor terpenes of the chosen mother plant.\n    [aroma] => A blend of fruit and musky, putrid qualities - it hints at its potency with the smell, which has more of a bite to it than many fruity-smelling strains.  At times, it\'s all lemons and hashiness, depends a bit on the phenotype.<strong> </strong>\n    [flavor] => Often times neutral or even hashy due to the high trichome count, the strain sometimes has a citrusy, flowery bent, but is not known for being all that flavorful in general.<strong> </strong>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/White+Widow/white-widow-2-releaf-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Sativa-dominant hybrid (certain phenos can lean Indica though)\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'White Widow', '', 'publish', 'closed', 'closed', '', 'white-widow', '', '', '2017-02-14 18:58:26', '2017-02-14 18:58:26', '', 0, 'http://tpb.waaark.dev/product/white-widow/', 0, 'product', '', 0),
	(755, 3, '2017-02-14 18:58:28', '2017-02-14 18:58:28', '', 'thumbnail_754', '', 'inherit', 'closed', 'closed', '', 'thumbnail_754', '', '', '2017-02-14 18:58:28', '2017-02-14 18:58:28', '', 754, 'http://tpb.waaark.dev/wp-content/uploads/2017/02/thumbnail_754.jpg', 0, 'attachment', 'image/jpeg', 0),
	(756, 3, '2017-02-14 18:58:28', '2017-02-14 18:58:28', 'Array\n(\n    [strain_name] => Whitefire Tahoe OG\n    [description] => <p>Whtiefire OG x Tahoe OG<br></p>\n    [category] => Flowers\n    [type] => Hybrid\n    [brand] => \n    [in_stock] => true\n    [SKU] => GWS-MMJ\n    [record_id] => 150\n    [last_updated] => 2017-01-10 15:08:17\n    [repo_description] => <p>Whtiefire OG x Tahoe OG<br></p>\n    [aroma] => \n    [flavor] => <p>Whereas OG Raskal\'s White Fire OG has a roaste seed flavor, the White Fire Tahoe is especially tangy and woody. <br></p>\n    [photo] => http://branch-designs.com/peakbeyond/final_images/Whitefire+Tahoe+OG/wifi-tahoe-1(500x500).png\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => \n    [reviews] => \n    [stars] => \n)\n', 'Whitefire Tahoe OG', '', 'publish', 'closed', 'closed', '', 'whitefire-tahoe-og', '', '', '2017-02-14 18:58:28', '2017-02-14 18:58:28', '', 0, 'http://tpb.waaark.dev/product/whitefire-tahoe-og/', 0, 'product', '', 0),
