	(904, 3, '2017-02-15 20:31:44', '2017-02-15 20:31:44', 'Array\n(\n    [strain_name] => Berry White Budlets\n    [description] => \n    [category] => Flowers\n    [type] => Indica\n    [brand] => \n    [in_stock] => 1\n    [SKU] => 6\n    [record_id] => 4ec31ea9-4e1d-4357-976f-2d36b30105e1\n    [last_updated] => 2017-02-14 21:06:19\n    [repo_description] => \n    [aroma] => \n    [flavor] => \n    [photo] => \n    [photo_update] => \n    [strain_type] => \n    [prices] => 0.0 Gram:4\n    [reviews] => \n    [stars] => \n)\n', 'Berry White Budlets', '', 'publish', 'closed', 'closed', '', 'berry-white-budlets', '', '', '2017-02-15 20:31:44', '2017-02-15 20:31:44', '', 0, 'http://tpb.waaark.dev/product/berry-white-budlets/', 0, 'product', '', 0),
	(905, 3, '2017-02-15 20:31:45', '2017-02-15 20:31:45', 'Array\n(\n    [strain_name] => Blackberry Kush\n    [description] => \n    [category] => Flowers\n    [type] => Indica\n    [brand] => \n    [in_stock] => 1\n    [SKU] => 8\n    [record_id] => 38a9f67c-d07a-4706-a8ef-79b644062cea\n    [last_updated] => 2017-02-14 21:06:19\n    [repo_description] => <p> For our reviewers who were experiencing a lot of stomach discomfort, it did wonders for relieving that, and everyone really enjoyed the numbing, relaxed body effects as well. It\'s definitely a berry-scented strain, but that didn\'t translate to the taste. Still, the pleasant smoking experience again made up for that shortcoming, making this a perfect selection for patients who need an Indica but don\'t like the thick, at times cholorophyl-laden (since they generally have more leaf matter) smoke they deliver… "pleasant" was the word that kept coming to mind with this one.</p>\n    [aroma] => <p> This sample reminded us both of a purple strain and Blueberry with its slightly musky but sweet berry aroma — we did indeed pick up a Blackberry element to the smell as well. It was more piney and musky pre-grind, but sweetened up quite a bit and got more pungent once handled.</p>\n    [flavor] => <p>Lightly sweet and spicy in the mouth, this strain didn\'t have a ton of taste to it. The smoke was incredibly smooth and non-expansive though, making this a superb choice for those who don\'t want to cough.&nbsp;</p>\n    [photo] => https://images.potguide.com/strainreviews/51dca5ea3e1f43d42900077d/thumbs/1766__600x700_blackberry-kush-2_kr_large.jpg\n    [photo_update] => 2017-01-10 15:08:17\n    [strain_type] => Indica Dominant Hybrid\n    [prices] => 0.0 Gram:8\n    [reviews] => \n    [stars] => \n)\n', 'Blackberry Kush', '', 'publish', 'closed', 'closed', '', 'blackberry-kush', '', '', '2017-02-15 20:31:45', '2017-02-15 20:31:45', '', 0, 'http://tpb.waaark.dev/product/blackberry-kush/', 0, 'product', '', 0),
